126120-b001-4f04-975c-5c08a3dd2656/" target="_blank" rel="noopener">bhajana</a></em>s<em>.</em> A number of such cymbals may also be attached to a pair of tongs and is also called <em>cimtā</em> in the Indian tradition. Together with <em><a href="../meaning/4e40b1ae-00b4-4871-8baf-ee3470575ea9/" target="_blank" rel="noopener">tāḥ</a>, jhyāli</em> accompanies <em><a href="../meaning/7fa14c5c-dea8-4bd7-bd35-aaa6cb29c9ec/" target="_blank" rel="noopener">khiṃ</a></em> drum during musical performances; syn. <em>bamūcā, khvāymari, khvāymali, khvāymalcā, khvālimāli.</em></p>
e4a348c5-6667-4ba7-a2b2-6a3fd2c3aa6e	ghaḍī	घडी	<p>[fr. S. <em>ghaṭi</em>] var. <em>ghari</em>, <em>gharī</em>, <em>ghaṭī</em>, <em>ghaḍi</em>; n. a measure of time equal to 24 minutes usually measured by floating a bowl with a hole on a bucket filled with water.</p>
f9deb609-cc54-47b9-a742-a1e4f37bd5a4	aṣṭamī	 अष्टमी	<p>[S.] (old New. <em>aṣṭi</em>, <em>aṣṭiṅ</em>, <em>asti</em>) n. the eighth day of both fortnights of the lunar calendar.</p>
42fb6b7e-7f69-4839-8f36-4e3297bf16ee	bhuvana	 भुवन	<p>n. 1) the world, the earth.</p>\n<p>2) according to <em>purāṇa</em>, the 14 realms like <em>bhū</em>, <em>bhuva</em>, <em>sva</em>, <em>maha</em>, etc.; each of the seven realms above and below the earth.</p>\n<p>3) the number 14 based on that 14 realms (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/H9RUQ9IN/library" target="_blank" rel="noopener">Parājulī et al. 2067</a>: 962); generally <em>tri-bhuvana</em> or <em>bhuvana-traya</em>, the three worlds, are reckoned: <em>svarga</em> (the heaven), <em>martya</em> (the earth) and <em>pātāla</em> (the hell).</p>
50af9f34-2989-407c-8e1d-a31d3d940c98	kvacukaḥ	क्वचुक:	<p>var. <em>kvacukū</em>; n. lit. bolt that slides down; small door bolt from the lintel.</p>
