erif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. <em>nāykhiṃbājaṃ</em>, <em>nāykhiṃbājā</em>; n. lit. the drum of <em>nāy</em> (<em>nāyaḥ</em>), the Newar butcher caste; a two-headed drum of varying shape (barrel to cylindrical), played with a stick and a flat left hand, and the pair of <a href="../meaning/0a80b8eb-35d5-4c6d-b06f-8a616bcb2712/" target="_blank" rel="noopener"><em>sichyāḥ</em></a> cymbals which are called <em>kā̃y</em> by the <em>nāy </em>community that prefers to identify themselves as <em>nāyaḥ </em>these days. The expressions range from mere signals to the extreme sadness of <em><a href="../meaning/7f3c83eb-69d4-49f9-9d06-a17cbb063f33/" target="_blank" rel="noopener">sībājaṃ</a></em> (death music) or to the rhythmic ecstasy and joyful indulgement of <em>calti</em> (a dance piece) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/wegner/titleCreatorYear/items/JS6GV452/item-list" target="_blank" rel="noopener">Wegner 1988</a>: 9); see <em>sībājaṃ</em>.</p>
f3296089-124f-48b1-a189-24af4ab4a2dc	yākva	याक्व	<p>var. <em>yaku</em>, <em>yāku</em>; lit. arm pit; figural design that resemble an arm pit found on outer window frame (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 241).</p>
d9747f76-d55e-4d13-bbef-3bfd25e27f8a	lalitāsana	ललितासन	<p>var. <em>lalita āsana;</em> n. a sitting posture in which one leg hangs down while the other is bent in the usual position of the Buddha. It should be distinguished from the <a href="../meaning/3cc936ab-092d-49b1-b05d-43fdee8490d8/" target="_blank" rel="noopener"><em>ardhaparyaṅka</em></a> posture, in which both legs are on the same pedestal but one of the knees is raised while the other is bent in the usual position of the Buddha (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 432).</p>
fef1daf2-cccf-458a-92e3-54e02f81455a	hãkhitaḥ	 हँखित:	<p>[New.] var. <em>hãkhitala</em>; n. line on wood (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 77).</p>
8f9793b5-fd69-464b-b809-eb2b78e164a4	modaka	 मोदक	<p>[S.] n. a small round sweetmeat (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 835).</p>
b04ca2be-39d4-4684-999d-daeb2dfe3d5f	jaladroṇī	 जलद्रोणी	<p>[S.] n. a water bucket (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 415).</p>
e9d2f8c7-1460-40eb-ae93-a277b051dee2	śrī	 श्री	<p>[S.] n. word of blessing, can be used as apprecatio, in which case it means 'good fortune' (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/pierce/titleCreatorYear/items/VRMHZ2FE/item-list" target="_blank" rel="noopener">Pant and Pierce 1989</a>: 12), can be used as a prefix to names of persons and gods, in which case it means 'venerable' or 'glorious' respectively. The number of <em>śrī</em>s used varies, depending on context.</p>
6a6f662f-6551-4590-9508-8dc42f842747	dhuni	 धुनि	<p>n. the fire over which a <em>yogī</em> heats himself.</p>
18fe1380-e7b5-41a1-a326-768f6b079a9b	dyaḥbhu	 द्य:भु	<p>n. a <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guṭhī</em></a> member's share of all the dishes served in the annual <em>guṭhī</em> feast.</p>
8645edda-a316-405a-bd98-c37c754263c4	cākaḥdalū	चाक:दलू	<p>n. lit. round lampstand; <em>cākaḥdalū</em> is a host of <em>dalū</em>s lined around a shrine or <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> on a frame of stone or wood in a manner that they surround the monument. Each <em>dalū</em> of <em>cākaḥdalū</em> is called a <em>dalūpāḥ</em>; see <a href="../meaning/9b905ed2-ebc4-4945-ba7c-b3abe9edf8e5/" target="_blank" rel="noopener"><em>khādalū</em></a> and <a href="../meaning/3b1b7188-3964-4a04-b8cb-55c859c511fa/" target="_blank" rel="noopener"><em>tādalū</em></a>.</p>
297fc44f-e37f-463c-898d-cc7efd728678	byaḥ		<p><strong>[to be revised] </strong></p>\n<p>n. fermented substance for liquor distillation.</p>
46ed1d32-5157-46c4-b630-df9e9598c974	itāḥ	 इता:	<p>n. cotton wick; cotton balls are handspun into a thin, long thread that is folded five times at a finger's length and then twisted after separating it from the thread to make a cotton wick. Such wicks are mostly used for regular worships and on <a href="../meaning/ac07ce20-cbeb-4b4a-b3af-24ef14b4b16e/" target="_blank" rel="noopener"><em>sukundā</em></a>. <em>Itāḥ</em> is also made out of thin white cotton cloth rolled into the shape of a small stick that are mostly used in <em>ghyaḥdevā</em> (butter lamps). Similar <em>itāḥ</em> of cotton cloth but with a length of one's face is called <em>khyaluitāḥ</em> (lit. wick of a length of one's face) and is used during <em>Mhapujā</em>, the ritual worship of the self.</p>
c77c7500-e1d6-4de5-838c-5bcfb3da53e2	phyaḥaḥpā	 फ्य:अ:पा	<p>n. cornice brick.</p>
6b45fab6-9b02-435b-89d0-d4523851c2f7	nāḥgvaḥ	 ना:ग्व:	<p>[New.] n. raised or embossed design (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 50). A quarter-round or semi-round design mostly found on <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s and sometimes in the house of gods as well. The design may also contain patterns of scales to give it a serpentine look. In most cases, a <em>nāḥgvaḥ</em> represents a serpent, who is believed to be binding the monument to keep it strong. Usually, the <em>nāḥgvaḥ</em> design is quarter-round in shape in <em>caitya</em>s and semi-round in the house of gods. When found at the base of a <em>caitya,</em> the <em>nāḥgvaḥ</em> design may also contain the head and tail of a serpent intertwined in the northern side. The design is not found in <a href="../meaning/f67f58f1-3839-4d81-95a6-4b78e97566ce/" target="_blank" rel="noopener">Licchavi</a> <em>caitya</em>s.</p>
429ae589-76da-40c7-889d-d71796800234	akṣamāḥ	 अक्षमा:	<p>n. a string made of small beads of <em>śrīkhaṇḍa</em>, etc. used for counting prayers (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 2); a rosary of <em>rudrākṣa</em> beads (Elaeocarpus ganitrus or its berries). The number of beads may vary from 32, 54, 64 or 108.</p>
75e04e3c-67e1-4c03-bc61-44c2995d3e97	Buddha Jayantī	  बुद्ध जयन्ती	<p>n. the anniversary day of Lord Buddha's birth, attainment of enlightenment and demise (<em>mahāparinirvāṇa</em>); a function organised to observe the anniversary that falls on the full-moon day of the bright fortnight of <a href="../meaning/2a49e7df-d2fe-481b-9d7a-61583faddfa8/" target="_blank" rel="noopener">Vaiśākha</a>. Also known as Buddha <em>Pūrṇimā</em> and Buddha Day, the day is taken to be auspicious as it marks <em>trisaṃyoga</em>, the three auspicious occasions in the life of the Buddha. Among the Newars, this day is also known as <em>Svāṃyāpunhi</em>, the full-moon day of flowers.</p>
634662c3-731d-4864-9530-d7cb383ab2c4	ālīḍha	 आलीढ	<p>[S.] adj. a particular attitude in shooting (the right knee advanced, the left leg drawn back) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 154). It is an attitude exhibited in lower limbs. The <em>ālīḍha</em> posture signifies heroism (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 390). Compare <a href="../meaning/34846f84-c0bc-4fc1-aa80-ceecb84256cd/" target="_blank" rel="noopener"><em>pratyālīḍha</em></a>.</p>
ea9c66fb-1aa9-4719-9d82-99f4d15ebb8b	uṣṇīṣa cūḍāmaṇi	 उष्णीष चूडामणि	<p>n. crest jewel; round and topmost part of the finial of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
a4f69338-b67c-4072-aa35-18227c2e1cb6	desaymarujhyāḥ	 देसय्‌मरुझ्या:	<p>var. <em>desaymadujhyāḥ</em>; n. lit. a window which cannot be found anywhere else in the country; the window with eleven lintels in Nyata (Naradevī), Kathmandu. Another <em>desaymarujhyaḥ</em> can also be found in Patan. A finely carved window in a private house at Naḥtvāḥ is popularly known as the <em>desaymarujhyāḥ</em> of Patan. Although there is no <em>desaymarujhāḥ</em> in Bhaktapur, the <em>mhaykhājhyāḥ</em> (a window with a peacock) in Tacapāla also renowned for its craftsmanship.</p>
2ec4454f-9cd4-4e3f-b56d-1b593c711851	kijābhata	किजाभत	<p>var. <em>kijābhvata</em>; n. husband’s younger brother.</p>
91ba38b4-4613-44a7-90b6-9fa98a42163d	phã	फँ	<p>[fr. old New. <em>pha</em>] n. 1) a pot used to measure eight <a href="../meaning/53d25379-a4ed-4b85-9372-a67517986fec/" target="_blank" rel="noopener"><em>mānā</em></a>s. 2) volumetric unit of eight <em>mānā</em>s; syn. <em>phachi</em>.</p>
bf73f576-549a-4ef0-bf90-fafe1f7d2058	ācāḥju	आचा:जु	<p>[fr. New.] var. ācā, ācāju, ācāta; n. hon. 1) preceptor, spiritual guide (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 17). 2) priest. 3) one of the Newar castes whose members have undergone tantric initiation; usually referred to a Guruvācārya or Karmācārya.</p>
f3e7fee6-ad34-4a21-bb9d-39a10c3a49bb	mvacvaki	म्वच्वकि	<p>n. small pieces of rice grains.</p>
7ef7f234-1e2b-452d-b804-0244d4168fc3	upākhā	उपाखा	<p>n. 1) processional route (around Kathmandu) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20).</p>\n<p>2) place outside the city; syn. <em>upāku</em>. There is a tradition of going round the city offering a <em>pālcā</em> (small oil lamp of clay) at every crossroad and shrines in the name of a deceased family member. The tradition is called <em>upākhā ulegu</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 63).</p>
d94641ea-caf9-4b30-8924-c8cd8464280f	cvalāmū	  च्वलामू	<p>n. 1) topmost part of a pinnacle (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 34).</p>\n<p>2) the five tiers on top of a <a href="../meaning/3ad5c123-0361-44ee-89b1-11d5682ad730/" target="_blank" rel="noopener"><em>sinhaḥmū</em></a>; the cover of a <em>sinhaḥmū</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 38).</p>
9b905ed2-ebc4-4945-ba7c-b3abe9edf8e5	khādalū	खादलू	<p>n. lit. hanged lampstand; a lampstand hung by a metal chain on a rafter below roof eaves right in front of a window. People offer light to deities by putting a burnt wick on <em>khādalū</em> especially when there is a procession of any deity taken out in front of the house; see <em><a href="../meaning/3b1b7188-3964-4a04-b8cb-55c859c511fa/" target="_blank" rel="noopener">tādalū</a> </em>and <a href="../meaning/8645edda-a316-405a-bd98-c37c754263c4/" target="_blank" rel="noopener"><em>cākaḥdalū</em></a>.</p>
dde7819c-e6a3-4edb-ac5d-2ebf77974705	kathipādhvaṃ	कथिपाध्वं	<p>n. roof tile rebate (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 168).</p>
87a9f3f0-4046-457a-a215-bbbb4cb4fab1	aṣṭasāhasrikā	   अष्टसाहस्रिका	<p>[fr. S. <em>aṣṭasāhasraka</em>] n. consisting of eight thousand (e.g. <em>śloka</em>s, as one of the Buddhist <a href="../meaning/ee70aa6e-c5ae-4e48-8e64-bb1a0be4e75b/" target="_blank" rel="noopener"><em>Prajñāpāramitā</em></a>s) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 116).</p>
9281eeed-82d5-489c-b2b2-daac080f6fd5	bāaḥpā	बाअ:पा	<p>var.<em> bā-appā</em>; n. brick of medium size.</p>
077b980b-a53d-4f28-92f0-bf35229796fc	thva	थ्व	<p>var. <em>thvaḥ</em>, <em>thvaka</em>; n. suffix used with the Newar names of the lunar months to denote the bright fortnight (<em>śuklapakṣa</em>); see <a href="../meaning/f6c385a4-13a2-485c-8e87-6559276cef50/" target="_blank" rel="noopener"><em>gā</em></a>.</p>
4629d124-a851-4875-aab0-c827db79f532	caukulāṃ	  चउकुलां	<p>var. <em>cakulā̃</em>, <em>caukulā̃, cvakulā̃</em>,<em> cakulā</em>; <em>archit</em>. n. 1) a board with which to space a pair of pillars.</p>\n<p>2) the board between a post and the capital.</p>\n<p>3) the cornice above a window or door (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31).</p>
e73868d6-a83d-46a1-bcf5-0e7b7c1108b2	bhagiṃ	  भगिं	<p>[New.] n. tapering (of a <a href="../meaning/d082a037-83e2-412c-a4b4-71485feee8ee/" target="_blank" rel="noopener"><em>stūpa</em></a> or <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 63).</p>
15b50a53-cb7d-4f9b-afcc-31d70783dbb7	cibhāḥ	 चिभा:	<p>[New.] var. <em>cibāhāḥ</em>, <em>cibhāḥdyaḥ</em>; see <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
c71856be-94ef-4b35-835b-70b4856c692f	hitiphvaḥ	हितिफ्व:	<p>n. tap, faucet.</p>
c4112482-2f45-4a1b-bf7d-f34874fc7fa8	caturmukha	चतुर्मुख	<p>adj. lit. four-faced; four-faced image of any deity; syn. <em>caturmukhī.</em></p>
b931dead-98b3-4de5-9a1d-08df667d05e4	āmalaka	आमलक	<p>[S.] n. lit. myrobalan; a design also known as <em>ābhaḥ</em> (New.) found just above the <a href="../meaning/ff01eb73-6aa5-416c-9dcc-4d55b870538e/" target="_blank" rel="noopener"><em>trayodaśabhuvana</em></a> of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
