ans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. the great wisdom, it is the group of ten deities collectively known as <em>daśa mahāvidyā</em>. They are defined as the ten objects of transcendent knowledge. Symbolically, it is the five aspects of <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> and the five aspects of the <a href="../meaning/df481572-4fcc-46f7-9e7f-fdf99a763b6c/" target="_blank" rel="noopener">Śakti</a> (the divine power also portrayed as the Goddess) united as day and night. They are the energies of which the universe is the pulsation, the outer expression. These ten energies are called <em>daśa mahāvidyā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XURK54J2/library" target="_blank" rel="noopener">Daniélou 1985</a>: 268). Daniélou gives their names in this order: 1. Kālī, 2. Tārā, 3. Ṣoḍaśī, 4. Bhuvaneśvarī, 5. <a href="../meaning/80d52d0e-67e0-495c-a48b-327458276bb4/" target="_blank" rel="noopener">Chinnamastā</a>, 6. Bhairavī, 7. Dhūmāvatī, 8. Bagalā, 9. Mātaṅgī, and 10. Kamalā. Shankaranarayanan (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/8GM89ZJZ/library" target="_blank" rel="noopener">1975</a>: 4) defines them as the ten great paths of knowledge and gives their names as: 1. Kālī, 2. Tārā, 3. Tripurasundarī, 4. Bhuvaneśvarī, 5. Tripura Bhairavī, 6. Chinnamastā, 7. Dhūmāvatī, 8. Bagalāmukhī, 9. Mātaṅgī, and 10. Kamalātmikā. Ṣoḍaśī is also known as Tripurasundari. They are also believed to have originated from Goddess Pārvatī (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/josi/titleCreatorYear/items/JBD3PBE9/item-list" target="_blank" rel="noopener">Jośī 2070 VS</a>: 388). In Patan, there are separate shrines of <em>daśa mahāvidyā</em> that are worshipped by taking out a special procession on the 8th of the bright fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a> these days. The locations of their shrines in Patan are: 1. Kamalā at Puñcali (Purnachandi) 2. Tārā at Pūcva (Pulchok), 3. Bhuvaneśvarī at Naḥ Bahī (Nakabahil), 4. Bagalāmukhī at Kvanti (Kumbheshwar), 5. Dhumāvatī at Dhum Bāhāḥ (Dhumbahal), 6. Mātaṅgī at Svãtha (Swotha), 7. Chinnamastā at Mvaḥmadu Galli (Momaru Galli), 8. Tripura Sundarī at Cā Bāhāḥ (Chabahal), 9. Kālī at Taṃgaḥ (Tangal), and 10. Tripura Bhairavī at Bāḥlukhā (Bahalukha).</p>
4abffe2b-da93-44ab-ae9c-62e2e41eb2b0	lhugāḥ	ल्हुगा:	<p>[New.] n. bathing place.</p>
10958029-7ce0-4c0e-a88a-f758e39f271b	dāphā1	 दाफा	<p>var. <em>dāpā</em>; n. a type of music which is played with a certain set of musical instruments including a <a href="../meaning/7fa14c5c-dea8-4bd7-bd35-aaa6cb29c9ec/" target="_blank" rel="noopener"><em>khiṃ</em></a> (a large drum), a large pipe, and large cymbals (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 109). <em>Dāphā bhajana</em> is a genre of Hindu-Buddhist devotional singing performed by male, non-professional Newar musicians in towns and villages of the Kathmandu Valley. <em>Dāphā</em> is always sung by two sides of singers, who sing alternately and are accompanied by cymbals (<a href="../meaning/4e40b1ae-00b4-4871-8baf-ee3470575ea9/" target="_blank" rel="noopener"><em>tāḥ</em></a> and <a href="../meaning/b8788966-1617-4edd-a7ec-3f7b860b83f8/" target="_blank" rel="noopener"><em>jhyāli</em></a>). Each group of singers sits on either side of the drummer, but they may also perform whilst walking in processions at religious festivals. They are almost invariably accompanied by the barrel-drum <em>khīṃ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Widdess%20/titleCreatorYear/items/RVJCFV2G/item-list" target="_blank" rel="noopener">Widdess 2016</a>: 3).</p>
97e0c640-8af5-4307-98b0-748e0a757889	chatra	  छत्र	<p>n. 1) a small umbrella adorning a <a href="../meaning/e7f31a6a-0841-4129-98cb-507abbb18749/" target="_blank" rel="noopener"><em>toraṇa</em></a> or finial. These umbrellas usually have three folds and hence are also known as <em>svatãchatra</em>, meaning 'threefold umbrella'. However, this differs from the large umbrella used to cover deities during festivals, as well as members of the royal family and senior elders of monasteries when they take part in public functions. This larger umbrella is called <em>chatrakusā</em>. Both words, <em>chatra</em> in Sanskrit and <em>kusā</em> in Newari, mean umbrella.</p>\n<p>2) one of the eight emblems of the <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a>.</p>
999e2d76-29f2-41b6-8efc-2d67ba23504d	Jyeṣṭha	ज्येष्ठ	<p>[S.] var. <em>Jeṭha</em> (Nep.); n. name of a month (May-June), the month in which the full moon stands in the constellation <em>Jyeṣṭhā</em>.</p>
5ebd21ea-6e4f-4370-87ae-c5baa7864c53	ghaṅgalāphvaḥ	 घङ्गलाफ्व:	<p>var. <em>ghaṃgalāphvaḥ</em>, <em>ghaṃgalāphvala</em>; n. bell pattern carvings (lit. bell flowers) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 30).</p>
e831c011-5c32-46cd-b35b-d356278f0981	kikiṃpātvalaṃ	 किकिंपात्वलं	<p>var. <em>kikĩpātvalã</em>, <em>kikīpātvalaṃ</em>; n. tympanum without medalion (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 22); also called <em>matūtvalaṃ</em> for its shape like a crown, as it does not contain a central images and other features.</p>
67c8dd6c-9bb6-45f5-a499-3c9921bd5174	kapāla	कपाल	<p>[S.] var. <em>karppara</em>; n. 1) skull cup that is usually referred to as <em>kapālapātra</em>; either (i) severed head of a man, or (ii) the cup made of a skull, or (iii) a bowl. The skull cup is of two kinds; when it is filled with blood, it is called <em>asṛkkapāla</em>, and when with human flesh, it is called <em>māṃsakapāla</em>. The deities are supposed to partake of the blood or the flesh carried in these cups (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 435). Usually deities, the <a href="../meaning/df481572-4fcc-46f7-9e7f-fdf99a763b6c/" target="_blank" rel="noopener"><em>śakti</em></a> (female consort) in particular, are seen carrying a <em>kapāla</em> along with a <a href="../meaning/845aa05b-1009-4f23-b221-ce554bd4b266/" target="_blank" rel="noopener"><em>kartṛ</em></a>, a small jagged-edged knife.</p>\n<p>2) the alms-bowl of a beggar (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 250). But an alms-bowl is referred to as a <em>piṇḍapātra</em> in the Buddhist tradition. The alms-bowl found in the images of Śākyamuni Buddha or the five <em>dhyāni</em> Buddhas is never called a <em>kapāla</em> but a <em>piṇḍapātra</em>. However, a bowl used in esoteric worships at <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a>, be it of a monastery or a private house, is called <a href="../meaning/e0baa909-a8f2-4cd2-b4be-4a644874bed2/" target="_blank" rel="noopener"><em>kapālapātra</em></a>.</p>\n<p>3) a fragment of brick (on which the oblation is placed) (Monier-Williams 1964: 250).</p>
18f7feb4-f2ce-415f-9418-544d38a7b27d	ile	इले	<p>vt. 1) to smear, to besmear. 2) to paint, to white-wash. 3) to apply oil or ointment.</p>
b0fb08c6-f86b-4002-9c52-4bc072deef81	agiṃmathaḥ	 अगिंमथः	<p>[fr. S. <em>agnimaṭha</em>] var. <em>agĩthala</em>, <em>agigaḥ</em>; n. a place where an eternal flame is lit and tended. Also a place where vedic fire rituals are performed.</p>
4b0551a5-e3df-4783-bd00-a4b071f82c72	Bhādra	भाद्र	<p>[S.] var. Bhadau (Nep.), Bhādrapada; n. name of the fifth month (a rainy month corresponding to August - September) of the solar calendar adopted by the Vikrama era.</p>
61b54468-3735-4a5a-b4c3-5ad0a464fcef	nhaytaku		<p><strong>[to be revised]</strong></p>\n<p>n. brick of seven inches (of which two inches have been cut off).</p>
3bf14e2a-6c28-41a1-a712-d9d9cbd073b4	dabū	दबू	<p>var. <em>dabuli</em>, <em>ḍabalī </em>(Nep.); n. elevated platform in squares of Newar settlements that serves as a stage for theatrical performances and mask dances. Most of such platforms also bear a name that is given after its function or some historical events. For instance, the <em>dabū</em> at Patan Durbar Square is known as Kāttī Dabū, as <em>Kāttī Pyākhaṃ</em> (the dance exhibited in <a href="../meaning/595d9eb4-1430-4593-99a2-219660fc33f8/" target="_blank" rel="noopener">Kārtika</a>) is performed on this <em>dabū</em>.</p>
9308bdf4-6b6c-4d1b-a57d-eebf03d1c656	siliṃlūaḥpā	सिलिंलूअ:पा	<p>var. <em>silĩlu-appā</em>; n. multi-edged brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 75).</p>
f84597f0-c158-4d6b-aef7-698dcfdb2340	astalvahaṃ	 अस्तल्वहं	<p>var. <em>astalhvaṃ</em>; n. first foundation stone (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
e26f87a4-1d96-4321-9f3c-27ec96adb8f1	pāsaḥbhvay		<p><strong>[to be revised]</strong></p>\n<p>var. <em>pāsabhvaja</em>; n. ceremony observed on the twelfth day after a death.</p>
82b99ab5-4dc0-447f-a052-c09c03598cd4	pakanāy	 पकनाय्	<p>n. 1) name of <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a> in Pakanājola, Kathmandu, who is believed to improve the taste and quality of the Newar liquors like <a href="../meaning/ae175c99-b039-446a-9fa3-87756f63a2a1/" target="_blank" rel="noopener"><em>aylāḥ</em></a> and <em>thvã</em>. 2) a ritual worship which is performed at the <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a> shrines of Buinā Gaṇeśa (<a href="https://danam.cats.uni-heidelberg.de/report/3db42996-337a-11ea-b242-0242ac130002" target="_blank" rel="noopener">LAL0279</a>) in Patan and Pakanāydyaḥ in Pakanājola, Kathmandu. Locals believe that the deity enshrined at these temples makes their liquor stronger and tastier. A small portion of the liquor prepared for an important feast is put aside ahead of the feast. After the completion of the feast, the host organizes another small gathering for the worship of the deity and offer previously set aside liquor to the deity as a mark of gratitude for enhancing its taste and quality. The worship is known as <em>pakanāypujā</em>.</p>
84153a51-5097-43f8-9f27-5ecfe278e43a	su	सु	<p>n. <em>meas</em>. course of bricks.</p>
ac240bd1-c4f7-44d3-a4d2-3ebe4b2e6abf	āgaṃchẽ	 आगंछेँ	<p>var. <em>āgãche</em>, <em>āgache</em>, <em>agache</em>; n. the building that houses the shrine of esoteric clan deity in a secret room called <a href="../meaning/eaafedfb-7f48-4705-b40e-d2a97f240311/" target="_blank" rel="noopener"><em>āgaṃkvathā</em></a>, where the esoteric deity of a clan (of an artisan group like the brickmakers-<em>āvāḥ</em>, the tantric priests-Karmācārya or astrologers-Jośī) is worshipped. A small pinnacle above the secret room on the ridge, a slightly decorated window with a medalion in the center or guarding lions in front of the entrance door may mark a building as an <em>āgaṃchẽ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 117). <em>Āgaṃchẽ</em> usually has a relatively large space on one floor for hosting feasts for respective clan.</p>
4c3d1462-7609-4bbb-baff-e4720fc158b8	śrāddha	श्राद्ध	<p>[S.] n. periodic worship with various offerings made in the name of one's ancestors.</p>
e0d955be-88cc-4e54-8833-7e2ff5af17e0	dekhā	 देखा	<p>[fr. S. <em>dīkṣyā</em>] (old New. <em>dikhyā</em>) var. <em>dikhā, dichyā</em>; n. 1) the initiatory mantra, consecration (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 220)</p>\n<p>2) an initiatory rite undertaken by those among the Newar elite who adhere to tantricism which allows them access to the inner sanctum (<a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 109). There are various forms of <em>dekhā</em>; the most common being the mantra of <em>nhikaṃ</em>, i.e. the early morning prayer or worship. A person receiving the <em>nhikaṃ</em> mantra must perform worship at their <em>āgaṃ</em> every day before they have anything to eat.</p>
38075844-c9af-4dd3-92a4-fd2a15b2ebfa	pati2	 पति	<p>n. usually called <em>dhaupati</em>, it is a pair of small shallow brass pot for curd that is placed on a <a href="../meaning/cefee9c1-f48e-486c-b437-d12c3dbc47c0/" target="_blank" rel="noopener"><em>pujābhaḥ</em></a> (worship tray) along with other items like rice, flowers, vermillion powder, etc. while offering <em>sagaṃ</em> (blessing) on the occasion of someone's birthday, marriage, <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a> ritual, etc.; syn. <em>dhaupatu</em>.</p>
4be1dd4b-3cdb-4e43-9bcd-a9c9b36cde27	gvaydāṃ	ग्वय्‌दां	<p>var. <em>gvaydā̃</em>; ritual offering of betel nut and coin before initiating a big religious ceremony.</p>
