"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. one of the three deities of the Hindu trinity who is revered as the deity of preservation. He is usually depicted in dark blue or blue-gray colored skin with four arms. A <em>śaṅkha</em> (conch shell), <em>cakra</em> (discus), <em><a href="../meaning/be1b1383-96eb-4a98-a449-5561d9bdd502/" target="_blank" rel="noopener">gadā</a></em> and lotus are the implements he holds in his hands. He is also known as Nārāyaṇa and is the main deity worshipped by the followers of Vaiṣṇavism. He is widely known for his 10 incarnations.</p>
bd3d0c88-5a22-4da6-8fc4-0d138ada7166	gandhurī devatā	  गन्धुरी देवता	<p>n. the main deity of a Buddhist <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a> of <em>bramhacarya</em> <em>bhikṣu</em>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 144). <em>Bramhacarya bhikṣu</em> is a celibate monk. However, the residents of <em>bahī</em>s are no longer celibate. The main deity of a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> is never referred to as <em>gandhurī devatā</em>.</p>
cdacd1b4-5da2-4217-9253-980cc696d2de	sakhvāḥpā	सख्वा:पा	<p>var. <em>sakhvāpā</em>; n. annual ceremony during which a Buddhist <a href="../meaning/d082a037-83e2-412c-a4b4-71485feee8ee/" target="_blank" rel="noopener"><em>stūpa</em></a> receives a white-wash of lime.</p>
7f3c83eb-69d4-49f9-9d06-a17cbb063f33	sībājaṃ	 सीबाजं	<p>var. <em>sībājã</em>; n. a class of musical instrument used in funeral processions (the most important of which is the drum called <a href="../meaning/249fb246-140c-4af6-8c32-baf4d68dd043/" target="_blank" rel="noopener"><em>nāykhiṃ</em></a>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 263).</p>
d361a6ed-a8c7-4883-8218-d9bda2fb3e7e	khaḍga	खड्ग	<p>[S.] n. a large sacrificial knife, sword.</p>
fbed2751-4f6d-4656-bece-8d801bad240b	dhusaḥ2	धुस:	<p>n. a day ahead of the main worship or grand fire oblation.</p>
b4ffbe50-7bcd-4f50-a3e5-887b8170b73b	dhyāna mudrā	 ध्यान मुद्रा	<p>[S.] n. gesture of meditation in which both palms, which are placed on top of one another on one's lap, are facing up with fingers stretched while the two thumbs are raised slightly up; also called <em>samādhi mudrā</em>. <em>Dhyāna mudrā</em> is associated with <a href="../meaning/0516f979-9d32-49ce-80ec-5bd695955311/" target="_blank" rel="noopener">Amitābha</a> Buddha.</p>
3ee6639e-a083-4c18-ac13-455497f07e3d	ināydālū	इनाय्‌दलू	<p>n. <em>dalū</em> (traditional oil lamp) with an image of <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a>. Usually made of brass or clay, <em>a dalū</em> is actually a lampstand that has slightly concaved round or oval surface where one can pour oil, put a cotton wick and light its tip. <em>Ināydalū</em> is sometimes also used as a <a href="../meaning/ac07ce20-cbeb-4b4a-b3af-24ef14b4b16e/" target="_blank" rel="noopener"><em>sukundā</em></a> in rituals and worships.</p>
c7121906-3c95-4257-aeb0-78c7bcc6ab08	phirphircā	फिर्फिर्चा	<p>n. lathed rods (eaves or window) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 57); small decorative wooden rods with lathed designs, usually installed underneath a verandah.</p>
26389c9f-8853-4f04-8f5a-3610412e68a4	kvāḥjhyāḥ		<p><strong>[to be revised]</strong></p>\n<p>n. furnace, oven for melting metal and baking clay models in metal casting.</p>
68b0e814-fb74-4f35-9eea-4646c0c35ddc	tikijhyāḥ	तिकिझ्या:	<p>var. <em>tikājhyāḥ</em>; n. latticed window.</p>
6fda6ee0-a0fe-4a3a-91fa-3fc6a7ba5efe	kvalā	क्वला	<p>n. 1) plank above the joists.</p>\n<p>2) flooring plank; parquet.</p>\n<p>3) wooden trowel (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 24).</p>\n<p>4) a circular copper tray with an opening slightly narrower than the base that is used while performing <em>argha</em> (offering liquid oblation to deities), or keeping <a href="../meaning/fc089e2d-a21b-48b9-b58f-c5a91c041757/" target="_blank" rel="noopener"><em>piṇḍa</em></a>s inside it during <a href="../meaning/4c3d1462-7609-4bbb-baff-e4720fc158b8/" target="_blank" rel="noopener"><em>śrāddha</em></a> (ritual performed to commemorate death of an ancestor) and also for discarding <a href="../meaning/fc089e2d-a21b-48b9-b58f-c5a91c041757/" target="_blank" rel="noopener"><em>piṇḍa</em></a> afterwards.</p>
3a0652b7-e273-480b-a973-1172461ec0d0	Caitra	 चैत्र	<p>[S.] var. Caita (Nep.); n. the last month of the solar calendar adopted by the Vikrama era. This month usually corresponds to March-April, and has its full moon in the constellation <em>Citrā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 402).</p>
74399238-679a-4c8c-bfbd-10dc38876442	aṃkulārppaṇa	  अंकुलार्प्पण	<p>[S.] n. a ritual offering of blossoms or sprouts (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 1).</p>
17d599bf-9577-4153-b694-be05293832f0	guru	गुरु	<p>[S.] n. spiritual master, mentor or teacher.</p>
