ocked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="51"\r\n   Name="List Table 6 Colorful Accent 6"/>\r\n  <w:LsdException Locked="false" Priority="52"\r\n   Name="List Table 7 Colorful Accent 6"/>\r\n </w:LatentStyles>\r\n</xml><![endif]--><!-- [if gte mso 10]>\r\n<style>\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n\t{mso-style-name:"Table Normal";\r\n\tmso-tstyle-rowband-size:0;\r\n\tmso-tstyle-colband-size:0;\r\n\tmso-style-noshow:yes;\r\n\tmso-style-priority:99;\r\n\tmso-style-parent:"";\r\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n\tmso-para-margin-top:0in;\r\n\tmso-para-margin-right:0in;\r\n\tmso-para-margin-bottom:8.0pt;\r\n\tmso-para-margin-left:0in;\r\n\tline-height:107%;\r\n\tmso-pagination:widow-orphan;\r\n\tfont-size:11.0pt;\r\n\tmso-bidi-font-size:10.0pt;\r\n\tfont-family:"Calibri",sans-serif;\r\n\tmso-ascii-font-family:Calibri;\r\n\tmso-ascii-theme-font:minor-latin;\r\n\tmso-hansi-font-family:Calibri;\r\n\tmso-hansi-theme-font:minor-latin;\r\n\tmso-bidi-font-family:Mangal;\r\n\tmso-bidi-theme-font:minor-bidi;}\r\n</style>\r\n<![endif]-->var. Lichchhavi; n. a ruling class of people originally from Vaiśālī, India, who ruled the ancient Nepāla kingdom probably since around the fourth century. The first Licchavi inscription is from Cāṃgunārāyaṇa dated 464 AD issued by King Mānadeva. But the first Licchavi king known from the inscription is Bṛṣadeva, who probably reigned over a hundred years before his great grandson Mānadeva. A Kuṣāṇa-period sculpture from the reign of Jaya Varmana, dated 185 AD, was recovered from Mālīgāũ, an area in Kathmandu considered by most scholars to be the site of the ancient Licchavi capital (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/R2B9CGV7/library" target="_blank" rel="noopener">Tamot and Alsop</a>). The sculpture proves the Licchavis came into power in between 185 AD and 464 AD. The history after King Jayadeva II, whose Pashupati inscription of 733 AD gives the genealogy of the Licchavi kings, is not very clear. However, Mānadeva IV is the last known king to have ruled at least till 878 AD (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/Q5FSSPTE/library" target="_blank" rel="noopener">Regmī 2053 VS</a>: 199).</p>
