7b5babd4-6b8a-48bf-81be-32b6bd80ea48	haliṃpatāḥ	 हलिंपता:	<p>var. <em>halipatā</em>; n. lit. the banner of the world, it is called <em>viśvadhvaja</em> in Sanskrit. It is the banner that is strung from the top of the <a href="../meaning/eae61da1-58bc-4919-b1e0-3dc477b5b41a/" target="_blank" rel="noopener"><em>yaḥsĩ</em></a> erected during the <em>Biskāḥ Jātrā</em> in Bhaktapur.</p>
