ad51bfcb-7b6c-4baa-975b-3ded274774cf	matakalaḥ	 मतकल:	<p>n. 1) container in which <a href="../meaning/28b017ef-7966-4bbb-b886-610e657c5307/" target="_blank" rel="noopener"><em>ālamata</em></a> is hung up to burn. The container is made of clay, tin or paper and is designed to shield the <em>ālamata</em> from the wind. 2) hot-air balloon made of paper that contains a lamp which burns <em>thakurāḥ</em>, a sticky substance that burns very slowly and generates hot air that causes the balloon to fly (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 196) .</p>
