Exception>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. establishment of <em>ghaṭa</em> (<a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>kalaśa</em></a>) on the first of the bright fortnight of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvīna</a> for the worship of Goddess Durgā for nine consecutive days.</p>
e6d7444e-4597-4463-9466-f03792963a37	metha	मेथ	<p>ver. <em>meytha</em>; n. capital of a main pillar.</p>
ca11525b-c7a1-4486-a1c2-c6ca876c1780	mūbāhāḥ	  मूबाहा:	<p>[fr. S. <em>mūlavihāra</em>] n. a Buddhist monastery to which a separate or independent <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>saṃgha </em></a>is attached which performs its initiations at the concerned <em>bāhāḥ</em>. Usually a <em>mūbāhāḥ</em> has several branch monasteries called <em>kacābāhāḥ</em>. Most of the <em>kacābāhāḥ</em>s perform <a href="../meaning/7905baa8-f0fb-469d-b63c-ec63ec6b3790/" target="_blank" rel="noopener"><em>bare chuigu</em></a> (initiation) ritual at the <em>mūbāhā</em>; see <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener">bāhāḥ</a> and <a href="../meaning/47794909-6cb4-449a-9d35-269d697f021d/" target="_blank" rel="noopener"><em>kacābāhāḥ</em></a>.</p>
dd20cfc0-024e-4375-98d8-f32642e9c609	katāṃ	कतां	<p>var. <em>katāma</em>; n. chisel; a wedgelike tool made of iron with an edge of many variations used for carving designs and smoothing the surface of an idol or any other handicraft item. The edge of a <em>katāṃ</em> may be blunt, sharp, curved, etc. and a craftsman hits its head with a small hammer to carve designs on the surface of any handicraft item.</p>
a9a64ff7-f8fc-4d86-9d0b-7aee80071062	kau	कौ/कउ	<p>n. a term that refers to the Newar blacksmith caste now taken as a rude expression. The blacksmith caste use Nakaḥmi (Nakarmi) as their surname.</p>
0a234466-b620-4b0a-b69e-22b7d561fcae	amay	  अमय्	<p>(old New. <em>amasa</em>) n. 1) a term that signifies food such as fish, egg, meat, black lentils, garlic, soybeans, and leeks, among others (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 20).</p>\n<p>2) impure or unholy food which is not deemed fit for sacrifice.</p>
6c0687e0-3527-4752-9c9f-1b8d7e717ab9	guthichẽ 	गुथिछेँ	<p>n. lit. <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a> house; a community-owned building that belongs to a particular <em>guthi</em> such as a <a href="../meaning/e42b0c1a-12e1-41ef-a1e7-a2a4dd4e0978/" target="_blank" rel="noopener"><em>sanāḥguthi</em></a> or a caste group like <a href="../meaning/dde9ff9a-1a91-4c2b-970f-fc8ea5e9326b/" target="_blank" rel="noopener">Paṃmāy</a> (<a href="https://danam.cats.uni-heidelberg.de/report/1724e57b-b911-48c1-ab87-68c43a852a64" target="_blank" rel="noopener">LAL4047</a>).</p>
595d9eb4-1430-4593-99a2-219660fc33f8	Kārtika	 कार्तिक	<p>[S.] var. <em>Kāttika</em>, <em>Kāttik </em>(Nep.); n. name of the seventh month (October-November) of the solar calendar adopted by the Vikrama era when the moon stands in the constellation <em>Kṛttikā</em> (Pleiades).</p>
cc2ea866-6329-40ae-9b99-f9931730714c	pikhāchẽ	 पिखाछेँ	<p>n. extension of a building (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 54).</p>
00f70c49-06dc-45b8-b89e-2fce024a04a5	kalaṃpu	 कलंपु	<p>n. iron dong (mod. constr.) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 21).</p>
6a4915d1-1535-4d65-a7d1-4d97ca8ff4f1	uta	उत	<p>n. straw pile (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20); syn. <em>sugaḥ</em>.</p>
72913b3c-d88a-4723-a381-99091a822d4d	patāḥ	पता:	<p>n. flag; banner; narrow oblong cloth or silver strip that is hung from the top of a temple or a <a href="../meaning/eae61da1-58bc-4919-b1e0-3dc477b5b41a/" target="_blank" rel="noopener"><em>yaḥsĩ</em></a> (ceremonial pole).</p>
76827c6f-3369-4269-8783-522cae5cab1a	vajrahuṅkāra mudra	वज्रहुङ्कार मुद्रा	<p>n. a gesture in which the wrists are crossed at the chest whilst the hands hold a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> and a <em><a href="../meaning/7fe1fd8b-9e18-4a5e-b3c6-8529bac35ece/" target="_blank" rel="noopener">ghaṇṭa</a>,</em> both of which are turned inwards. When the two items and the hands are turned to face outwards, this gesture is called <em>trailokyavijaya mudrā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 440).</p>
12b647e0-a433-40b2-8aff-8e8898b10df3	mokṣa	 मोक्ष	<p>[S.] n. release from worldly existence or transmigration, final or eternal emancipation (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 835).</p>
4de33480-898b-49ac-88da-819fbf8e25bf	kakku	कक्कु	<p>var. <em>kaku</em>; n. 1) upper part of the bell body. 2) neck; syn. <em>gaḥpaḥ</em>.</p>
324e3d5b-1eea-444e-94a8-a5df47deb6bf	digukhyaḥ	 दिगुख्य:	<p>n. site (usually an open meadow) where the patron deity is enshrined. The site of <a href="../meaning/d9463838-8dae-470c-9005-4f601bc3a929/" target="_blank" rel="noopener"><em>digudyaḥ</em></a> is the place the worshipping families or clan originally hailed from.</p>
9bd136ce-91c4-4433-bc14-efbc2bb2e336	Cakaṃdyaḥ	  चकंद्य:	<p>var. Cakãdyaḥ, Cakaṃdyo, Cakãdyo; the deity of Bhagavāna Bāhāḥ in Thã Bahī, Kathmandu; the local name of Siṃharasārthavāhū, the leader of the caravan merchants, idealised by the Newars for his ability to control lust. His level head saved him from a demoness queen's temptations and eventually led to his becoming the King of Siṃhakalpa, a legendary kingdom believed to be present-day Thã Bahī. An image of Cakaṃdyaḥ is taken round the city annually on the day after <em>Holi Punhi</em>, the full-moon day of <a href="../meaning/ced73f22-4362-407b-a7d8-32fc78f6dc5e/" target="_blank" rel="noopener">Phālguna</a>. Siṃharasārthavāhū (var. Siṃhalasārthavāhū, Siṃhasārthavāhū) <em>avadāna</em> is a very popular Buddhist legend. Its narrative elements have been both adapted to and adopted within the Buddhist mercantile community of Kathmandu, for whom long-distance trade with Tibet was an important undertaking throughout the last millennium (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/todd%20lewis/titleCreatorYear/items/NEN6UJVN/item-list" target="_blank" rel="noopener">Lewis 1993</a>: 135). The Lhasa traders remained in Tibet for decades, where many married local girls and started families. Analogies are often made between Siṃharasārthavāhū's trading voyages to distant lands and the demoness's attempts to seduce and tempt him, and the Lhasa tradesmen's relationships with local girls in Tibet.</p>
053f8040-79ef-4662-8c32-dc185fb9dffb	thapāḥju	 थपा:जु	<p>[New.] n. the most senior of the elders (<em>āḥju</em>) of a monastery. In <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>s, the most senior <em>āḥju</em> is always a Vajrācārya, who is also called <a href="../meaning/08b18b67-a95a-4b3b-be66-f1a1a009fdd8/" target="_blank" rel="noopener"><em>casalāḥju</em></a>, a derivative of <em>Cakreśvara āju</em>. This, however, does not apply to a <em>bāhāḥ</em> that does not have a Vajrācārya member.</p>
47ff058f-00cc-4314-8e7d-51de4dbc6779	Dāgiṃ	 दागिं	<p>n. <em>ḍākinī</em>; a name given to a deity revered as the mother of Lord Indra. A man impersonating her by wearing a mask leads a procession of hundreds of devotees every year during the <a href="../meaning/d2de8b1e-2496-4958-ba19-059d065d52a2/" target="_blank" rel="noopener"><em>Yẽnyāḥ </em></a>festival in Kathmandu.</p>
cf67227e-fba2-48bc-8de8-bf0856d5d3b3	ikā	इका	<p>var. <em>ekā</em>, <em>yakā</em>, <em>yãkā</em>, <em>mākā</em>; n. slotted batten (grillwork) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20).</p>
64e15ef3-a6e3-4312-97d9-da9f549fa590	mandira	मन्दिर	<p>[S.] n. temple; a building where a deity is enshrined. Broadly speaking <em>mandira </em>(temple) is referred to a spiritual place where mainly Hindus, Buddhists or Jainas go to worship gods and perform rituals. Many Hindu and Buddhist temples are filled with wooden and stone arts such as Paśupatinātha Temple in the Kathmandu Valley. It is a landmark around which ancient arts, community, celebrations and economy were developed.</p>
dde9ff9a-1a91-4c2b-970f-fc8ea5e9326b	Paṃmāy	पंमाय्	<p>var. Paṃmāṃ, Paḥmāy; n. Pradhāna (Pradhan), a Newar caste of the Śreṣṭhas (Shrestha).</p>
942da588-10bb-4ef5-a80d-01306a0935c7	mahādīpa	महादीप	<p>n. lit. a great lamp; a large butter lamp.</p>
df3e52d2-47b7-4436-851e-0256752d4c17	Āṣāḍha	 आषाढ	<p>[S.] var. <em>Asāra, Asār </em>(Nep.); n. the third month of the solar calendar adopted by the Vikrama era commencing with the sun's entrance into Gemini (June-July).</p>
ced73f22-4362-407b-a7d8-32fc78f6dc5e	Phālguna	 फाल्गुन	<p>[S.] var. Phāguna, Phāgun (Nep.), Phālguṇa; the 11th month of the solar calendar adopted by the Vikrama era that corresponds to February-March during which the full moon stands in the constellation <em>Phālgunī</em>.</p>
7fe1fd8b-9e18-4a5e-b3c6-8529bac35ece	ghaṇṭa	घण्ट	<p>n. bell; in Buddhism, this is the symbol of <em>prajñā</em> (the supreme knowledge/wisdom). The sound of the bell symbolises <em>prajñā</em> travelling great distances, just as the sound of a bell can be heard from afar. When a bell is surmounted by a <em><a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener">vajra</a>,</em> it is called <em>vajraghaṇṭa;</em> this is a symbol of <a href="../meaning/462a0040-b57c-4cbb-8c31-e0a0e8b3ca1d/" target="_blank" rel="noopener">Vajrasattva</a>.</p>
ada49cd0-6746-4e3f-b8a6-81cf20d746b9	digukhalaḥ	 दिगुखल:	<p>var. <em>digukhala</em>; families who worship a common patron deity.</p>
bc6e23b1-8dfe-4769-9702-3ab370071e41	aṅgaḥ	 अङ्गः	<p>var. <em>aṃgaḥ</em>; n. any wall of a house that holds the weight of rafters etc.</p>
4a7a07d2-200b-4bdf-83b8-195e0f0e906b	namaskāra	 नमस्कार	<p>1) an expression of greeting spoken while joining one's both palms together against the chest; <em>namaste</em> is another expression used in the same context and manner. 2) gesture of reverence.</p>
7f0a543e-cf44-4a2c-96a0-8c1ea3019e7a	pikhā	पिखा	<p>n. lit. outer house; a house facing a lane (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 54).</p>
48efa4b7-4f19-4c25-bd3f-c752ca1b7dbd	bhūmisparśa mudrā	  भूमिस्पर्श मुद्रा	<p>[S.] var. <em>bhūmisparśana</em>-, <em>bhūsparśa-, bhūmyakramaṇa-mudrā</em>; n. a hand gesture of ‘earth-touching’. The palm of the right hand is turned inward with the fingers outstretched so that the tips touch the ground (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 433). Compare with <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada mudrā</em></a>.</p>
