/w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->var. <em>mhadu dāy</em>, <em>mhadhū dāy</em>; v. lit. to go about prostrating to measure distance; to prostrate oneself with both arms stretched up straight to join both palms in reverence of any deity. Many devotees used to circumambulate the base of the hill where the Svayambhū Caitya is in such manner. They start prostrating at a point and mark the spot where the tip of their hands reach with an object, get up and prostrate again with their feet touching the marked spot, and continue until they make one full round of the hill.</p>
be1b1383-96eb-4a98-a449-5561d9bdd502	gadā	 गदा	<p>[S.] mace; an emblem usually associated with Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> and <a href="../meaning/e5348c05-8e9e-4045-acdd-af85b443190b/" target="_blank" rel="noopener">Bhīmasena</a>.</p>
775199dc-8058-4d1d-b220-0c3bcd56d3b2	gvaykāybhvay	ग्वय्‌काय्‌भ्वय्	<p>n. ceremonial feast marking the formal engagement of one’s daughter.</p>
73a8ef5f-6801-4acb-898d-2a80f46f53d4	Narasiṃha	नरसिंह	<p>n. lit. a human lion; a demigod with a lion head on a human body. Narasiṃha is revered as the fourth incarnation of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a>.</p>
7af05a8d-68a7-4c9c-9066-a4dddb989163	khagaḥ	खग:	<p>var. <em>khavaḥ</em>; n. bolt of a door.</p>
3b3763b4-6ea3-4387-aaae-0a86a404afb4	nhaygāṃjātrā	न्हय्‌गांजात्रा	<p>var. <em>nhaygā̃jātrā</em>; n. lit. the <a href="../meaning/acfa00c1-1490-4fe5-833c-1899ee268329/" target="_blank" rel="noopener"><em>jātrā</em></a> of seven villages, this festival unites seven villages (Kipū, Pāṃgā, Naḥgāṃ, Macchegāṃ, Tapakhyaḥ, Satuṃgaḥ and Bosigāṃ) in the area of Kirtipur and witnesses chariot processions of Indrāyaṇī, <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a>, Bālakumārī, Biṣṇudevī, etc. It begins on the day of <em>bakhuṃmada aṣṭamī</em>, the eighth day of the bright fortnight of Maṃsīra and is celebrated for three days. Besides the seven villages, other villages from the area like Lhvaṃkhā, Sĩdvaḥ, Gāmcā, Kvādey, Bhājaṃgaḥ, Lanagvala, Yatāgaḥ, Dhũgāṃ, Pāluba and Tikara also observe the <em>nhaygāṃjātrā</em> with equal fanfare and chariot processions. Another festival of seven villages in the Gokarna area of Kathmandu is also called <em>nhaygāṃjātrā</em>. Seven villages in Banepa, Kābhre also collectively observe <em>nhaygāṃjātrā</em>.</p>
fe08a451-b4bc-4b67-8454-2213b6ce94ac	kācarā	 काचरा	<p>[old New.] n. raw meat used as an item of feast (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 46). It probably is the archaic term for what is now called <em>kacilā</em>, which literally means 'uncooked meat'. Raw meat is minced and prepared with a lot of mustard oil and spices to make <em>kacilā</em>, a popular dish among the Newars.</p>
99e550e6-e45c-4d6e-aca1-6132b598e2ff	pakhi	 पखि	<p>n. see <a href="../meaning/e109cfd0-d8e5-4288-9ea0-8891154f51fa/" target="_blank" rel="noopener"><em>ãyguĩ</em></a>.</p>
2a49e7df-d2fe-481b-9d7a-61583faddfa8	Vaiśākha	 वैशाख	<p>[S.] var. <em>Baisāk</em>, <em>Baisākh </em>(Nep.); n. first month of the solar calendar adopted by the Vikrama era that corresponds to April-May.</p>
fc089e2d-a21b-48b9-b58f-c5a91c041757	piṇḍa	पिण्ड	<p>[S.] n. balls of cooked rice, wheat or barley offered to the ancestors during the <a href="../meaning/4c3d1462-7609-4bbb-baff-e4720fc158b8/" target="_blank" rel="noopener"><em>śrāddha</em></a> rites.</p>
c5ee206f-f0a6-4108-9185-7e7368f3f23b	ā̃khījhyāla	 आँखीझ्याल	<p>[Nep.] n. latticed window; [New.] <a href="../meaning/68b0e814-fb74-4f35-9eea-4646c0c35ddc/" target="_blank" rel="noopener"><em>tikijhyāḥ</em></a>.</p>
e7f31a6a-0841-4129-98cb-507abbb18749	toraṇa	 तोरण	<p>[S.] var. <em>toran</em>,<em> tvalaṃ</em> (New.); n. the ornamented arch of a door or gateway.</p>
52cb884a-1fc3-4f5b-b20c-06d184f4677f	Bodhisattva	बोधिसत्व	<p>n. lit. a being with perfect wisdom; deities who are already entitled to <em>nirvāṇa</em> (salvation), but have restrained themselves from attaining it with the objective of leading all other beings to the salvation first; see <a href="../meaning/ed9a093b-9054-4be2-bcca-7c2a5cd742fb/" target="_blank" rel="noopener">Lokeśvara</a>.</p>
e109cfd0-d8e5-4288-9ea0-8891154f51fa	ãyguĩ	 अँय्‌गुइँ	<p>var. <em>ayguni</em>; n. rope line to hang clothes on; (syn. <em>pakhi</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
8d0ebac4-c2d9-4424-ba17-aad279872771	Dīpaṅkara	    दीपङ्कर	<p>var. Dīpaṃkara; n. 1) name of one of the 28 Buddhas that the Buddhists believe have been born so far. Dīpaṅkara is the fourth among them while Gautama (Śākyamuni) Buddha is the most recent (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3MTMCT2G/library" target="_blank" rel="noopener">Vajrācārya 2010</a>: 37). Some sources mention only 25 Buddhas with Dīpaṅkara as the first; for this reason, he is also called <a href="../meaning/584ed272-566a-489a-afad-4548d914021a/" target="_blank" rel="noopener">Ādibuddha</a>, i.e. the first Buddha. He is mostly represented in the form of a large image with a highly ornamental head, two palms, and a hollow body frame; this allows a person to clamber inside and carry the image around the city on occasions like <em><a href="../meaning/ffa16ff7-2ccb-48c9-be57-1f79959edc93/" target="_blank" rel="noopener">samyak mahādāna</a></em>. The head and two palms represent Dīpaṅkara, whilst the rest of the construction is a wooden frame covered by decorative cloths which serve as the deity's dress.</p>\n<p>2) var. <em>dipaṃkhā</em>; n. the name of a rare 60-kilometer long procession to 130 sites throughout the Kathmandu Valley, starting from Nāga Bāhāḥ (<a href="../../report/cb03ff18-e75a-11e9-8bc4-0242ac130002" target="_blank" rel="noopener">LAL0930</a>) in Patan (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/UTZD7IHB/library" target="_blank" rel="noopener">Michaels 2013</a>: 324).</p>\n<!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML></o:RelyOnVML>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:Punctua