cent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. head image of <a href="../meaning/4904516c-25e1-4601-855e-b94ace341ae4/" target="_blank" rel="noopener"><em>ājudyaḥ</em></a>, a form of <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a>, that are put on display during the <a href="../meaning/d2de8b1e-2496-4958-ba19-059d065d52a2/" target="_blank" rel="noopener"><em>Yẽnyāḥ</em></a> festival. Some of these wrathful images are very large like those in Hanumānaḍhokā and Vaṃghaḥ (Indra Choka) in Kathmandu. Smaller images are also displayed at various places of the Kathmandu valley. Hāthudyaḥ is usually a large pot with a wrathful image in front. The pot is filled with alcoholic beverages, usually <em>thvã</em> (fermented beer), and a spout is attached to the mouth of the image. People throng such images to drink the beverage discharged from the spout; syn. Hārkhāṃdyaḥ.</p>
7a624477-9d0a-4348-8452-6f70a91ded44	gaṃ2	 गं	<p>n. small cabinet above the inner window frame (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 28).</p>
389bc96d-a4b3-4bcf-a197-9c85980c50dc	pyāḥaḥpā	 प्याःअःपा	<p>var. <em>pyāḥappā</em>; n. lit. wet brick; unbaked brick.</p>
d4bd27d1-5a79-4704-8414-92a300fc28e6	bhailaḥkuti	  भैल:कुति	<p>n. a decorated part of the window or door frame above the sill; panel above the sill decorated with a <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a> design (syn. <em>bhailaḥkva</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 259)</p>
94126120-b001-4f04-975c-5c08a3dd2656	bhajana	भजन	<p>[S.] var. <em>bhajan </em>(in Nep.); n. a song that praises a revered being such as a deity or a guru; hymn; devotional song.</p>
024241de-8947-477d-8327-9c69cb54301c	jātaḥ	जात:	<p>n. birth chart; astrological record of the time of birth written on long <em>haritāla</em> paper that is rolled and stored in a thin, long pouch of cloth. It records the positions of planets, moon, constellations and the sun at the time of a person's birth. Based on these records, an astrologer makes predictions and suggests remedies if the birth chart shows ill-fate for the future of the person. It is said that every person's <em>jātaḥ</em> should be opened at least once a year, i.e. consult an astrologer regarding one's <em>jātaḥ</em> preferably few days ahead of one's birthday.</p>
a36e1185-697a-49e3-a4fd-459af12a98d4	taujhyāḥ	 तौझ्या:	<p>n. slightly projecting window. Such a window projects with its wooden frame (about 20-30 cm), but does not slope (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 214); syn. <em>bãsājhyāḥ</em>.</p>
a7d859a6-491b-4df8-b05a-6d590c3fa2e9	gvaṃ	ग्वं	<p>n. a person who cremates a dead body by profession.</p>
2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d	dharmacakra mudrā	 धर्मचक्र मुद्रा	<p>[S.] n. a symbolic gesture in which the two hands are held at the heart with the tip of the thumb and index fingers of each hand touching one another whilst the other fingers are elongated. The gesture represents the turning of the wheel of <em>dharma</em>, as it is believed that the Buddha performed this gesture as he delivered his first sermon in Sāranātha. The gesture is also known as <em>vyākhyāna mudra</em>. There are several variations of this gesture. One of the variations is called <em>bodhyaṅga mudrā</em> and sees the finger of the left hand held by the right hand. <em>Dharmacakra mudrā</em> is mostly associated with <a href="../meaning/d5ce7e1e-b0fa-44a6-a831-a541f8b20c41/" target="_blank" rel="noopener">Vairocana</a> Buddha.</p>
