w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> and his wife Goddess Lakṣmī are collectively known as Lakṣṃīnārāyaṇa.</p>
9cb13b74-1f14-448f-a969-658bb18932ff	matayāḥ	मतया:	<p>n. lit. procession of light; procession of devotees that goes round the city of Patan with various offerings to all the Buddhist shrines and <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s. <em>Matayāḥ</em> is hosted by 10 separate localities of Patan on the second of the dark fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a>. Many people take part in <em>Matayāḥ</em> in memory of a deceased family member and offer light or other items to all the shrines and <em>caitya</em>s. On the same day, a separate procession of traditional Newar musical instruments is also taken out from the host locality. This procession of <em>naubājā</em> (lit. nine musical instruments) also go round the city of Patan and perform traditional drums like <a href="../meaning/8c15626e-b7aa-4c56-98e3-d444c4897d01/" target="_blank" rel="noopener"><em>dhāḥ</em></a>, <em>damvaḥkhiṃ</em>, and <em>nyekū</em>, a specially decorated instrument made from large horns of animals.</p>
a092fee5-7d2b-42e4-b3df-c728d2cfee76	dyaḥ	द्य:	<p>n. god, deity.</p>
60d2178e-400d-43d2-9837-7afe0b1778c8	kathi	कथि	<p>n. stick.</p>
3bc1eb66-9619-4e18-9574-1b3a3fdbd594	khaḥ cinegu	ख: चिनेगु	<p>var. <em>khata cinegu</em>; v. to accession a deity into a chariot.</p>
54d82c48-afa0-4467-a5a8-765193fd168b	kuṃdā		<p><strong>[to be revised]</strong></p>\n<p>var. <em>kuṃdhār</em>, <em>kunaḥ</em>, <em>kunār</em>, <em>kundhā</em>, <em>kvaṃdā</em>; kind of water pot, tub, trough (for washing and for feeding cattle).</p>
d02a99ba-69ba-4b9b-b125-cec70ed67067	capāḥchẽ	 चपा:छेँ	<p>n. a community building or assembly hall.</p>
185c8454-dbd6-429c-b817-dbb358cc2c51	dhaliṃpākhā	  धलिंपाखा	<p>var. <em>dhalĩpākhā</em>; n. 1) lower eaves. 2) horizontal eaves joints (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 48); roof laid on a series of protruding rafters that rest on a long timber (eaves plate), which itself rests on beams protruding from the wall.</p>
6a42d08c-e001-45a9-80ff-bc676370d84e	ecikaṃ	एचिकं	<p>var. <em>icikaṃ</em>; n. diagonal latticework (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20); diagonal lattice pattern of 45 degrees found in latticed windows.</p>
7b026a5e-9461-4d8a-9c74-01099f79081e	phūlapātī	 फूलपाती	<p>[fr. S. <em>phulla </em>+ <em>patra</em>] n. lit. flowers and leaves, it is a bundle of plants introduced into the worship arena on the seventh day of the <a href="../meaning/dbdfb21e-2b84-4ff9-b6dd-8721d49fe6ba/" target="_blank" rel="noopener"><em>Dasaĩ</em></a> festival.</p>
837387d7-8a8d-45f6-96a5-223d687112b7	jvālāvali caitya	 ज्वालावलि चैत्य	<p>[S.] var. <em>jvalāvalī</em>; <em>jvalāvali</em>; n. a type of <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya </em></a>with the circular frieze of flame motifs. The first structure of this type of <em>caitya </em>was built in 1831 at Bāpunani, a courtyard near Hakhā in Patan (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/the%20nepalese%20caitya/titleCreatorYear/items/TMRR73VW/item-list" target="_blank" rel="noopener">Gutschow 1997</a>: 278).</p>
eaafedfb-7f48-4705-b40e-d2a97f240311	āgaṃkvathā	आगंक्वथा	<p>var. <em>āgãkvathā</em>; n. the room where <em>āgaṃdyaḥ</em> is enshrined. The term is used in case of the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> of every household rather than of a monastery.</p>
3f6c66a1-03fd-433b-b982-c3f2239f5b17	khvaḥsiṃgvaḥ	 ख्व:सिंग्व:	<p>n. walnut pattern found on wooden pillar carvings and <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s.</p>
98d65014-ecac-4e9f-a9bc-a417fbeef111	ca	च	<p>n. rack inside a chariot (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31).</p>
1b3e3085-7936-4b33-9da6-c828ca941eba	khyẽyjhyāḥ	‍ख्येँय्‌झ्या:	<p>var. <em>khẽyjhyāḥ</em>; n. lit. egg window; window with oval-shaped opening.</p>
17ab2aca-82b4-4074-8823-274347479518	dhaubaji	 धौबजि	<p>n. beaten rice mixed with yoghurt; the Newars have a tradition of distributing <em>dhaubaji</em> on birthdays. On such occasions, beaten rice is mixed with yoghurt, sesame seeds and <em>sākhaḥ</em> (coarse and raw brown sugar) and a palmful of <em>dhaubaji</em> is offered, along with a coin, to the children of the locality. However, this tradition no longer appears to be practiced. There is another, similar tradition called <em>dhaubaji nakegu</em> (meaning 'to feed <em>dhaubaji'</em>), in which the mother goes to their pregnant daughter's house a few days ahead of the baby's due date to serve her <em>dhaubaji</em> along with sweets, other dishes and fruits. This tradition is still continued today.</p>
fd0625e3-5ca6-4ebd-b229-0626c21f4a79	guthiyāra	गुथियार	<p>var. <em>guṭhīyāra</em> (Nep.); n. member of a <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a>.</p>
53059359-5a24-4e6d-b4ac-b605ec3456f8	kaṃjhyāḥ	 कंझ्या:	<p>n. lit. open window; windows usually found in a set of three with shutters that also provide space for a <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a>-like seat (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 138).</p>
acfa00c1-1490-4fe5-833c-1899ee268329	jātrā	जात्रा	<p>[fr. S. <em>yātrā</em>] n. 1) festival with a procession; chariot festival.</p>\n<p>2) journey (esp. in connection with a religious ceremony, such as a pilgrimage or a marriage).</p>
396d2fd0-c569-4eb4-9a50-f3d1bc49d53f	pāsaḥ	पास:	<p>[fr. old New. <em>pvāsara</em>/<em>pvāsala</em>] n. <em>meas</em>. quantity that can be taken in the cupped hands; a handful of something.</p>
15749615-a845-4fdd-8be9-c9e6736aad4b	pratipadā	प्रतिपदा	<p>[S.] n. the first day of both fortnights of the lunar calendar; syn. <em>pāru, parevā</em> (New.).</p>
2538c74d-ee19-494b-9dc8-3140d539ce43	patināḥgvaḥ	 पतिना:ग्व:	<p>n. 1) band of wood. 2) rounded pattern on a wood plank (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 52).</p>
