\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. 1) monetary unit worth one fourth of a rupee and comprising four <a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener"><em>ānā</em></a>s.</p>
6dc21da9-6584-4186-a37e-a8a8c5e4fddd	aḍḍā	 अड्डा	<p>n. var. <em>aḍā</em>; n. an office, post or station where state functionaries carry out their duties.</p>
68ef4c3d-eccf-4145-972b-9813c76f6cbb	dharmadhātujinālaya caitya	धर्मधातुजिनालय चैत्य	<p>[S.] n. a <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a></em> with four Buddhas in the cardinal directions; see <a href="../meaning/27c63e04-21f0-4a9a-9cf9-9d297e5ddb87/" target="_blank" rel="noopener"><em>jinālaya caitya</em></a>.</p>
aa77e8c7-4421-401c-8712-968d8bcedbbd	tulasī	तुलसी	<p>[S.] n. the sacred plant ocimum basilicum, also known as holy basil said to have been produced from the hair of the goddess Tulasī and held in veneration by the worshippers of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a>.</p>
f986809b-889d-4acf-926c-7cacb2143a82	mahādāna	महादान	<p>n. lit. 'great charity'; see <a href="../meaning/ffa16ff7-2ccb-48c9-be57-1f79959edc93/" target="_blank" rel="noopener"><em>samyak mahādāna</em></a>.</p>
07db05dd-cfcb-4054-99a6-199d2aebc0aa	kuṃ dāciaḥpā	कुं दाचिअ:पा	<p>var. <em>kuṃ dātiaḥpā</em>, <em>kuṃ dāciappā</em>; n. corner veneer brick.</p>
b7699c28-77b5-4987-8804-398f19ceb32f	kvataḥ	क्वत:	<p>n. a relatively large circular worship tray of brass with a quarter round that makes the opening slightly narrower than the base used for carrying items like rice, flowers, vermillion powder, etc. for elaborate worships like granting <em>dikṣā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/vajracharya/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 5).</p>
5f3287e8-8d75-46a4-9702-5c6cb058ae90	kijāpujā	किजापुजा	<p>n. widely-celebrated festival of sisters worshipping their younger borther during <em>Svanti</em>, the festival of lights also referred to as <em>Tihāra</em>.</p>
50a9231c-8002-4b87-8258-0f736d1d2868	kuliṃcā	कुलिंचा	<p>var. <em>kuliṃ</em>, <em>kulecā</em>,<em> kulũ</em>, <em>kuluṃ</em>; small-mouthed earthen jar used by <em>ajicā</em> (midwife) for putting a mixture of <em>cvaki</em> (broken rice grains) soaked and rubbed in oil and salt during <em>macābū byaṃkegu</em> (birth purificatory ritual). The <em>kuliṃcā</em> with the mixture is worshipped as Ugracaṇḍī (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Vajracharya%20/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 7).</p>
94cb81c0-c835-4237-aff0-1696325504fe	kvakhalu	क्वखलु	<p>var. <em>kvakharu</em>; n. 1) still or threshold; syn. <em>khalu</em>, <em>kharu</em>. 2) inner sill with a socket.</p>
56eb052d-10a6-4e74-acfb-b55e905b04a2	kvakhāchẽ	क्वखाछेँ	<p>var. <em>kokhāchẽ</em>; n. house with its ground floor open for a passage to a courtyard.</p>
a77ed470-799e-453b-b914-13860134c4e5	makara	मकर	<p>[S.] n. a water creature, sometimes confounded with crocodile, that is a popular icon in the Newar architecture mostly found in <a href="../meaning/e7f31a6a-0841-4129-98cb-507abbb18749/" target="_blank" rel="noopener"><em>toraṇa</em></a>s and <a href="../meaning/03c490ac-53db-4cfc-a9cf-09a5e62c08a9/" target="_blank" rel="noopener"><em>hiti</em></a>s; also referred to as <a href="../meaning/4140113a-e8dc-4935-832c-cccaedee839b/" target="_blank" rel="noopener"><em>hitimaṃgaḥ</em></a>.                                                                                                               </p>
7139486f-4268-43e0-ba0d-e58b1cc3410f	māaḥpā	माअ:पा	<p>var. <em>māappā</em>, <em>mā-ata</em> (old New.); n. brick of relatively large size (lit. main brick).</p>
cefee9c1-f48e-486c-b437-d12c3dbc47c0	pujābhaḥ	 पुजाभ:	<p>n. a tray of worship items like flowers, incense, rice, etc. that a devotee carries to a shrine for a regular worship; see <a href="../meaning/9cf90c73-7608-44fc-beb4-981d7c540e9f/" target="_blank" rel="noopener"><em>kalaḥ</em></a>.<!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:BreakWrappedTables>\n   <w:SnapToGridInCell></w:SnapToGridInCell>\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\n   <w:DontGrowAutofit></w:DontGrowAutofit>\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"></m:mathFont>\n   <m:brkBin m:val="before"></m:brkBin>\n   <m:brkBinSub m:val="--"></m:brkBinSub>\n   <m:smallFrac m:val="off"></m:smallFrac>\n   <m:dispDef></m:dispDef>\n   <m:lMargin m:val="0"></m:lMargin>\n   <m:rMargin m:val="0"></m:rMargin>\n   <m:defJc m:val="centerGroup"></m:defJc>\n   <m:wra