faff2e20-91d3-4863-b5be-34a5dab50676	paḥkū	प:कू	<p>n. cornice, ornament in plaster.</p>
5113b4ff-7646-40e9-ac1c-ce8dd05516df	kaḥsipaḥkhāḥ	क:सिप:खा:	<p>n. 1) terrace wall.</p>\n<p>2) railing of chariot.</p>
afe52ca8-ccd2-485f-8490-978482bdbc6a	siṃcā	सिंचा	<p>n. figure of a protective lion (sculpture at a gate or mask in a procession, often partied with a ‘<em>dhũcā</em>’, a tiger).</p>
69a27c41-31df-40be-a57f-3cca9bfc9d4f	ānā	 आना	<p>n. 1) monetary unit worth one sixteenth of a rupee with four <em>ānā</em> constituting one <a href="../meaning/2865d637-f58d-4399-9aae-eed2a42c0a2c/" target="_blank" rel="noopener"><em>sukā</em></a>. 2) sixteenth part of land, property, etc.</p>
ecfd1b5d-36df-486b-a6fe-b04b6710069b	dubaḥjhyāḥ	 दुब:झ्या:	<p>n. lit. window with an inner layer; double glazed shutters used in modern construction (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 46).</p>
b148ef54-103e-4740-872f-dc0871596fb1	dāna	 दान	<p>[S.] n. lit. donation; an act of charity; it is one of the ten <em>pāramitā</em>s (perfections) described in Buddhism that must be fulfilled in order to attain the Buddhahood. The terms 'gift', 'giving', and 'generosity' are all indicated by the Pāli and Sanskrit term <em>dāna</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/ohnuma/titleCreatorYear/items/7X7JSVPX/item-list" target="_blank" rel="noopener">Ohnuma 2007</a>: 141). However, only the unreciprocated gift that has no visible fruit within this world can be presumed to result in an 'unseen' and transcendent reward in the form of karmic merit (<em>puṇya</em>) (Ohnuma 2007: 143). Such merits are the key to attain the <em>dānapāramitā</em> - the perfection in charity.</p>
b28dc4d5-f3db-4e7c-8d6d-aee048d5c950	dāphāpyākhaṃ	दाफाप्याखं	<p>var. <em>dāpāpyākhaṃ</em>, <em>dāphāpyākhã</em>; n. a kind of traditional dance performance based on <a href="../meaning/10958029-7ce0-4c0e-a88a-f758e39f271b/" target="_blank" rel="noopener"><em>dāphā</em></a> music.</p>
06d91e39-2c26-4019-a251-a7c780308edb	aphaḥ	  अफः	<p>n. a smith's furnace (syn. <em>bebhaḥ</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19). A furnace made to heat gold, silver and other metals in the workshop of a goldsmith (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 18).</p>
7e26b449-2647-4ba7-b062-77695e21dc77	kuṃsāḥ	कुंसा:	<p>var. <em>kũsāḥ</em>; n. lit. corner joint; mortise; corner joint of a door or window frame.</p>
