7c545334-adbf-419b-95e4-be17fb7e3c51	dilvahaṃ	 दिल्वहं	<p>var. <em>dilhvaṃ</em>; n. lit. a stone on which something rests. 1) foundation stone; syn. <em>jagalvahaṃ</em>. 2) large stone for threshing grain; syn. <em>nhegvaḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 45).</p>
