erif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. Vailocana; n. one of the five <em>dhyānī</em> Buddhas who remains at the center; see <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>.</p>
e5da284e-a67e-4401-a955-0f4112091b96	cibhāḥbusāḍhaṃ	 चिभा:बुसाधं	<p>var. <em>cibhāḥbusādhã</em>; anniversary of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
ae3f0f86-d2a5-422d-af4b-b5f92e2a8182	jyāpu	ज्यापु	<p>var. <em>jyāpū</em>; n. lit. farmer, peasant; the term refers to a Newar caste class consisting of various caste groups whose members’ main occupation is agriculture (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Nep%C4%81l%C4%AB/titleCreatorYear/items/H9RUQ9IN/item-list" target="_blank" rel="noopener">NBŚ</a> s.v. <em>jyāpu),</em> and whose members are considered inferior to Udāsa (MA-54.145.8-9). The most common surname the <em>jyāpu</em>s use at present is Maharjana, but it was the term <em>bhābo</em> that was used extensively in inscriptions of the Kathmandu valley to refer to the peasants during the medieval period. However, no one in the <em>jyāpu</em> community use the term <em>bhābo</em> to identify oneself these days while no inscription from the medieval period has been found so far that refers to the peasants of those days as Maharjana. There are many castes within the <em>jyāpu</em> community mostly based on their profession. The Maharjanas dominate the other castes in number in Kathmandu and Lalitpur, but very few peasants from Bhaktapur write their surname as Maharjana. They prefer to identify themselves as <em>kisāna</em>, another term to mean a peasant. Some of other prominent jyāpu castes are Avāle/Avāla (New. Āvāḥ; potters and tile roof layers), Vyañjanakāra (New. Tyape), Suvāla (New. Suvāḥ; chef caste), Prajāpatī (New. Kumhāḥ; potter caste mostly from Bhaktapur), Ḍaṃgola (New. Dhaṃgū; measurer of land), etc.</p>
a7dfb21a-1ad4-444a-b2d2-a686f35c5c91	sanāḥ vane	सना: वने 	<p>var. <em>sanā vane</em>; v. to take part in a funeral procession and take a ritual bath at the river after the cremation of the body. </p>
4b9d1675-0ee7-4fd3-a2c5-a53f6693a13f	dhũsã1	धुँसँ	<p>n. mane of a tiger.</p>
27e9ba47-eb48-435b-80be-54259a65d083	gathāṃmugaḥsāḥ	गथांमुग:सा:	<p>n. dove tail joint; syn. <em>dabūsāḥ</em>, <em>gãyrāmūsāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 27).</p>
933e601d-2585-4501-bbb1-090f9e330c1d	pātrakhvālā	 पात्रख्वाला	<p>var. <em>pātrakhvalā</em>; n. 1) skull covered by gold or silver used in tantric rituals to put ritual elements such as alcohol. 2) ceremonial bowl of brass or silver; see <a href="../meaning/30a7a569-0c61-446a-af88-b815d8d2377e/" target="_blank" rel="noopener"><em>pātra</em></a>.</p>
34846f84-c0bc-4fc1-aa80-ceecb84256cd	pratyālīḍha	प्रत्यालीढ	<p>[S.] adj. a posture or attitude of legs opposite of <a href="../meaning/634662c3-731d-4864-9530-d7cb383ab2c4/" target="_blank" rel="noopener"><em>ālīḍha</em></a>, i.e. the left leg is outstretched while the right is slightly bent and placed behind (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 432).</p>
dc4367e2-88ae-44b6-96fa-250d43e728ea	mahāparitrāṇa	महापरित्राण	<p>n. a collection of verses from the various chapters of the Tripiṭaka, the main Buddhist scripture in three volumes, that is recited by the Theravāda Buddhist monks for peace, prosperity and good health.</p>
89105149-9696-4229-aec8-43b4032b7ce7	gaḥpaḥ	ग:प:	<p>n. see <a href="../meaning/4de33480-898b-49ac-88da-819fbf8e25bf/" target="_blank" rel="noopener"><em>kakku</em></a>.</p>
b6e19a48-10f8-4bad-9f7c-915acdb4d0ea	Yala	 यल	<p>n. city of Patan. The city of Patan was known by many names in the history. Laḍitagrāma, Yūpagrāma, Lalitabruma, Lalitākhyapura, Lalitapattana, etc. were some of the names that the city of Patan was known as besides Yala (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mahapatra%20juju/titleCreatorYear/items/627QJNDQ/item-list" target="_blank" rel="noopener">Śākya 2008</a>: 10-11). King Vīradeva is said to have commissioned the establishment of the city of Lalitapattana. The king gave a lot of money to a grass-cutter named Lalita, who then founded the city, established various deities and built a palace for the king. When King Vīradeva was enthroned, 3,400 years of the Kaligata era had passed (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/nepalikabhupa/titleCreatorYear/items/RLA2AXR2/item-list" target="_blank" rel="noopener">Bajracharya et al., Vol. 1 2016</a>: 48). This would mean that his enthronement took place in 299 CE.</p>
