\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. deity of the flock or group; he is the son of Lord <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> and Goddess Parvatī; see <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a>.</p>
2e9a93a8-8a20-4107-a061-bfb01cd41cc1	palā	 पला	<p>[fr. S. <em>pala</em>] n. a particular measure of time (= 1/60 <em>ghaṭi</em>, i.e. 1/60 of 24 minutes) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 609).</p>
90a61c18-d7d4-47d8-9d30-b51e67a41e75	svastika	 स्वस्तिक	<p>[S.] n. a kind of mystical mark made on persons or things to denote good luck (it is shaped like a Greek cross with the extremities of the four arms bent round in the same direction) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 1283).</p>
b9e0a4d6-8714-413b-8e87-dbdf7b95fde7	ghaḥkū	घ:कू	<p>n. 1) axle of a chariot; syn. <em>ā̃si</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 30). 2) a wooden log having an angular edge at one end and a long handle at the other end used as a brake to stop a chariot or slightly alter its direction.</p>
56cf3891-7b3e-4d95-a1da-7f3cfa16d625	gathāṃmugaḥ	  गथांमुग:	<p>var. <em>gathā̃mugaḥ</em>; n. three-legged figure made of straw or reed stalks that is erected at crossroads on the 14th day of the dark fortnight of <a href="../meaning/cb906d38-016b-47d0-92bc-a8fdd8c3e821/" target="_blank" rel="noopener">Śrāvaṇa</a>; widely referred to as <em>ghaṇṭākarṇa</em>.</p>
f6c385a4-13a2-485c-8e87-6559276cef50	gā2	 गा	<p>var. <em>gāḥ</em>, <em>gāka</em>; n. suffix used with the Newar names of the lunar months to denote the dark fortnight (<em>kṛṣṇapakṣa</em>); see <a href="../meaning/077b980b-a53d-4f28-92f0-bf35229796fc/" target="_blank" rel="noopener"><em>thva</em></a>.</p>
5c8d3c1d-42eb-43f3-996c-e3051432b7c6	yaḥsĩpvāḥ	य:सिँप्वा:	<p>[New.] n. hole for erecting a <a href="../meaning/eae61da1-58bc-4919-b1e0-3dc477b5b41a/" target="_blank" rel="noopener"><em>yaḥsĩ</em></a>.</p>
7d43e6f5-e8bd-4d3d-8b5a-45b26dae0a06	kaḥsi	क:सि	<p>n. terrace; open rooftop on the third floor of the traditional Newar private building structure.</p>
ec993ada-627e-4094-8e30-28e229164a00	icikā	 इचिका	<p>var. <em>īcikā</em>, <em>ecikā</em>; n. 45-degree grillwork (window) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20); battens are joined with one another so that they overlap diagonally in a latticed window; see <a href="../meaning/6a42d08c-e001-45a9-80ff-bc676370d84e/" target="_blank" rel="noopener"><em>ecikaṃ</em></a>. The grillwork with 90-degree rectangular pattern is called <em><a href="../meaning/b88411dd-e4ae-41b0-b250-8aceab95a535/" target="_blank" rel="noopener">mācikaṃ</a>.</em></p>
0c7750d1-0e6a-4b9c-a100-44111883b015	lhāḥphvaḥ	 ल्हा:फ्व:	<p>n. 1) palm of the hand with spread or extended fingers (imagined as a flower in blossom) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 237).</p>\n<p>2) cornice brick installed at temple corners that is in the shape of a palm facing up with fingers slightly turned upward to look like a flower in blossom.</p>
e574f3fd-551c-4461-a055-780a482c97c6	bhūsparśana	भूस्पर्शन	<p>see <a href="../meaning/48efa4b7-4f19-4c25-bd3f-c752ca1b7dbd/" target="_blank" rel="noopener"><em>bhūmisparśa mudrā</em></a>.</p>
42d11fb0-e2e8-4c2b-98bd-ab753a0a6cf9	teliyā ĩṭā	तेलिया इँटा	<p>[Nep.] n. lit. brick [containing] oil; floor tile; see <em><a href="../meaning/975e0f79-636f-40d2-b5cd-46dcf809eea3/" target="_blank" rel="noopener">cikaṃaḥpā</a>.</em></p>
4faede37-3a0e-4f12-94e2-9d7283bec475	bimājhyāḥ	 बिमाझ्याः	<p>n. slanting bay window popularly known as <em>sãjhyāḥ</em>; syn. <em>bhvasūjhyāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 61)</p>
f965d03d-dd24-4dd6-b732-043fbd61ba93	ichẽ	 इछेँ	<p>n. rectangular house (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20).</p>
3d9c123e-7e36-44bc-8e96-2914f253e58b	sicācupi	 सिचाचुपि	<p>n. knife to cut the edges of a brick ruffian (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 75).</p>
584ed272-566a-489a-afad-4548d914021a	Ādibuddha	आदिबुद्ध	<p>[S.] n. In Vajrayāna Buddhism, the Ādibuddha refers to the 'First <em>(ādi)</em> Buddha' or the "Primordial Buddha". <em>Ādi</em> can also mean primordial, original, fundamental, or as existing from the beginning. It does not refer to a person; rather, it indicates the Buddha's nature <em>(tathāgatagarbha),</em> something primordially present as an innate wisdom in all sentient beings. The idea of an Ādibuddha originated in Nālandā Monastery at the beginning of the 10th century. <a href="../meaning/dc3b01bf-745b-488c-9c26-855e93bd8a92/" target="_blank" rel="noopener">Vajradhara</a>, also called Ādibuddha, is the primordial monotheistic god in Vajrayāna Buddhism, and is the embodiment of <em>sūnya</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 42). The identity of the Ādibuddha is not clear. Some consider one of the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>s to be Ādibuddha, while others regard <a href="../meaning/462a0040-b57c-4cbb-8c31-e0a0e8b3ca1d/" target="_blank" rel="noopener">Vajrasattva</a> or <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener">Bodhisattva</a>s like Samantabhadra or Vajrapāṇi as Ādibuddha (Bhattacharyya 1958: 44). In the Kathmandu Valley, however, Vajrasattva is revered as the Ādibuddha.</p>
ef0827c3-1d37-4c94-8b6c-94425a1989bd	gvaḥdhaliṃ	ग्व:धलिं	<p>n. rough beam (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 29).</p>
