1bca9b56-e7f6-46b8-b1ba-14c690dd6a46	jaḥdhuṃhiti	 ज:धुंहिति	<p>[New.] var. <em>jaḥdhũhiti</em>; <em>jarḥũhiti</em>, <em>jaḥrũhiti </em>n. see <a href="../meaning/jaḥdhuṃ/" target="_blank" rel="noopener"><em>jaḥdhuṃ</em></a>.</p>
16450fa9-ac84-4072-a5f2-99dfad6f2559	laytābhvay	 लत्याभ्वय्	<p>n. feast hosted by the family of the deceased on the day the <a href="../meaning/132bad3b-3ca3-499a-90dc-66ac5ef49b55/" target="_blank" rel="noopener"><em>latyā</em></a> ritual is performed.</p>
2b43fc14-3177-4fe9-a25f-2bbabdbde0fa	libi	 लिबि	<p>[New.] n. 1) courtyard, backyard (of a monastery). 2) park (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 70); open square in front of the house; courtyard (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 512).</p>
4f0f8370-fe02-4dbf-9382-db08fa4fa42d	athaḥ	 अथः	<p>n. an earthen tub often used for washing clothes.</p>
3a676811-5367-4738-a5d1-051eaf76306b	agiṃ	 अगिं	<p>n. a fire pit.</p>
1568766e-3257-4d21-9a5a-04bd304f0391	pasukā	  पसुका	<p>var. <em>pasūkā</em>; n. a compound term derived from Sanskrit term <em>pañca</em> (five) and Newar term <em>sutikā</em> (thread of cotton), <em>pasukā</em> is ritual garland of five-colored thread worn during <em>pūjās</em>. The threads of five colors white, blue, yellow, red and green represent five wisdoms of <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/4EWURQPS/library" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 25). <em>Pasukā</em> is also used as the medium through which the essence of a deity passes during the consecration or deconsecration of any idol or <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
cd474b0a-8881-4aff-b6db-591040063ae6	thapāḥāḥju	थपा:आ:जु	<p>n. the most senior elder of a monastery; see <a href="../meaning/053f8040-79ef-4662-8c32-dc185fb9dffb/" target="_blank" rel="noopener"><em>thapāḥju</em></a>.</p>
28924f38-4e96-4b0b-b097-29f53ffe35b2	macābaji		<p><strong>[to be revised]</strong></p>\n<p>n. beaten rice presented to the <em>guṭhī</em> for admission of a new-born child.</p>
6feb61b3-9482-4201-a60c-bf4c5bd0867c	viṃśatikoṇa	विंशतिकोण	<p>[S.] n. lit. twenty corners; it is usually found on the base of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
63e93491-4441-4d16-a4a4-be0e25f99da7	bākujhyāḥ	बाकुझ्याः	<p>n. blind window (lit. half window; syn. <em>bakhũjhyāḥ</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 60).</p>
9f981acb-ff9a-436a-9f65-d879a775434d	jyāḥpunhi	ज्या:पुन्हि	<p>[fr. S. <em>jyeṣṭhapūrṇimā</em>]; n. full moon of the month of <a href="../meaning/999e2d76-29f2-41b6-8efc-2d67ba23504d/" target="_blank" rel="noopener">Jyeṣṭha</a> (longest day of the year).</p>
ac74edea-fa06-4d3d-b074-df52a00b095a	āti	 आति	<p>var. <em>ārati</em>, <em>ā̃ti</em>; lintel (with the socket of the door pin) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20); horizontal piece of timber placed below a door or window; <em>thakhalu</em>; <em>thati</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 39).</p>
ab19a210-3b91-47c4-abe6-4ff840e35faa	khaimā	 खइमा	<p>[New.] var. <em>khaymā</em>; n. 1) jamb. 2) lock rings (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 25). 3) bar next to stairs that lead downstairs (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 126).</p>
