f;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a legendary bird with anthropomorphic form widely known as the <a href="../meaning/1335c012-fc27-47d1-84bd-a99e358c755d/" target="_blank" rel="noopener"><em>vāhana</em></a> of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> in Hinduism and Amoghasiddhi in Buddhism. Covered with feathers, Garuḍa has the beaked face of a bird and sports a pair of wings. He has two humanlike hands but his two legs are birdlike with talons. Garuḍa is also regularly featured at the top of <em><a href="../meaning/e7f31a6a-0841-4129-98cb-507abbb18749/" target="_blank" rel="noopener">toraṇa</a>s.</em><span style="font-size: 12.0pt; line-height: 107%; font-family: 'Calibri',sans-serif; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: 'Times New Roman'; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; color: black; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: NE;"><br /></span></p>
