b73d58db-7eed-4055-892a-cd2edbcc37e0	aṃsa	 अंस	<p>n. an egg pattern (usually carved). (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library">Gutschow et al. 1987: 19</a>). These egg-shaped decorative designs can be found on pillars.</p>
