587086a1-e820-45fc-bb69-1562ad49f957	gaḥchẽ	 ग:छेँ	<p>n. house with rooms giving on to each other (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 28); houses adjoining rooms accesible through a door.</p>
