dabf6234-fd09-4619-a1ac-d14aa3598737	śivaliṅga	    शिवलिङ्ग	<p>[S.] n. lit. <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a>'s genital organ; Śiva worshiped in the form of a phallus. This is usually made of stone or marble, and is set up in temples appropriated to Śiva; sometimes also referred to as <em>liṅga</em> only. <em>Śivaliṅga</em> is classified into two categories: <em>cala-liṅga</em> (movable phallus made of clay, gems, wood or stone) and <em>acala-liṅga</em> (immovable phallus that are permanently set up as the main deity of Śiva temples) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/5HTW3RD2/library" target="_blank" rel="noopener">Rao 1997</a>: 75-76). <em>Cala-liṅga</em>s are used at times of special worships that may be cast away after the worship is over.</p>\n<!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML></o:RelyOnVML>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:BreakWrappedTables>\n   <w:SnapToGridInCell></w:SnapToGridInCell>\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\n   <w:DontGrowAutofit></w:DontGrowAutof