1eda2543-9f4f-4623-bd75-3b6120184b7d	baji	 बजि	<p>[New.] n. beaten rice; a popular Newar food item that is prepared by boiling paddy and then flattening it by pounding in a wooden mortar (<a href="../meaning/9ced0df1-b370-4fe6-aa1a-55f79047a1ba/" target="_blank" rel="noopener"><em>ugaḥ</em></a>) with a wooden pestle.</p>
f9d9e0e2-9eb6-4c53-bde5-86c2eae32c6f	ikhā or ikhāchẽ	  इखा / इखाछेँ	<p>var. <em>īkhā</em>; n. 1) house of rectangular ground plan. 2) name of localities in Patan: Ikhā is the alley between the Ikhālakhu square and Haugaḥ; Ikhāchẽ is the locality north of Nāga Bāhāḥ near Ālko Hiti (<a href="https://danam.cats.uni-heidelberg.de/report/afa386ca-8eea-11ea-bd59-0242ac130005" target="_blank" rel="noopener">LAL0990</a>).</p>
