-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. Khaḍakṣarī; n. lit. the six-lettered Lokeśvara; he is the deification of the mantra '<em>Om Maṇi Padme Hūṃ</em>'. He is one of the Lokeśvaras widely revered by the Newars. He sits in the <em>vajra<a href="../meaning/35a51611-26c8-4600-b1d0-3beb0822b4b5/" target="_blank" rel="noopener">paryaṅka</a> <a href="../meaning/5aa03fe4-2e17-4b9b-b8aa-f102a581315e/" target="_blank" rel="noopener">mudrā</a></em>. He has four arms and one face. The principal pair of hands is joined against the chest in forming the <a href="../meaning/añjali/" target="_blank" rel="noopener"><em>añjali</em></a>. The second pair carries the rosary in the right and the lotus in the left (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 395). His image frequently appears at Buddhist monasteries, as he represents the <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener">Saṃgha</a> of the Buddhist trinity.</p>
