3ca28b3d-4284-4413-97c7-6f12a9a68db7	syākvatyākva	 स्याक्वत्याक्व	<p>var. <em>syākutyāku</em>; n. the ninth day of the <em>mohani</em> festival of the Newars when animals are sacrificed at various shrines of power goddesses. Buddhists, on the other hand, cut sugarcanes, radish, ginger or <em>bhuyūphasi</em> (a variety of pumpkin) in the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a>, symbolizing the killing of ill will and deeds against others.</p>
