ibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. <a href="../meaning/bbbbf03b-7dd0-4bcf-9825-ba299ebf9862/" target="_blank" rel="noopener">Karuṇāmaya</a> of Nālā, Kābhrepalañcoka. Although he is enshrined at a temple outside the Kathmandu valley, he is still considered one among the four Karuṇāmayas of the valley. His idol is also carried on a small chariot for the annual procession; syn. Sṛṣṭīkāntā Lokeśvara.</p>
b5752091-8571-409c-bfb1-85a03ca71158	kulāṃthāṃ	कुलांथां	<p>n. vertical beam of a latticed window (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 23); dividing middle post of a latticed window; syn. <em>chvālikathi</em>.</p>
c7b564f2-9424-4384-bd2f-21f0af6e5e16	gathu pyākhaṃ  	 गथु प्याखं	<p>n. mask dance performed by the <a href="../meaning/cfa80b93-7b7b-49e4-aea0-d912db5f7dbf/" target="_blank" rel="noopener"><em>gathu</em></a>s, the Newar caste of gardeners.</p>
e089f706-c565-415c-a29f-430a47ea785d	gãtā		<p><strong>[to be revised]</strong></p>\n<p>var. <em>gaṃtā</em>; n. a venerable personality.</p>
00420f46-591a-47e8-ac89-cb7950b9642e	hiphaḥdyaḥ	हिफ:द्य:	<p>n. lit. deity who receives blood; deity who accepts animal sacrifice.</p>
e1b386da-4791-4738-af71-c7705ffb50e7	kuṃsala	  कुंसल	<p>[New.] var. <em>kũsala</em>; n. lit. corner horse; corners strut carved in the shape of a winged horse. Other beasts like winged lions are also carved in such corner struts, but are generally known as <em>kuṃsala</em> in Newari; see <a href="../meaning/8dd3558f-fa52-49ff-8950-24347e34be3f/" target="_blank" rel="noopener"><em>śārdūla</em></a>.</p>
49d0fa1d-c208-44c1-8f93-f9c5aae84db3	ropanī	रोपनी	<p>[fr. S.] var. <em>ropani;</em> n. unit of land measurement in the hill region, including the Kathmandu Valley, comprising four <a href="../meaning/74085d99-37de-49b1-a422-4096633fe028/" target="_blank" rel="noopener"><em>murī</em></a>s. The area may vary according to the grade, but the current standard area for a <em>ropanī</em> comprises 5,476 square feet (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/regmi/titleCreatorYear/items/KPVWX9SU/item-list" target="_blank" rel="noopener">Regmi 1999</a>: 235). In the medieval inscriptions of the Kathmandu Valley, the term <em>ropanī</em> is usually represented by its short form <em>'rova'</em> or <em>'ro'.</em> This comes right after the name of the place the land is from and is followed by the area of the land written both in long-hand and numerically. For instance, 'Aphala Kṣetra <em>rova sva</em> 3' is written to mean 'three (3) <em>ropanī</em>s [of land from] the Aphala region'. Sometimes <em>'bu rova'</em>&nbsp; may also be used; this literally means '<em>ropanī</em>s of land'.</p>
40394500-d843-485a-9488-4f8d4c5fb67c	tasūjhyāḥ		<p><strong>[to be revised]</strong></p>\n<p>n. window with a decorative extra frame.</p>
33aea833-9bc0-40e3-8250-a33461d0aff6	vrata	 व्रत	<p>[S.] n. religious vow or practice, any pious observance, meritorious act of devotion or austerity, solemn vow, rule, holy practice (as fasting, continence) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 1042); fasting observed mostly by women on various occasions like <em>aṣṭamī</em> (eighth day of lunar fortnight), Monday, or in reverence to any particular deity like Basundharā, Mādhavanārāyaṇa, etc.</p>
4095a649-6b10-4a25-b6a3-17b01f7ba8da	kītvākaḥ	 कीत्वाक:	<p>n. 1) base for adzing. 2) base for planing (edge of the door leaves) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 22).</p>
6902d223-adf1-4b0c-b716-8ddf9a39addc	ghaṅgalāmāḥ	घङ्गलामा:	<p>var. <em>ghaṃgalāmāḥ</em>; n. string of small beads made of silver or silver-like alloy worn round the ankles by dancers.</p>
d3090843-39fe-4cb7-957e-8f7882f0eef3	caḥaḥpā	 च:अ:पा	<p>var. <em>caḥappā</em>; <em>archit</em>. n. cut brick to fill a gap in a course (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31).</p>
41d428b6-8327-4b8d-8442-e4a9bc05ec7f	agaḥ	 अगः	<p>n. brick-kiln.</p>
1908cc35-3941-42d0-b001-3fbc52bb66e6	gathicā	 गथिचा	<p>n. blackish clay (for bricks, post etc.) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 27).</p>
df444dbb-06c6-4302-b52d-6ca5b3b3b1e0	khā̃sā	खाँसा	<p>n. wood for chariot wheels (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 26).</p>
60e74487-1ede-4e5e-bb3f-b6b756f0f24a	agrākha	 अग्राख	<p>n. a kind of tree with hard wood; sāla tree; shorea robusta; syn. <em>agrāṭha</em>.</p>
5a9673cf-765c-44a8-aca6-cb3e6fefa8db	thakulāṃ	थकुलां	<p>var. <em>thakulā̃</em>; n. secondary or tertiary lintel of window or door; syn. <em>cakulāṃ</em>, <em>cvakulāṃ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 42).</p>
a6e3ce1a-9904-43db-aab0-da46e27b6eac	hitidũ		<p><strong>[to be revised]</strong></p>\n<p>var. <em>hitiduṃ</em>; n. system of pipes feeding a water conduit.</p>
4f69d891-8335-4be8-8df0-23e41e4c3fd6	kulāṃ	 कुलां	<p>n. 1) window cornice. 2) stepped pattern (of cornice) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 23).</p>
53d25379-a4ed-4b85-9372-a67517986fec	mānā	माना	<p>n. a volumetric unit equivalent to 0.568 litres, or 1/8 of a <a href="../meaning/518ea6e2-371d-4b1a-8762-57be0f235f82/" target="_blank" rel="noopener"><em>pāthī</em></a>.</p>
e89f03c5-e373-4b07-b390-0d702981be7e	cibhāḥpūjā	चिभा:पुजा	<p>n. a procession taken round the city to visit all the <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s of a locality after a new shrine is consecrated.</p>
