i",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. Lukumāḥdyaḥ; n. lit. the hiding <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a>; he is depicted in a small unhewn stone that sometimes may also resemble a <em><a href="../meaning/dabf6234-fd09-4619-a1ac-d14aa3598737/" target="_blank" rel="noopener">śivaliṅga</a></em>, but without a <a href="../meaning/151e4899-fb96-4406-9f4d-0bce6e3cc348/" target="_blank" rel="noopener"><em>jalaharī</em></a>. The stone is usually placed in a hole that is kept hidden in unclean places such as the neighborhood garbage dump or the courtyards, but can also be located just under the earth or even in the form of a flat open stone on the pavement (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/lukuma/titleCreatorYear/items/UBHEIG48/item-list" target="_blank" rel="noopener">Michaels 1992</a>: 193). The hole and stone inside is cleaned once a year on the day of <a href="../meaning/93f98d28-f6a3-45a0-acf0-689b58dab666/" target="_blank" rel="noopener"><em>Pāhāṃcaḥrhay</em></a> for the worship of Lukumahādyaḥ.</p>
a733add3-2ad2-452b-87cd-65eb77921e0b	dhimay	 धिमय्	<p>var. <em>dhime</em>; n. large (cylindrical) two-headed drum covered with leather on both ends that is played by beating its one side by palm while the other side by a specific curved stick called <em>dhimeykathi</em>. <em>Dhimay</em> is always accompanied by at least a set of <a href="../meaning/6a7ecb0c-bfde-4fc1-ac5c-6187eca35224/" target="_blank" rel="noopener"><em>bhusyāḥ</em></a> (cymbals) and is mostly played by the <a href="../meaning/ae3f0f86-d2a5-422d-af4b-b5f92e2a8182/" target="_blank" rel="noopener"><em>jyāpu</em></a> community.</p>
ed24ee35-a2db-493f-b994-e6a776f7af7b	bāṃaḥpā	बांअ:पा	<p>var. <em>bāṃappā</em>; n. moulded and decorated brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 60-61).</p>
b33fd2a6-bc58-4325-8ef0-e91ebd643362	keheṃpiṃli		<p><strong>[to be revised]</strong></p>\n<p>var. <em>kehẽpĩli</em>; n. <em>hon</em>. co-wife, second wife.</p>
