a0a25d43-66e8-4503-9f19-b74dd06f4abd	ḍamaru	डमरु	<p>[S.] (New. <em>dabadaba, dabudabu</em>, <em>damaru</em>, <em>damalu</em>) n. a musical instrument; a drum to which thongs with weight on the ends are attached. The drum is beaten by the weights as the drum is rotated rapidly back and forth; syn. <em>kāntāṃdabadaba</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 107).</p>
128b3415-a3ec-429b-ad7d-9878229746f4	dāphākhalaḥ	 दाफाखल:	<p>var. <em>dāpākhalaḥ</em>; n. a group of <a href="../meaning/10958029-7ce0-4c0e-a88a-f758e39f271b/" target="_blank" rel="noopener"><em>dāphā</em></a> musicians.</p>
7c94ba9f-08b2-45ba-a984-53e69ef1bf5c	ākhāḥchẽ	 आखा:छेँ	<p>var. <em>āḥgāḥchẽ</em>; n. a house where lessons on music and dance are given (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 11). It is a building for storing musical instruments and other materials like ornaments, masks and dresses of traditional dances.</p>
fff3d4b4-80cb-4e8c-ae0f-f1b64bbbf42c	gajkathi	 गज्‌कथि	<p>n. measuring rod (one yard) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 27).</p>
9824fa1b-7810-4f65-a411-3c9ce5ba21c4	gaḥjhyāḥ	 ग:झ्या:	<p>n. blind window; see <a href="../meaning/9dfb84b2-b2d9-4b5b-8137-ab62688866a3/" target="_blank" rel="noopener"><em>degaḥjhyāḥ</em></a>.</p>
f9af7937-20a5-4370-9d9a-1662182ea1c1	khicākhaḥ	 खिचाख:	<p>n. base landing for a staircase (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 26); platform usually made of wooden planks or bricks that is used as the landing base for <em>svāhane</em> (staircase).</p>
dbcdd8f1-eee5-41b7-acc2-8b9f4bf80a12	pati1	 पति	<p>n. 1) batten. 2) cover moulding (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 52). oblong veneer, split wood (for fixing panes into window frames).</p>
ac07ce20-cbeb-4b4a-b3af-24ef14b4b16e	sukundā	 सुकुन्दा	<p>var. <em>sukuṃdā</em>; n. ceremonial oil lamp with a receptacle for storing oil that also has an image of <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a> under the protection of a hood of 5 or 7 conjoined serpents while their body serves as an ornate handle. A lit <em>sukundā</em> is an indispensable item in any Newar worship, as it marks the presence of Ganedyaḥ.</p>
722c5cb8-96f4-4654-8ede-c9d8da1a1ada	gvaṅgaḥaḥpā	 ग्वंग:अ:पा	<p>var. <em>gvaṅgaḥpā</em>; n. lit. rooster brick; tile having the shape of a bird used at the corner of a protruding roof.</p>
69d368f0-9e0a-41b4-a2ae-70f9413f4962	kilāy	किलाय्	<p>n. end wall (without the right to have a window) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 22).</p>
cb08aef5-a7b9-4f65-8bbc-f9d4cbd2b0d1	vedikā	वेदिका	<p>[S.] n. an altar; plinth of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>.</p>
9bfbcd87-8566-4300-b753-1cbc61451168	duthãaḥpā	दुथँअ:पा	<p>var. <em>duthãappā</em>, <em>duthaṃaḥpā</em>; n. fragments of bricks used as filling material (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 46).</p>
a86c2bc1-1475-431d-955a-fd0869ee525c	sakhvāḥ	सख्वा:	<p>var. <em>sakhvā</em>; n. 1) lime used for a white-wash.</p>\n<p>2) mixture of lime and brick dust used as brick plaster.</p>
b0ae1d25-d001-4317-b6a3-c93fdb1974d9	garāla	गराल	<p>n. wooden support for sawing lumber (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 27).</p>
