1f493998-e1be-4af5-8302-d509c1c9da25	ghaṅgalā	 घङ्गला	<p>var. <em>ghaṃgalā</em>, <em>khvaṃgala</em>, <em>ghaṃsulā</em>; n. 1) small bell, set of bells. 2) metal ornament that jingles, worn by dancers on the legs or ankles (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 52). Usually a girl child is made to wear a <em>ghaṅgalā</em> during the <a href="../meaning/459c956c-7b3c-4cf7-afca-f5f83fc836a4/" target="_blank" rel="noopener"><em>ihī</em></a> or <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a> ceremony.</p>
