dException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. the beheaded; she is one of the ten <a href="../meaning/9b60ac91-cbb0-48df-9776-949c7e67a27e/" target="_blank" rel="noopener"><em>mahāvidyā</em></a>s. Chinnamastā represents the power of sacrifice. Although her image exists with some variations, she is described in the Tantras as follows: "Her left foot forward in battle, she holds her severed head and a knife. Naked, she drinks voluptuously the stream of the blood-nectar flowing from her beheaded body. The jewel on her forehead is tied with a serpent. She has three eyes" (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XURK54J2/library" target="_blank" rel="noopener">Daniélou 1985</a>: 281). Chinnamastā holds her severed head with her left hand while her right hand grasps the scimitar that she used to behead herself. Three streams of blood spurt from her severed neck, from which her severed head and her two attendants drink. Her shrine in Patan can be found in a narrow lane called Mvaḥmadu Galli ('the alley of the headless', so named after the deity). She is worshipped as <a href="../meaning/ab6c90cb-055f-4d1a-a3e0-618bb8b0d96d/" target="_blank" rel="noopener">Vajrayoginī</a> by the Buddhists, whilst Tibetans know her as Ucheyma.</p>
ccdcb362-2b63-428c-af19-53b10c829fea	jvālā	ज्वाला	<p>[S.] n. flame.</p>
cddd0c49-3813-4d05-bd1a-dd91e02b0a6f	āgaṃ	आगं	<p>[fr. S. <em>āgama</em>] var. <em>āgaṇa</em>; n. 1) the place where the image of the family deity is housed; the household chapel (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 16). Usually housed on the first floor of a monastery, the āgaṃ is a shrine of its principal deity, Cakrasaṃvara, who is worshipped by a Vajrācārya priest. Sometimes a Śākya elder may also perform the daily worship of Cakrasaṃvara if the monastery belongs exclusively to Śākyas. 2) a room in every household where the family's lineage and other deities are enshrined; prayer room.</p>
e0b7973e-59b8-4ed0-87b6-ee46f059733f	dhaliṃmvaḥ	 धलिंम्व:	<p>var. <em>dhalĩmvala</em>, <em>dhaliṃmvala</em>; n. a carved beam end (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 48). The outer end of a beam, carved with the face of a lion or <a href="../meaning/c6855dc3-2ae4-452d-9675-a6e4caeab30f/" target="_blank" rel="noopener"><em>kuṃsuru</em></a> (mythical animal such as a flying ram with a beak), etc.</p>
df481572-4fcc-46f7-9e7f-fdf99a763b6c	śakti	शक्ति	<p>n. lit. power or strength; female consort of a deity. In Vajrayāna, <em>śakti</em> is also taken as <em>prajñā</em> (wisdom). The <em>śakti</em>s are either represented singly or in yab-yum, i.e. in actual embrace of the god to whom she is affiliated as a <em>śakti</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 438).</p>
28f75c69-42c9-4fbc-8362-27a895f2905c	kvakhā	क्वखा	<p>var. <em>kokhā</em>; n. 1) private passage to a courtyard (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 23); syn. <em>kvakhāduvāḥ</em>.</p>\n<p>2) a long strip of cloth usually of red in colour that is worn around the neck as a gift of any deity after its worship.</p>
4ac03a58-cb38-48b5-a011-99e5b917e457	nikhalā		<p><strong>[to be revised]</strong></p>\n<p>var. <em>nikhalaṃ</em>; n. religious fasting before a <em>śrāddha</em>.</p>
360fa248-34de-4b42-adf2-b2fde9ca9007	thusā	थुसा	<p>n. a bull; gold gilded statue of a bull.</p>
64ce8a96-2519-4107-ba8d-cce184e7b4a9	pañcamahāpātaka	पञ्चमहापातक	<p>n. the five great sins: killing a Brahmin, drinking intoxicating liquor, stealing, committing adultery with the wife of one's teacher or elder, and associating with anyone guilty of these crimes. In inscriptions, it is mentioned that if anyone violates the rules stated in the inscription and/or destroys or hampers the monument, the five great sins will cling to the person and will have to bear the consequences.</p>
f4de003f-1941-4375-98ff-27a014419b9e	pāśa	  पाश	<p>[S.] the noose as attribute of <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> or <a href="../meaning/be67e0e6-70f4-4d1b-b7d3-790a039a1572/" target="_blank" rel="noopener">Yama</a>; noose or lasso; when a <em><a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener">vajra</a></em> is attached at its end, it is called <em>vajrapāśa</em> or the adamantine noose. The noose is required to bind the host of the māras and all other wicked beings (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 437).</p>
cfa80b93-7b7b-49e4-aea0-d912db5f7dbf	gathu	गथु	<p>n. a Newar caste of gardeners usually known as Mālī, Mālākāra, Banamālā, Banamālī, Banamālākāra, Ujāḥ; <em>hon</em>. Ujāḥju (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 38).</p>
410956d9-8f92-4e44-be81-8912cf3b4e91	charke aḥpā	 छर्के अ:पा	<p>var. <em>charke appā</em>; n. cornice brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 34)</p>
1335c012-fc27-47d1-84bd-a99e358c755d	vāhana	 वाहन	<p>[S.] var. <em>bāhāṃ </em>(New.); n. 1) a deity's mount. 2) animal used for riding. Deities are seen riding their respective vāhana, or at times, the <em>vāhana</em> is seen at the side of the deity. A <em>vāhana</em> is called <em>bāhāṃ</em> in Newari, but <em>bāhāṃ</em> also refers to any animal assigned for a sacrifice. <em>Bāhāṃ</em> also means an astrological 'seat' assigned to a person in the birth chart in accordance with the time and place of the birth.</p>
efca1233-e95b-49b8-bcb7-c2045765654c	capilā	  चपिला	<p>[New.] n. a small box (for fine cotton); syn. <em>pilā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31); a small treasure box with a roof-shaped lid.</p>
c2db8af9-8385-447e-82ee-7ff32aa12c91	Sarasvatī	सरस्वती	<p>n. the deity of knowledge and wisdom often characterized by her holding of a <em>vīṇā</em> (a musical instrument) and riding of a swan.</p>
0516f979-9d32-49ce-80ec-5bd695955311	Amitābha	      अमिताभ	<p>n. one of the five <em>dhyānī</em> Buddhas who faces west; see <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>.</p>
