ocked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 4"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 4"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. the lord of the world, the name is a shortened form of Avalokiteśvara, the lord who gazes down (upon all sentient beings). Lokeśvara is arguably the most popular deity in Buddhism after the Buddha himself. The concept of Lokeśvara came into existence from the Mahāyāna school of thought as a deity who renounced the well-deserved <em>nirvāṇa</em> (salvation) of his own until all beings of the world attained it first. The earliest form of his name was Avalokita-svara, which was changed into Avalokiteśvara in 646 AD by Hsüan-tsang (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/JPDVZTRR/library" target="_blank" rel="noopener">Lokesh Chandra 1987</a>: 192-193). Usually, the image of Lokeśvara is identifiable by a deerskin on his left shoulder with the deer head next to his heart. The deerskin is varyingly interpreted as harmlessness, compassion and love, and also as convergence of Avalokiteśvara and Harihara, the fused form of <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> and <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/6I98PN7A/library" target="_blank" rel="noopener">Zhang 2017</a>: 15). Sumedha, who was born as Siddhārtha Gautama after many rebirths, also wore deerskin. The Buddha is mentioned to have worn a deerskin in other past lives as well (Zhang 2017: 25-26). This probably is the base for the presence of deerskin in the images of Lokeśvara. He takes many forms to deliver beings in peril and, therefore, has many names. The images of 108 forms of Lokeśvara can be seen at the temple of <a href="../meaning/9a23f6e1-253e-4072-ae54-81e2b2c8ca66/" target="_blank" rel="noopener">Janabāhāḥdyaḥ</a>, Kathmandu. <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener">Bodhisattva</a> (lit. the being with perfect wisdom) is another name Lokeśvara is known with.</p>
391747e4-a05b-4018-b618-0677d100a7a2	betāḥsĩ	  बेता:सिँ	<p>n. a long upturned shaft from the chariot of <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a>. The chariot is used during the <em>Biskāḥ Jātrā</em> in Bhaktapur. An image of Betāḥdyaḥ (Betāla) can be seen on the upturned part of the shaft; see <a href="../meaning/dhaḥmā/" target="_blank" rel="noopener"><em>dhaḥmā</em></a>.</p>
