526e1412-53dd-4df9-96ca-f0cbe645a839	dyaḥbva	  द्य:ब्व	<p>n. a plate (usually of broad leaves sewn together) allocated for certain deities that contains all the dishes served in the annual <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guṭhī</em></a> feast. During the feast, the <em>dyaḥbva</em> is served first ahead of serving the plates of the participants of the feast.</p>
