dcc1480f-6cd8-4f96-a282-11959a2778de	chusyāḥ	छुस्या:	<p>n. a pair of cymbals that are played with <a href="../meaning/249fb246-140c-4af6-8c32-baf4d68dd043/" target="_blank" rel="noopener"><em>nāykhiṃ</em></a> drums (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 101); see <a href="../meaning/0a80b8eb-35d5-4c6d-b06f-8a616bcb2712/" target="_blank" rel="noopener"><em>sichyāḥ</em></a>.</p>
f88adb8e-686c-4a43-805c-cd81f5a87f12	sigalimāḥ		<p><strong>[to be revised]</strong></p>\n<p>n. necklace of silver coins to decorate a deity during a procession.</p>
9e170f5e-4fec-4e0e-bb46-37b5c5c91bbc	Sūrya	 सूर्य	<p>[S.] n. the sun; the sun deity often seen riding a chariot driven by seven horses along with <a href="../meaning/8fbf5fac-a712-48b8-b0f3-72939f7d0e40/" target="_blank" rel="noopener">Candra</a>, the moon deity, riding a chariot driven by seven swans on either side of the main entrance of a monastery; New. Surdyaḥ, Suldyaḥ.</p>
a4c89b71-41f8-43fd-bf90-24c1a4f6d28a	laytādegupujā		<p><strong>[to be revised]</strong></p>\n<p>n. worship of the patron deity of a family celebrated on a joyful occasion.</p>
953f6989-6957-41e1-ae0e-b7864e5be46e	Kati Punhi	कति पुन्हि	<p>var. Kati Pūnhi; n. the full moon day of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvina</a> when the <em>cau chāygu</em> ritual is observed on <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a></em>s around the Kathmandu Valley. The day also marks the beginning of offering <a href="../meaning/28b017ef-7966-4bbb-b886-610e657c5307/" target="_blank" rel="noopener"><em>ālamata</em></a>. The event is known as <em>yaḥsĩi mata bīgu;</em> syn. Kojāgrata Pūrṇimā, Sīghaḥ Punhi.</p>
fcafd3fd-2343-438a-a922-b041ae40547d	tharapā	थरपा	<p>[old New.] n. see <a href="../meaning/053f8040-79ef-4662-8c32-dc185fb9dffb/" target="_blank" rel="noopener"><em>thapāḥju</em></a>.</p>
9d1d8dda-39de-4663-a278-42c7f171a7f2	ā̃gana	आँगन	<p>n. an open space in front of the entrance of a house; an open courtyard.</p>
28b017ef-7966-4bbb-b886-610e657c5307	ālamata	  आलमत	<p>var. <em>ālaḥmata</em>; n. literally a sky lamp, it is a lamp hanging from a bamboo pole erected in the month of <a href="../meaning/595d9eb4-1430-4593-99a2-219660fc33f8/" target="_blank" rel="noopener">Kārtika</a>; also called <em><em>ākāśadīpa</em></em>, <em>ālumata</em>, <em>āliṃmata</em>, <em>sargaḥmata</em>; see <a href="../meaning/ad51bfcb-7b6c-4baa-975b-3ded274774cf/" target="_blank" rel="noopener"><em>matakalaḥ</em></a>.</p>
