i",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. four <a href="../meaning/d082a037-83e2-412c-a4b4-71485feee8ee/" target="_blank" rel="noopener"><em>stūpa</em></a>s; it is the collective reference to the four <em>stūpa</em>s at the four cardinal points of Patan that are believed to have been commissioned by Maurya Emperor Aśoka to be constructed. They are: <a href="../meaning/84c43f61-6093-4b19-80c8-1f3f90f5a102/" target="_blank" rel="noopener">Tetā Thūra</a> (east), <a href="../meaning/7ca064fe-c7b5-4544-9bee-372ee8b06a1a/" target="_blank" rel="noopener">Lagaṃ Thūra</a> (south), <a href="../meaning/d6940078-b80a-4f74-b456-346429f5a4dd/" target="_blank" rel="noopener">Pūcva Thūra</a> (west) and <a href="../meaning/b6fbaf15-1f12-4b35-9ea3-af346e949905/" target="_blank" rel="noopener">Ībahī Thūra</a> (north). It is also believed that he constructed a fifth <em>stūpa</em> at the center, which many believe is the Pim Bāhāḥ <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. Historically, Aśoka's visit to the Kathmandu valley cannot be proved, but probably his daughter Cārumatī was the one who got these <em>thūra</em>s constructed at the instruction of her father. She is also credited for the construction of Dhando <em>caitya</em> (Cāybahī Stūpa) and Cārumatī vihar in Cābahila (Chabahil), Kathmandu. <!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML/>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n 