bbdda25c-e45a-4c70-857d-a7bbd1a7b5a6	thyāsaphū	 थ्यासफू	<p>n. lit. folded manuscript; general term for handwritten manuscripts.<em> Thyāsaphū</em> actually refers to manuscripts that are written on a long paper that is folded several times to form multiple pages. A manuscript that is written on pages that are detached from one another is called<em> byaṃsaphū </em>(lit. detached manuscript). However, this term rarely comes into general use and, therefore, such manuscripts are also commonly known as <em>thyāsaphū</em>.<span style="font-size: 12.0pt; line-height: 107%; font-family: 'Helvetica',sans-serif; mso-fareast-font-family: 'Times New Roman'; color: black; mso-ansi-language: EN-US; mso-fareast-language: EN-US; mso-bidi-language: NE;"><br /></span></p>
f3dc9b4f-7248-416d-80d5-b6a67c3e846d	ekā	एका	<p>var. <em>ikā</em>, <em>yakā</em>; n. perforated batten (latticed window) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 20).</p>
68015ee3-2e04-4d8f-b0b0-3b6c4838e81c	agaḥchẽ	अगःछेँ	<p>var. <em>agaḥcheṃ</em>; small house without windows.</p>
d62b6cd0-10fa-4e8f-a9a5-03b4aed1b9b7	kilāypvāḥ	 किलाय्‌प्वा:	<p>n. opening of end wall (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 22).</p>
a57c6cda-124a-4552-aa36-5233a80c5b66	ācārya	 आचार्य	<p>[S.] n. knowing or teaching the <em>ācāra</em> or rules; a spiritual guide or teacher (especially one who invests the student with sacrificial thread, and instructs him in the <em>veda</em>s, in the law of sacrifice religious mysteries (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 131).</p>
63bc0bd4-4abe-4df0-8d6c-1d014eef0e4b	ilāṃ	 इलां	<p>[fr. old New. <em>irāna</em>, <em>yirāna</em>] n. canopy of metal or cloth spread right on top of a deity. A large piece of cloth spread tightly across the ceiling to cover the rafters in a room is also called <em>ilāṃ</em>.</p>
f803765b-21cc-4ca6-b48d-969c182d166c	Jyāpu Samāja	ज्यापु समाज	<p>n. <em>org</em>. the umbrella organization of various caste groups within the <a href="../meaning/ae3f0f86-d2a5-422d-af4b-b5f92e2a8182/" target="_blank" rel="noopener"><em>jyāpu</em></a>s, the peasant caste of the Newars, of Patan and the surrounding areas. Similar organization of the <em>jyāpu</em>s of Kathmandu is called Jyāpu Mahāguthi.</p>
6e88022b-4703-4340-b7cc-35a66e01093e	thakāli	थकालि	<p>var. <em>thakālī</em> (Nep.); n. 1) an individual who is senior in terms of age.</p>\n<p>2) the most senior member of a <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a>.</p>
f904d88c-ef4b-4756-9354-dc2e40fb432c	ṭola	 टोल	<p>[fr. New. <em>tvāḥ</em>/<em>tvāla</em>] n. a locality of a town or village; a part of a town inhabited by persons belonging to a particular community or caste. Every Newar <em>tvāḥ</em> or <em>ṭola</em> has a separate shrine of <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a>. With every other shrine of Ganedyaḥ, one can know that one has come to a new <em>ṭola</em>.</p>
f90d6428-afb0-4f68-8a9f-89b8ce753f36	ghaḥcāḥ	घ:चा:	<p>(old New. <em>cāka</em>) n. 1) wheel; wheel of a chariot. 2) potter's wheel.</p>
f66e8a00-a4e3-486a-b847-e44207b0a4ef	tvāḥ	 त्वा:	<p>[New.] var. <em>tvāla</em>, <em>tvaḥ</em>; see <a href="../meaning/f904d88c-ef4b-4756-9354-dc2e40fb432c/" target="_blank" rel="noopener"><em>ṭola</em></a>.</p>
079e0b18-5367-4240-a2d4-a27a42c49698	trayodaśabhūmī	त्रयोदशभूमी	<p>n. lit. thirteen lands; thirteen tiers seen on the finial of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>; see <a href="../meaning/ff01eb73-6aa5-416c-9dcc-4d55b870538e/" target="_blank" rel="noopener"><em>trayodaśabhuvana</em></a>.</p>
f4d4edee-1872-4155-af34-df27457bf204	cūḍākaraṇa	 चूडाकरण	<p>[S.] n. The eighth of the sixteen life cycle rituals (<em>saṃskāras</em>). The three higher <em>varṇas </em>must perform this on a male child's first or third year of life.</p>
30a7a569-0c61-446a-af88-b815d8d2377e	pātra	पात्र	<p>[S.] n. ceremonial bowl of brass or silver, used as a substitute for <a href="../meaning/e0baa909-a8f2-4cd2-b4be-4a644874bed2/" target="_blank" rel="noopener"><em>kapālapātra</em></a> (skull cup), for keeping consecrated wine or fermented beer during secret tantric ceremonies. Its contents are often used as a blessing by the initiates of tantric empowerments (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/vajracharya/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 25); syn. <a href="../meaning/933e601d-2585-4501-bbb1-090f9e330c1d/" target="_blank" rel="noopener"><em>pātrakhvālā</em></a>.</p>
eddb9195-744d-4541-90ba-99defe1b43ab	prasāda	प्रसाद	<p>[S.] n. food items offered to a deity that are given back to devotees as propitiatory offering or gift from the deity.</p>
b7b88773-0895-41a8-86d8-42490a3133da	varṣavarddhana	 वर्षवर्द्धन	<p>[S.] n. anniversary of any shrine, <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>, <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a>, etc; <em>busādhaṃ</em> (New.)</p>
2f9128fa-a186-433c-b90b-16344d0be8db	uye	 उये	<p>var. <em>ui</em>, <em>uigu</em>; vt. 1) to bake (bricks, earthen pots).</p>\n<p>2) to cremate.</p>
9c6b3887-5d93-409f-935d-a85b34f4f5a0	Pauṣa	पौष	<p>[S.] var. <em>Puṣa</em>, <em>Pusa</em> (Nep.); n. the ninth month of the solar calendar adopted by the Vikrama era that corresponds to December-January when the full moon is in the asterism <em>Puṣya.</em></p>
dc3b01bf-745b-488c-9c26-855e93bd8a92	Vajradhara	वज्रधर	<p>n. lit. holder of a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a>; Vajradhara is depicted as a single-faced deity with two arms. He is usually shown sitting cross-legged, holding a <em>vajra</em> in his right hand and a <em>ghaṇṭa</em> in the left. In these depictions, both of his arms are crossed in front of his chest in the gesture of <em><a href="../meaning/76827c6f-3369-4269-8783-522cae5cab1a/" target="_blank" rel="noopener">vajrahuṅkāra mudrā</a>.</em> However, the Niṣpannayogāvalī offers a rather different description. Here, Vajradhara is described as having three faces. His main face is described as reddish-white whilst the right and left are blue and red respectively. This form of Vajradhara also has six arms. His two main hands carry a <em>vajra</em> and a <a href="../meaning/7fe1fd8b-9e18-4a5e-b3c6-8529bac35ece/" target="_blank" rel="noopener"><em>ghaṇṭa</em></a> and are shown embracing <em>prajñā </em>(<em><a href="../meaning/df481572-4fcc-46f7-9e7f-fdf99a763b6c/" target="_blank" rel="noopener">śakti</a></em>)<em>.</em> His two remaining  right hands carry a sword and an <em>aṅkuśa</em> (hook), whilst his left hands hold a <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a> and a noose. Vajradhara stands in the <em>ardhaparyaṅka āsana</em> position, performing the <em>tāṇḍava</em> dance which exhibits the nine dramatic sentiments (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 44). In some traditions, he is revered as the <a href="../meaning/584ed272-566a-489a-afad-4548d914021a/" target="_blank" rel="noopener">Ādibuddha</a>.</p>
ca91d47b-a8c8-4684-b442-c62a6f12c7a7	lākāṃsĩkulāṃ	 	<p><strong>[to be revised]</strong></p>\n<p>var. <em>lakāṃsĩkulāṃ</em>, <em>lākāṃsiṃkulāṃ</em>; carved base of a window frame.</p>
f5991f05-dc9d-46bd-a022-27d3c35e8880	dhyāna	   ध्यान	<p>[S.] meditation; this generally refers to the section of the <em>sādhana</em> in which a worshipper thinks of himself as the deity he is offering his obeisance too. In the case of a novice worshipper, a teacher will provide instructions regarding the description of the deity; concentration; thought; reflection; especially profound and abstract religious contemplation; divine intuition or discernment; mental representation of the personal attributes of a deity.</p>
f386160f-8463-4dd7-aac1-0169b1b70933	bepā	 बेपा	<p>var. <em>bepāaḥpā</em>; n. <em>masonry</em>. stretcher (lit. diagonal brick). Position of a brick when laid on its face with the long axis of the perpendicular to the long axis of the wall (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 181). A brick laid in a wall so that its longer edge is exposed or parallel to the surface. It is a term of Bhaktapur dialect of Newari; in the Kathmandu dialect, it is called <em>caḥapā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 183) .</p>
7aad7687-0518-4851-8023-8346d4239540	Ganedyaḥ	  गनेद्य:	<p>var. Ganeydyaḥ, Ganay, Ināy; n. Lord Gaṇeśa; the deity widely revered as remover of obstacles and ensurer of auspicious beginning. He is recognizable by his head of an elephant. In any Newar worship, the presence of Ganedyaḥ is indispensable. Therefore, his presence is ensured by placing a lit <a href="../meaning/sukundā/" target="_blank" rel="noopener"><em>sukundā</em></a> with his image. He is sometimes referred to as Ināy or Inā, a short form of Vināyaka. Thainā, for instance, is the Ganedyaḥ of uptown while Kvainā (var. Kvaynā) is the Ganedyaḥ of the lower part of the city. <!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML/>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="&#45;-"/>\n   <m:smallFrac m:val="off"/>\n   <m:dispDef/>\n   <m:lMargin m:val="0"/>\n   <m:rMargin m:val="0"/>\n   <m:defJc m:val="centerGroup"/>\n   <m:wrapIndent m:val="1440"/>\n   <m: