;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->The names Thainā and Kvainā also come from the position of Ganedyaḥ in the image. The image of Thainā has Ganedyaḥ riding on the shoulder of <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a>, while Kvainā has Ganedyaḥ sitting below Bhailaḥdyaḥ. Buinā is another form of Ganedyaḥ carried by Bhailaḥdyaḥ in his arms.</p>
