 2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a> of the locality; every Newar locality has a separate shrine of <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a>, which is the Sthānagaṇeśa of that <a href="../meaning/f904d88c-ef4b-4756-9354-dc2e40fb432c/" target="_blank" rel="noopener"><em>ṭola</em></a>. In the Newar tradition, any auspicious occasion at home requires offering a special worship to Ganedyaḥ. Such worship is offered to only the Sthānagaṇeśa of the ṭola where the house is, even though there are other shrines of the deity in the area. Sthānagaṇeśa is therefore important because no household of the locality can offer such familial worships to a shrine other than the Sthānagaṇeśa.</p>
350248a5-add2-44d6-b229-9b15eb2c0424	bihāṃculi	 बिहांचुलि	<p>var. <em>behā̃culi</em>, <em>behāṃculu, byāṃculi</em>; the tune of the morning song that is sung early in the morning before the rooster crows (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 416). The song itself is called <em>bihaṃculimye </em>and is sung to wake the inhabitants of a town (usually before <em><a href="../meaning/dbdfb21e-2b84-4ff9-b6dd-8721d49fe6ba/" target="_blank" rel="noopener">Dasaĩ</a>).</em></p>
ee9a52da-5d70-4b43-b2c9-620a62ce4256	tunāḥ	तुना:	<p>var. <em>tunāla</em>; n. eaves strut; syn. <em>tunāḥsĩ</em>.</p>
