1886d536-46bb-4e46-8cc8-8045ccaa65e8	jvalānhāykaṃ	 ज्वलान्हाय्‌कं	<p>var. <em>jvālānhāykaṃ</em>; n. ceremonial mirror of brass or silver encircled by flames. It is a symbol of perfect wisdom. A <em>jvalānhāykaṃ</em> is shown to the <a href="../meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>, the main deity of a monastery, and also to the devotees during the early morning rituals. During <em>kalaśapujā</em>s, a <em>jvalānhāykaṃ</em> is always accompanied by a <a href="../meaning/3ad5c123-0361-44ee-89b1-11d5682ad730/" target="_blank" rel="noopener"><em>sinhaḥmū</em></a>, a pot used as a container for vermillion powder.</p>
e0baa909-a8f2-4cd2-b4be-4a644874bed2	kapālapātra	 कपालपात्र	<p>[S.] n. skull cup; see <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a> and <a href="../meaning/30a7a569-0c61-446a-af88-b815d8d2377e/" target="_blank" rel="noopener"><em>pātra</em></a>.</p>
a17f5d4e-f9cb-4ce6-a042-19abad25310b	kvakhāduvāḥ	क्वखादुवा:	<p>n. private passage to a courtyard; see <em>kvakhā</em> (1).</p>
e89dbf63-3551-45e6-9c8c-9f5fa365fd18	nityapūjā	नित्यपूजा	<p>[S.] daily worship/ritual</p>
d60cd0ca-553c-41c6-9729-795cec7a15d5	palehaḥ	पलेह:	<p>n. petal or leaf of a lotus.</p>
b861d0d7-7271-4987-a533-326d330c2cac	bebhaḥ	  बेभः	<p>see <a href="../meaning/06d91e39-2c26-4019-a251-a7c780308edb/" target="_blank" rel="noopener"><em>aphaḥ</em></a>.</p>
35a51611-26c8-4600-b1d0-3beb0822b4b5	paryaṅka	    पर्यङ्क	<p>n. a particular mode of sitting on the ground (a squatting position assumed by ascetics and Buddhists in meditation) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 607); an <a href="../meaning/dd349648-a5e4-48fe-9e1f-d6d72c5590f2/" target="_blank" rel="noopener"><em>āsana</em></a> (posture or attitude exhibited by the lower limbs); there are three forms of <em>paryaṅka āsana</em>: <em>paryaṅka</em>, <a href="../meaning/3cc936ab-092d-49b1-b05d-43fdee8490d8/" target="_blank" rel="noopener"><em>ardhaparyaṅka</em></a> and <em>vajraparyaṅka</em>. <em>Paryaṅkāsana</em> is a sitting posture with two legs placed upon one another with both soles invisible. On the other hand, <em>vajraparyaṅkāsana</em> is a meditative pose with the two legs firmly locked with both soles apparent like the characteristic sitting attitude of the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>. It is also known as <em>dhyānāsana</em> or <em>vajrāsana</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 435). <em>Ardhaparyaṅkāsana</em> literally means semi-<em>paryaṅkāsana</em> in which both legs are on the same pedestal with one knee raised while the other is bent in the usual meditative pose of the Buddha. Also known as <em>mahārājalīlā</em>, <em>ardhaparyaṅkāsana</em> is different from <a href="../meaning/d9747f76-d55e-4d13-bbef-3bfd25e27f8a/" target="_blank" rel="noopener"><em>lalitāsana</em></a> in which one leg is pendant while the other is bent in the usual position of the Buddha (Bhattacharyya 1958: 432).</p>
6692599e-0459-4178-bd86-e2b69ab9940b	roho thusā	रोहो थुसा	<p>[old New.] n. stone statue of a bull.</p>
0347ad0d-e496-4a52-b987-a7f23f348ca7	yākvajhyāḥ	याक्वझ्या:	<p>var. <em>yākujhyāḥ</em>; n. lit. arm pit window; blind window, small window (on either side of a door in a temple).</p>
4c6ecd97-0bbc-4480-92bc-4971eda779e0	ātī	आती	<p>n. 1) a mixture of items like <em>paḥkā</em> (yellow mustard), <em>ambaḥsukū</em> (dried <em>amalā</em>; phyllanthus emblica), <em>hāmvaḥ</em> (sesamum seed) and <em>chucuṃ</em> (wheat flour) that are to be anointed before a mourner takes a bath during purificatory ritual after a death in the family; a mixture that is believed to purify defilement (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 39).</p>\n<p>2) oblation of cooked rice and wheat flour offered to a deceased on the funeral pyre by the person setting fire to it.</p>
462a0040-b57c-4cbb-8c31-e0a0e8b3ca1d	Vajrasattva	वज्रसत्त्व	<p>n. lit. a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> being; having a soul or heart made of adamant (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 914); widely revered as the <a href="../meaning/584ed272-566a-489a-afad-4548d914021a/" target="_blank" rel="noopener">Ādibuddha</a>, the highest deity of the Newar Buddhist pantheon. Vajrasattva sits cross-legged, holding a <em>vajra</em> in his right hand with the palm turned upwards against his chest whilst his left hand holds a <a href="../meaning/7fe1fd8b-9e18-4a5e-b3c6-8529bac35ece/" target="_blank" rel="noopener"><em>ghaṇṭa</em></a> and rests on his left thigh. He is white in colour and is regarded as the sixth <em>dhyāni</em> Buddha - considered to be the priest of the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a> - and is therefore represented by the priestly symbols of the <em>vajra</em> and the <em>ghaṇṭa</em>. He is regarded as an embodiment of the five <em>skandha</em>s (constituent elements) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 48).</p>
c8988fb0-8df3-471b-8866-d332fa2b35a2	khicāgathisāḥ	 खिचागथिसा:	<p>n. hammer headed joint (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 26) ; a kind of joint used for joining two blocks of timber.</p>
6077d5f5-5a6c-47c9-b1c7-fc6cc6e34a27	kalaṃka pujā	 कलंक पुजा	<p>n. worship related to left-over food after a feast (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 42).</p>
f9e9630d-2d75-4eb2-8843-fe46f811a92c	gāḥhiti	गा:हिति	<p>n. enclosed space of a fountain (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 28).</p>
f3a3235a-8379-4970-abf0-22cd40b3149e	phalcā	 फल्चा	<p>[New.] var. <em>phare</em>, <em>phale</em>, <em>phalacā</em>; n. wayside shelter, one-storeyed building open towards the street for religious or social functions (see, KSND s.v. <em>phalcā </em>and <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 57), for travellers, rest-house. <em>Phalcā</em>, which is little more than roofed rectangular platform, “usually a lean-to in the towns, but free-standing along the trails” (cf. <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/slusser%20/titleCreatorYear/items/ZD7MU4JM/item-list" target="_blank" rel="noopener">Slusser 1982, vol. 1</a>: 146); compare <a href="../meaning/0b57733c-31f2-4ca6-a51a-1b06b374733d/" target="_blank" rel="noopener"><em>sataḥ</em></a>.</p>
34d6baae-2b50-4b87-8c24-ed3202029448	bhīmarathārohaṇa	 भीमरथारोहण	<p>[S.] n. the first old age rite locally known as <em>nhāpāṃ jaṃko</em> performed when one reaches the age of 77 years, 7 months, 7 days; see <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a>.</p>
e52c20b3-d516-425c-b97f-20459349afc5	jīsvā̃saṃnhu		<p><strong>[to be revised]</strong></p>\n<p>var. <em>jisvāṃsaṃnhu</em>; day when jasmine oil is prepared.</p>
e42b0c1a-12e1-41ef-a1e7-a2a4dd4e0978	sanāḥguthi	सना:गुथि	<p>var. <em>sanāguthi</em>; n. funeral <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a>. Every <em>sanāḥguthi</em> covers a certain area of the city, that is, the seniormost male member of the family from that area becomes a member of the respective <em>sanāḥguthi</em>. When any member of the <em>sanāḥguthi</em> or his family member passes away, the other members of the respective <em>sanāḥguthi</em> organize a funeral procession for the deceased and also cremate the body at <em>dipa</em> (cremation ground). In the case of a large number of members, a <em>sanāḥguthi</em> may also be divided into subgroups and each group takes turn in organizing funeral procession. The <em>guthi</em> also organizes a feast for all the members once a year; syn. <em>sīguthi</em>.</p>
55e04a44-407f-4ec8-949e-64704d39b346	gvaykvacā	ग्वय्‌क्वचा	<p>n. betel nut design on door frame or window frame that symbolize welcome or auspicious opening.</p>
05d2cece-746e-493e-8c46-91a2bab5ad95	caumari	चौमरि/चउमरि	<p>n. a ceremonial thin coloured bread that is hurled around during the <em>Dyaḥ Lvākegu</em> festival at Asana, Kathmandu (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 74). The festival is observed on the 1st of the bright fortnight of <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a>; a thin round bread made of rice flour. <em>Caumari</em> may also have small holes in it.</p>
dd603e08-3ee7-4b19-a526-d3b23b5d2f62	casi	  चसि	<p>n. pilgrims of Yeṃkī Daha. The pilgrims follow a leader (Dāgiṃ) in a procession held on the full moon day of the <em>Indra Jātrā</em> festival. The procession usually takes place in the evening around the <em>Kāṣṭhamaṇḍapa</em> in Kathmandu (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 57). The act of taking part in the procession is known as <em>casijā vanegu</em>. Devotees scatter seven types of <em>bībaḥ</em> (grains like paddy, barley, etc.) along with flowers and rice as they follow the Dāgiṃ in a procession that goes round Kathmandu City. The procession follows the route taken by the chariot of Kumārī (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 175). After the conclusion of the procession, the Dāgiṃ leads the devotees all the way to Yeṃki Daha, a natural pool in Dahachoka that is also known as Indra Daha. Here, the pilgrims take a holy bath.</p>
b52cfe2b-cdd4-4aae-a420-b3a1b9ffeaba	yaḥmari	 यःमरि	<p>var. <em>yamari</em>, <em>yomari</em>; n. steamed pastry of rice flour made in conical shape that contains small amount of thick paste of molasses and sesame seeds inside. On <em>Thiṃlāpunhi</em> or <em>Yaḥmaripunhi</em>, the full-moon day of <a href="../meaning/92c18b60-16a1-41ec-bb0d-bb0178e057c5/" target="_blank" rel="noopener">Mārgaśīrṣa</a>, the Newars prepare <em>yaḥmari</em> and worship the new harvest of paddy. <em>Māymari</em>, another form of pasty but with mashed paste of soaked black lentil inside, is also prepared in the same manner on that day. Both <em>yaḥmari</em> and <em>māymari</em> of slightly larger in size called <em>māyaḥ</em> and <em>bāyaḥ</em> are offered to the pot where the new harvest of paddy is stored. Small images of rice flour, which depict the activities relating to paddy and rice, are also made and offered to the stored paddy. These images may include a lady with a winnowing tray, a man carrying a bag of paddy on his back, etc. All of these images and pastries are worshipped every day and taken out on the fourth day to be eaten by the whole family as <a href="../meaning/eddb9195-744d-4541-90ba-99defe1b43ab/" target="_blank" rel="noopener"><em>prasāda</em></a>. <em>Yaḥmaripunhi</em> is also considered as the Lakṣmī Pujā, the worship of the deity of wealth, by the Newars.</p>
4140113a-e8dc-4935-832c-cccaedee839b	hitimaṃgaḥ	 हितिमंग:	<p>var. <em>hitimaṅgaḥ</em>; artistic spout of water conduit. <em>Hitimaṃgaḥ</em>, a water creature, is the <a href="../meaning/1335c012-fc27-47d1-84bd-a99e358c755d/" target="_blank" rel="noopener"><em>vāhana</em></a> (vehicle) of Varuṇa Nāgarāja, the serpent deity usually worshipped when there is a shortage of water. <em>Hitimaṃgaḥ</em> is the most important part of a <em>hiti</em>, as its open mouth is the outlet through which the water comes out. The creature is described as having a mouth and trunk like that of an elephant, eyebrows like flames, a set of teeth with canine teeth as well, horns turning backwards, wings for flying, a pair of legs and a tail like that of a yak (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/svanigala/titleCreatorYear/items/RSE3N8Z5/item-list" target="_blank" rel="noopener">Śākya 1994</a>: 24). The elongated spout serves as its body covered in elaborately carved foliage design. There is a creature, usually a lizard, on top of <em>hitimaṃgaḥ</em> that serves as cover.</p>
b108ae0d-b543-4134-9be4-4423aefe31c9	dhusaḥ	  धुस:	<p>n. a person skilled in extracting gold and silver out of the dust collected from a gold or silversmith's workshop (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 197); a term defining the profession of the Vajrācāryas who extract gold or silver from the dust collected from goldsmiths' workshops.</p>
2d4f6afd-f52e-479f-a006-7c82f1c9dc8d	astadhātu	 अस्तधातु	<p>[fr. S. <em>aṣṭadhātu</em>] n. a set of the eight metals (gold, silver, copper, lead, bronze, iron, mercury and tin) used in rituals either in form of metal dust or melted into one lump. Sometimes steel is mentioned in place of mercury (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 116).</p>
937af349-ead6-41c7-a9ed-2ae9fc6dd45f	pi	  पि	<p>n. painter’s brush (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 54).</p>
3d57610b-757e-461d-8c7e-deaa9b8c648a	thakūlvahaṃ	थकूल्वहं	<p>var. <em>thakūlvahã</em>, <em>thakūlhvaṃ</em>; n. stone lintel (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 42).</p>
676c2e41-b2f6-403b-b7f3-8490be77a95e	pīṭha 	पीठ	<p><!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML/>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="&#45;-"/>\n   <m:smallFrac m:val="off"/>\n   <m:dispDef/>\n   <m:lMargin m:val="0"/>\n   <m:rMargin m:val="0"/>\n   <m:defJc m:val="centerGroup"/>\n   <m:wrapIndent m:val="1440"/>\n   <m:intLim m:val="subSup"/>\n   <m:naryLim m:val="undOvr"/>\n  </m:mathPr></w:WordDocument>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:LatentStyles DefLockedState="false" DefUnhideWhenUsed="false"\n  DefSemiHidden="false" DefQFormat="false" DefPriority="99"\n  LatentStyleCount="371">\n  <w:LsdException Locked="false" Priority="0" QFormat="true" Name="Normal"/>\n  <w:LsdException Locked="false" Priority="9" QFormat="true" Name="heading 1"/>\n  <w:LsdException Locked="false" Priority="9" SemiHidden="true"\n   UnhideWhenUsed="true" QFormat="true" Name="heading 2"/>\n  <w:LsdException Lo