>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. seat of <a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a>; usually unhewn stones are seen as a manifestation of these eight mother goddesses at their shrines that may be open with only a demarcation of the shrine area, or a proper temple. The Newar cities are established under the protection of the <em>aṣṭamātṛkā</em> deities at the four cardinal and the four intermediate points. There are three sets of <em>aṣṭamātṛkā</em> shrines (i.e. 24 shrines in total) that offer the protection; the first surrounds the Kathmandu city while the second surrounds the entire Kathmandu valley and the third surrounds the places beyond the valley that were formerly under the dominion of the Newar kings. Among the Vajrācāryas, there is a tradition of visiting all 24 <em>pīṭha</em>s in a year with one shrine being visited every half of the lunar month. The tradition is called <em>pīṭhapujā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/ritual%20as%20me/titleCreatorYear/items/IRBIUBTR/item-list" target="_blank" rel="noopener">Gutschow and Bajracharya 1977</a>: 4).</p>
60842ea7-514e-401d-94b7-be34f86b4935	khvalā	 ख्वला	<p>[New.] var. <em>khvālā</em>; n. small metal wide-mouthed cup used especially for drinking <a href="../meaning/ae175c99-b039-446a-9fa3-87756f63a2a1/" target="_blank" rel="noopener"><em>aylāḥ</em></a> (alcohol). See <a href="../meaning/meaning/933e601d-2585-4501-bbb1-090f9e330c1d/" target="_blank" rel="noopener"><em>pātrakhvalā</em></a>.</p>
33e33586-97ba-47d1-9366-33b1823d9ccc	cakra	  चक्र	<p>[S.] n. a discus or sharp circular missile; it is the characteristic symbol of the Hindu God <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> or <a href="../meaning/d98aa7a0-c87f-49f2-841d-361ce1aed87b/" target="_blank" rel="noopener">Kṛṣṇa</a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 434).</p>
975e0f79-636f-40d2-b5cd-46dcf809eea3	cikaṃaḥpā	चिकंअ:पा	<p>var. <em>cikaṃappā</em>, <em>cikãappā</em>; n. square-shaped floor tile.</p>
bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5	vajra	वज्र	<p>[S.] n. thunderbolt, a key ritual instrument in <em>Vajrayāna</em> Buddhism. A ritual object used by Vajrayāna masters during various empowerment sessions and life-cycle rituals, symbolizing the union of wisdom and skill in means (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/vajracharya/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 28). When two thunderbolts are crossed, it is called <em>viśvavajra</em> or a double <em>vajra</em>. In Buddhist tantra, <em>vajra</em> generally designates <em>śūnya</em> or void, which cannot be cut, cannot be destroyed, but which destroys all evils (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 440).</p>
f1b15f79-4c6b-4dd2-a74e-67c30b6d80bb	vapijhyāḥ	 वपिझ्या:	<p>n. miniature windows on both sides of doors (ground floor) or central windows (second floor) of temples or monasteries (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 218); see <a href="../meaning/9dfb84b2-b2d9-4b5b-8137-ab62688866a3/" target="_blank" rel="noopener"><em>degaḥjhyāḥ</em></a>.</p>
9124a10e-5a2e-4747-965d-b3dd896ac4c2	ghau	घौ	<p>(mod. New.) n. a period of one hour.</p>
12dc48f1-1a16-4343-afcf-8ab20a25a435	ikhuṃ	इखुं	<p>n. <em>anim</em>. swallow.</p>
45fabb02-59bc-4d90-b218-50d036034aba	laṃcva	 लंच्व	<p>n. protruding end of lintel (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 69).</p>
a4198e38-3231-4097-9ef6-3ccd55865e26	prabhāmaṇḍala	 प्रभामण्डल	<p>[S.] n. a circle or crown of rays (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 684).</p>
3b1b7188-3964-4a04-b8cb-55c859c511fa	tādalū	 तादलू	<p>n. lit. nailed lampstand; lampstand made of brass that can be nailed on a wall or on a pillar. There are various types of <em>dalū</em>, a lampstand that has slightly concaved round or oval surface where one can pour oil, put a cotton wick and light its tip. <em>Tādalū</em> is nailed on a wall or pillar. <a href="../meaning/9b905ed2-ebc4-4945-ba7c-b3abe9edf8e5/" target="_blank" rel="noopener"><em>Khādalū</em></a> is hung by a metal chain on a rafter below roof eaves right in front of a window. <a href="../meaning/8645edda-a316-405a-bd98-c37c754263c4/" target="_blank" rel="noopener"><em>Cākaḥdalū</em></a> is a host of <em>dalū</em>s lined around a shrine or <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. <em>Dalū</em> is used only to offer light to deities or <em>caitya</em>; it is not used for the purpose of lightening a room.</p>
c6e48edf-633b-4738-a2a8-97bc092adbdd	Vaiṣṇava	 वैष्णव	<p>[S.] n. 1) relating, belonging, devoted or consecrated to Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a>.</p>\n<p>2) person who follows Vaishnavism.</p>
557e6c83-9716-4662-9cd9-d4f41eaed458	betvāḥ	बेत्वाः	<p>n. 1) sash rail (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 62); timber that is placed on four sides while fixing a window or door (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 421).</p>\n<p>2) timber that is used in between structures to shim up while fixing windows, doors or stairs.</p>
147d4b9c-f71c-466e-a82c-b6f1cfed0426	janai	जनै	<p>var. <em>janā</em>, <em>junā</em>; n. Sacred Thread. According to the Brahmanical scriptures, the Sacred Thread is worn diagonally by the twice-born of the three upper castes. The Sacred Thread of an Upādhyāya Brahmin whose parents are dead has 9 strands (<em>ḍorā</em>), whose parents are alive, 6 strands; of a Jaisī Brahmin, 6 strands; of a Chetrī, 3 strands. The <em>Mulukī Ain of 1854</em> defines that the people who are entitled to put on the Sacred Thread belong to the Sacred Thread-wearing Caste.</p>
7e2ea29c-392f-4867-8af3-2e2e9c680230	kvāpādyaḥ	क्वापाद्य:	<p>n. a variant of <a href="../meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>.</p>
ce3e00a7-c1ea-4892-ba62-a9dbd2c88892	khatāṃgāḥ	खतांगा:	<p>n. socket at the base of a door to hold the door leaves.</p>
518ea6e2-371d-4b1a-8762-57be0f235f82	pāthī	पाथी	<p>n. a volumetric unit equivalent to 4.546 litres comprising of 8 <em><a href="../meaning/53d25379-a4ed-4b85-9372-a67517986fec/" target="_blank" rel="noopener">mānā</a>s</em>.</p>
8db83410-760a-4e3b-8f10-00dcb2124768	kuṃ nāḥgvaḥaḥpā	कुं ना:ग्व:अ:पा	<p>var. <em>kuṃ nāḥgvaḥappā</em>; n. corner quarter round brick.</p>
710273c0-b306-4280-b8fb-22965db47a08	lũjhyāḥ	लुँझ्या:	<p>var. <em>luṃjhyāḥ</em>; n. lit. golden window; window covered with gilded metal sheets.</p>
f89aedf8-dea3-42b8-a756-c138045d26e4	nakiṃjhyāḥ	 नकिंझ्या:	<p>var. <em>nakĩjhyāḥ</em>; n. 1) a window with the image of Kumārī.</p>\n<p>2) a place in Mahāpāla, Patan named after such a window in Bhelakhu Bāhāḥ (<a href="https://danam.cats.uni-heidelberg.de/report/a03c60ca-ebe9-11e9-b125-0242ac130002" target="_blank" rel="noopener">LAL0230</a>).</p>
c5acd6ac-977e-4a25-b55b-63a14660222c	gvasyāḥ	 ग्वस्या:	<p>var. <em>gosyāḥ;</em> n. main leader of a <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a>.</p>
67a48449-1b93-451f-ae64-021366c96009	samay	समय्	<p>[New.] var. <em>samaybaji</em>, <em>samhay </em>n. set of ceremonial (ritual) food items including black soybeans, beaten rice mixed with puffed rice, spiced roasted meat and ginger that is offered to a deity and then consumed by devotees as <a href="../meaning/eddb9195-744d-4541-90ba-99defe1b43ab/" target="_blank" rel="noopener"><em>prasāda</em></a>. <em>Samay</em> is required for esoteric worships at <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> in addition to the regular items for worship. These items for an esoteric worship is usually carried on a <a href="../meaning/9cf90c73-7608-44fc-beb4-981d7c540e9f/" target="_blank" rel="noopener"><em>kalaḥ</em></a>.</p>
