from among the four <em>stūpa</em>s at the cardinal points of Patan; syn. Aśoka Stūpa East.</p>
91e14fae-97ea-4d7f-b0cc-4fdaf0fe76dc	Śrīpañcamī	 श्रीपञ्चमी	<p>[S.] n. 1) the 5th of the bright fortnight of the month of <a href="../meaning/063dae1f-37d1-43b9-bf33-5ff3bd435678/" target="_blank" rel="noopener">Māgha</a>, also known as <em>vasantapañcamī</em>, <em>mañjupañcamī </em>or <em>gurupañcamī </em>that marks the beginning of spring. Deities of wisdom, <a href="../meaning/c2db8af9-8385-447e-82ee-7ff32aa12c91/" target="_blank" rel="noopener">Sarasvatī</a> and <a href="../meaning/ea75bca9-710e-42d4-a212-ae998e7081ba/" target="_blank" rel="noopener">Mañjuśrī</a>, are worshipped on this day.</p>\n<p>2) festival held on that day.</p>
aae5edae-1075-4280-b86c-063520df9acb	pãla	 पँल	<p>var. <em>paḥchi</em>; n. <em>meas</em>. measure of weight (200 grams).</p>
2071c869-7977-4d02-9b99-760a194177af	ghaḥphaḥ	घ:फ:	<p>n. pedestal for a pitcher.</p>
75647057-ede1-4596-af72-9d33ccc5a093	āju	 आजु	<p>var. <em>ajā</em>; n. lit. an elderly man; ancestors.</p>
2ef8ec3f-a937-4fda-8e12-da7d9ed64c32	pula	   पुल	<p>var. <em>pura</em>,<em> pulacā</em>; n. a small tower made in pagoda style with a finial directly above the <a href="../meaning/bd3d0c88-5a22-4da6-8fc4-0d138ada7166/" target="_blank" rel="noopener"><em>gandhurī devatā</em></a> (main deity) of a <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>; see <a href="../meaning/7e91b99d-407a-44ad-9159-34a4fbb76bbc/" target="_blank" rel="noopener"><em>phujā</em></a>.</p>
3ad5c123-0361-44ee-89b1-11d5682ad730	sinhaḥmū	 सिन्ह:मू	<p>[fr. old New. <em>siṃdhramuṃṅa</em>, <em>sidhraṃmu</em>, <em>sidharamu</em>] n. ritual container of vermillion powder that usually comes into use in pair with <a href="../meaning/1886d536-46bb-4e46-8cc8-8045ccaa65e8/" target="_blank" rel="noopener"><em>jvalānhāykaṃ</em></a>. It has five tiers of concentric rings – the largest at the bottom and the smallest at the top – that serve as the cover for the container.</p>
86f2f01c-6dc7-460e-94f4-8fa2e2d0e122	nyāpusikhaḥ	 न्यापुसिख:	<p>n. lit. five chains, it is a golden ornament with five chains representing <em>pañcatatva</em> (five elements) worn on either side of the head by a girl mostly on her marriage, but also during pre-menstrual rituals like <em><a href="../meaning/meaning/459c956c-7b3c-4cf7-afca-f5f83fc836a4/" target="_blank" rel="noopener">ihī</a></em> and <em>bārhāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 341). In bridal makeup, two <em>nyāpusikhaḥ</em>s always flank a <em>lũsvāṃ</em>, the golden flower, which is another ornament that adorns the center of the head.</p>
6c22d550-67f4-40cc-81f3-f0694b3b3931	kapāy	कपाय्	<p>n. cottonwool.</p>
e4be10ad-dd98-4cff-9ab2-39cd058c5f8d	gvalgulāṃ	ग्वल्गुलां	<p>n. rounded chisel (carving) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 29).</p>
aa293109-2a65-4f22-97e2-e451e274f423	mandaḥ	  मन्द:	<p>var. <em>maṃdaḥ</em>; n. <em>maṇḍala</em>; circle; a ritual map that outlines the positioning of various deities of the group of the central deity of a <em>mandaḥ</em>. Every <em>mandaḥ</em> is identified with its central deity, who is placed at the center of a <em>yantra</em> design that consists of four entrances at four cardinal points with a <a href="../meaning/e7f31a6a-0841-4129-98cb-507abbb18749/" target="_blank" rel="noopener"><em>toraṇa</em></a> on top. The central deity, who may be represented by one of his/her implement, is sometimes surrounded by the eight emblems of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a> or other related deities usually represented by one of their implements. All of these are seen within a border of frill pattern that is again surrounded by other circles of lotus, <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> and fire known as <em>padmāvalī</em>, <em>vajrāvalī</em> and <em>jvālāvalī</em> respectively (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mandahya/titleCreatorYear/items/UB28BSZU/item-list" target="_blank" rel="noopener">Śākya 1120 NS</a>: 63). Some <em>mandaḥ</em>s may also contain two additional circles of water and eight charnel grounds called <em>aṣṭaśmaśāna</em>. There is also a unique <em>kāyamandaḥ</em> (lit. <em>mandaḥ</em> of the body) in the Newar tradition that is drawn up for performing <em>mhapujā</em>. This <em>mandaḥ</em> is not related to any deity and consists of eight petals of lotus symbolizing <em>aṣṭamaṅgala</em> in the Buddhist tradition. In the Hindu tradition, a <em>kāyamandaḥ</em> symbolizes three forms of <em>deha</em> (body): a. <em>sthūla deha</em> (the human body), b. <em>sukṣma deha</em> (the human mind), and c. <em>kāraṇa deha</em> (the devine knowledge). The combination of material body and mind makes it a person who then begins to comtemplate on divinities, which in turn enables a being to become devine (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mhapuja%20va/titleCreatorYear/items/E3EHRRIU/item-list" target="_blank" rel="noopener">Vaidya 1120 NS</a>: 58). A <em>mandaḥ</em> is also taken as the basis for the placement of struts on a temple or monastery. A strut with an image of a certain deity is placed in the same direction as the deity is seen on a <em>mandaḥ</em> of the main deity of that particular temple or monastery. The construction of every <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> is also based on a <em>mandaḥ</em>.</p>
8dd3558f-fa52-49ff-8950-24347e34be3f	śārdūla	     शार्दूल	<p>n. one of the huge rampant beasts, fantastic horned and winged griffons, lions, lion-griffons (leogryphs), or other hybrids that are carved on corner struts of a temple. Besides <em>śārdūla</em>, other such beasts are called <em>vyāla</em> and <em>vyālaka</em>. Imbued with unimaginable strength, they symbolically and physically support the corners of the ponderous roofs and overhanging eaves and, fiercely glaring in all directions, are the temple's especially powerful spiritual defenders and protectors (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Slusser%20/titleCreatorYear/items/QU4AB2SW/item-list" target="_blank" rel="noopener">Slusser 2010</a>: 17). The Newars refer to these animals simply as <em><a href="../meaning/e1b386da-4791-4738-af71-c7705ffb50e7/" target="_blank" rel="noopener">kuṃsala</a></em> (corner horse). Metal images of <em>śārdūla</em> and other such beasts can also be found installed at the corners of a monument as seen at Kvāḥ Bāhāḥ, Patan.</p>\n<!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML></o:RelyOnVML>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w