d509259b-b593-47b5-b3c7-16a685aedd4c	kāulelhvaṃ	काउलेल्ह्वं	<p>var. <em>kāulelvahaṃ</em>; n. lit. turtle stone; stone slab above the first foundation stone.</p>
febe5d25-e71b-4aaf-94a2-cb152993e6c0	āgaṃdegaḥ	आगंदेगः	<p>var. <em>āgãdegaḥ</em>; a temple that houses the shrine of esoteric clan deity. It differs from <a href="../meaning/ac240bd1-c4f7-44d3-a4d2-3ebe4b2e6abf/" target="_blank" rel="noopener"><em>āgaṃchẽ</em></a> in the sense that it does not have space for feasts and gatherings.</p>
4ff9640a-5e0f-43ba-ba85-58e9ceb1a183	tvākaḥ	त्वाक:	<p>var. <em>tvākala</em>; n. block of wood used as base.</p>
e22fd213-0f47-4303-9f96-3ac30bbc8500	kvaphyaḥ	क्वफ्य:	<p>n. decorative base of a chariot; stylized frill (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 24).</p>
20d753be-a4bd-493d-bd28-a04086bf89f7	hegā	हेगा	<p>var. <em>lhegā </em>(?); n. outer garment (made of metal) of a statue.</p>
d0ea2708-4565-4ff7-953b-5778a2c8a014	dãkaḥmicupi	  दँक:मिचुपि	<p>n. a brick layer's axe (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 45); tool with a blade for cutting and shaping bricks.</p>
