aa9bcc95-15c5-4ee3-b7ce-70bf358e7b31	gajū	  गजू	<p>[New.] var. <em>gajura, gajurhi</em>, <em>gajula</em>, <em>gajuli</em>; n. pinnacle (specially of a temple); finial; see <a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>kalaśa</em></a>.</p>
3aab7763-8af2-42a4-9a68-eac63022b5bf	yekā	 येका	<p>var. ikā, <em>yakā, yãkā</em>; n. lengthwise veneer of a latticed window; slotted batten (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 194).</p>
459c956c-7b3c-4cf7-afca-f5f83fc836a4	ihī	  इही	<p>n. a pre-puberty ritual marriage of a Newar maiden with Suvarṇa Kumāra, a form of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a>, while a <em>bel </em>fruit (aegle marmelos) remains a witness of the event. It is believed that a Newar girl is not widowed even after her human husband dies due to the <em>ihī</em> ritual. This, however, is untrue in practice, as Newar women observe a year of mourning period after her husband dies.</p>
1cf78308-b754-430f-9b16-e157f653b0d6	hitimaṃgaḥbājaṃ	 	<p><strong>[to be revised]</strong></p>\n<p>var. <em>hitimaṅgaḥbājã</em>; kind of wind instrument similar to a water spout.</p>
75e760ab-8dc7-4046-9721-99a135e83d0f	kacā	कचा	<p>[New.] n. branch. For instance, <a href="../meaning/47794909-6cb4-449a-9d35-269d697f021d/" target="_blank" rel="noopener"><em>kacābāhāḥ</em></a>=branch monastery.</p>
6b1d787c-cec2-4afc-adad-dd6a4b845a2f	kaygū	कय्‌गू	<p>n. dried pea.</p>
