Priority="52"\n   Name="List Table 7 Colorful Accent 1"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 2"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 2"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 2"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 2"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 2"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 2"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 2"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 3"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 3"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 3"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 3"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 3"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 3"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 3"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 4"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 4"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 4"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 4"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 4"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 4"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 4"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a deity highly revered by the Newar traders, Bhīmasena is popularly known as Bhindyaḥ (benevolent god) among the Newars. They worship a small image of Bhīmasena on an altar in shops. Commonly known as the second of the five Pāṇḍava brothers of the epic Mahābhārata, some Newars, however, believe Bhindyaḥ is a separate deity and has nothing to do with Bhīmasena. The (<em>Mahā</em>-)<em>bhīmasena</em>-<em>dhāraṇī</em> describes Bhīmasena as assuming a militant stance (<a href="../meaning/34846f84-c0bc-4fc1-aa80-ceecb84256cd/" target="_blank" rel="noopener">pratyālīḍha</a>) and holds a club (<a href="../meaning/be1b1383-96eb-4a98-a449-5561d9bdd502/" target="_blank" rel="noopener">gadā</a>) in his right hand, while displaying the gesture of protection (<a href="../meaning/1912063a-4393-47ac-b05c-1d51a636172c/" target="_blank" rel="noopener">abhaya mudrā</a>) with his left (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/A4BZFPPM/library" target="_blank" rel="noopener">Bühnemann 2013</a>: 457). He is also worshipped as another form of <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a> (Bhairava). The earliest reference to Bhīmasena worship is found in a copper plate inscription of 660 NS (1540 CE) that records the donation of lands for the deity's worship (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/PU34B72R/library" target="_blank" rel="noopener">Regmi 1966</a>: 612). But the tradition surely predates the event.</p>
74085d99-37de-49b1-a422-4096633fe028	murī	मुरी	<p>var. <em>muri</em> (New.); n. volumetric unit comprising 20 <em><a href="../meaning/518ea6e2-371d-4b1a-8762-57be0f235f82/" target="_blank" rel="noopener">pāthī</a>s </em>(with 8 <em><a href="../meaning/53d25379-a4ed-4b85-9372-a67517986fec/" target="_blank" rel="noopener">mānā</a>s </em>to a <em>pāthī</em>), equivalent to 90.919 (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/PQ8VNR7F/library" target="_blank" rel="noopener">Pant 2002</a>: 134) or 87.23 (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/pant/titleCreatorYear/items/VRMHZ2FE/item-list" target="_blank" rel="noopener">Pant and Pierce 1989</a>: 93) litres.</p>
ad1ff239-40f0-4b09-96ac-76d0600f2361	pāyāḥ	    पाया:	<p>n. sword procession that is taken out during the <em>Mohani</em> (that coincides with the <a href="../meaning/dbdfb21e-2b84-4ff9-b6dd-8721d49fe6ba/" target="_blank" rel="noopener"><em>Dasaĩ</em></a>) festival. In Patan, <em>Thasimalaḥ <a href="../meaning/352cff84-8911-40b2-93e5-eb9a3fd09d33/" target="_blank" rel="noopener">Pāyaḥ</a></em> is the most anticipated <em>pāyāḥ</em> that is taken out on the ninth day of the bright fortnight of Āśvīna. The <em>pāyāḥ</em> commences from Mahālakṣmī temple (<a href="https://danam.cats.uni-heidelberg.de/report/13b0e238-70ba-11ea-b99f-0242ac130006" target="_blank" rel="noopener">LAL0020</a>) in Thasikhyaḥ with a <em>pāyaḥ</em> carrying a sword with both of his hands in a trance while another person carries a severed head of a buffalo sacrificed before the start of the procession that concludes at the Patan Durbar Square. There were other annual processions of <em>pāyaḥ</em> in Patan like <em>Lāykū Pāyāḥ</em>, <em>Taḥjhyāḥ Pāyāḥ</em>, etc. But they have stopped being taken out. Another unique <em>pāyāḥ</em> is taken out in Su Bāhāḥ (<a href="https://danam.cats.uni-heidelberg.de/report/ce814212-e698-11e9-8bc4-0242ac130002" target="_blank" rel="noopener">LAL1920</a>) area when the main <a href="../meaning/6e88022b-4703-4340-b7cc-35a66e01093e/" target="_blank" rel="noopener"><em>thakāli</em></a> of the <a href="../meaning/e42b0c1a-12e1-41ef-a1e7-a2a4dd4e0978/" target="_blank" rel="noopener"><em>sanāḥguthi</em></a> (funeral association) of the local <a href="../meaning/ae3f0f86-d2a5-422d-af4b-b5f92e2a8182/" target="_blank" rel="noopener"><em>jyāpu</em></a>s passes away. On the day of <em>Lakhuṃcaḥrhay</em> (the 14th day of the dark fortnight of <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a>), the <em>pāyāḥ</em> is taken out from the residence of the deceased <em>thakāli</em>. A <em>pāyaḥ</em> comes out carrying items used by the <em>sanāḥguthi</em>. Another unique <em>pāyāḥ</em> is taken out in Asana area of Kathmandu on the 11th day of the bright fortnight of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvina</a>. The youngest boy among the Tulādharas of Asan who has undergone the <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a> ritual leads the <em>pāyāḥ</em> procession by carrying a small sword. Also known as <em>macāpāyāḥ</em> (sword procession of a child), the procession is taken out from the <a href="../meaning/631ec54a-ad88-403f-9c4c-9d2ecc57f85c/" target="_blank" rel="noopener"><em>dyaḥchẽ</em></a> of Tulādharas in Asana that goes round the area and returns to the <em>dyaḥchẽ</em> to conclude the <em>pāyāḥ</em>. The boy <em>pāyaḥ</em> then cuts a <em>bhuyūphasi</em> (a variety of pumpkin) that has a face of a demon painted on it. The <em>pāyāḥ</em> concludes after all other male members of the Tulādhara clan of Asana strike a blow to the <em>bhuyūphasi</em> with their sword.</p>
38171c17-1351-488d-853f-f5025e815fef	cau chāygu	चौ/चउ छाय्‌गु	<p>v. offering a canopy of a square cloth that is known as <em>cau.</em> Its four corners are strung by a thin rope and is placed right over a <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a>.</em> The event is observed mostly on the full moon day of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvina</a>. <em>Cau</em> looks similar to an <a href="../meaning/63bc0bd4-4abe-4df0-8d6c-1d014eef0e4b/" target="_blank" rel="noopener"><em>ilāṃ</em></a> that is placed in the similar manner over the main deity of a monastery. <em>Cau</em> may also be made of a square wooden frame with a small pole at the middle on one side that has five tiers of concentric rings with a piece of cloth of five different colours on top. The square frame is placed on top of a <em>caitya</em> in a way that it rests around its dome.</p>
9c435717-f5ba-433e-9284-0c7e8e2dde85	gvaḥdhāḥ	ग्व:धा:	<p>n. chisel with rounded edge (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 29).</p>
af024f39-5fa1-4f30-87e0-955f9c9533e3	kathipā	कथिपा	<p>n. stick fixed to the bottom of the flat <em>āypāsāḥ</em> (mould) to form a notch for the interlocking of the roof tile (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 168).</p>
47aec4e3-0a21-4d20-a10f-8404f6e530dd	sãjhyāḥ	 सँझ्याः	<p>var. <em>saṃjhyāḥ</em>; bay window (protruding and slightly slanting); syn. <em>bhvasūjhyāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 73-74).</p>
845aa05b-1009-4f23-b221-ce554bd4b266	kartṛ	 कर्तृ	<p>[fr. S. <em>kartarī</em>] n. a small semi-circular knife whose one end curve slightly forward with usually a jagged-edged blade and the handle is on the opposite side of the blade. It is considered as the one of the weapons of <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a>. If a <em>kartṛ</em> is surmounted by a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a>, it is called <em>vajrakartṛ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 436). Usually deities, the <a href="../meaning/df481572-4fcc-46f7-9e7f-fdf99a763b6c/" target="_blank" rel="noopener"><em>śakti</em></a> (female consort) in particular, are seen carrying a <em>kartṛ</em> along with a <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a>, a skull cup. <em>Kartṛ</em> is the symbol for the destruction of ignorance while <em>kapāla</em> stands for oneness absolute (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 43).</p>
fa56cbd3-47e9-441b-9257-eafcfa42d592	lhāḥpā	ल्हा:पा	<p>n. lit. palm; cornice brick installed at temple corners that is in the shape of a palm facing downward with fingers extended slightly upward. <em>Lhāḥpā</em> cornice brick is seen on top of <a href="../meaning/0c7750d1-0e6a-4b9c-a100-44111883b015/" target="_blank" rel="noopener"><em>lhāḥphvaḥ</em></a> cornice brick.</p>
006f41f0-56fb-41a4-9796-ad47b4602c04	yajñakuṇḍa	 यज्ञकुण्ड	<p>[S.] n. a square-shaped hollowed space designated for a fire oblation. It may be understood as a vessel for a fire oblation. A <em>yajñakuṇḍa</em> used for Buddhist fire oblation contains a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> at the center of the hollowed space surrounded by deities of eight direction (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/4EWURQPS/library" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 33); syn. <em>yajñaśālā</em>.</p>
b88411dd-e4ae-41b0-b250-8aceab95a535	mācikaṃ	माचिकं	<p>var. <em>mācikã</em>; grillwork of windows; diagonal lattice pattern of 90 degrees found in latticed windows; compare <a href="../meaning/ec993ada-627e-4094-8e30-28e229164a00/" target="_blank" rel="noopener"><em>icikā</em></a>.</p>
40a25dde-2936-4183-a871-7c3ff5e80dcc	chvāsa	छ्वास	<p>n. a designated space usually marked by a large stone where certain items are ritually discarded at times of a birth or death in the family and also at times of warding off evil elements. In case of a birth in the family, a <em>pibhyagaḥ</em>, a clay pot that contains a piece of umbilical cord attached to the navel of a newborn baby, is ritually discarded at the <em>chvāsa</em>. At times of a death in the family, the clothes, mattress, bedsheet, pillow and other items used by the deceased are discarded at the <em>chvāsa</em> along with a set of three <a href="../meaning/9b874fa8-c7e0-4484-b710-30d89a831ae7/" target="_blank" rel="noopener"><em>kaciaḥpā</em></a>.</p>
99339dd4-e82e-477b-ac56-b8fd930da087	dalāṃ	 दलां	<p>var. <em>dalān</em>, <em>dalāna</em>; open space on ground floor (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 44); ground floor with multiple bays created by pillars that also contain door leaves. Each bay is called a <em>dalāṃkavaḥ</em>. Most <em>dalāṃs</em> have now been converted into shops. The door leaves are an important distinguishing feature of <em>dalāṃs;</em> similar open spaces with multiple bays but without door leaves are called <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a>. Furthermore, the bays of the <em>dalāṃ </em>rise up from the level of the ground; <em>phalcās,</em> on the other hand, always have a raised platform.</p>
c6855dc3-2ae4-452d-9675-a6e4caeab30f	kuṃsuru	कुंसुरु	<p>var. <em>kũsuru</em>; n. mythical animal that looks like a ram with a beak and wings that are placed as corner strut or at beam ends where only its head is seen.</p>
0fa7a7e4-a198-44df-9947-1d8afcbc2c90	capāḥgū	 	<p><strong>[to be revised]</strong></p>\n<p>[New.] a wayside stall or temporary shop (under a tree).</p>
be90c7c1-f445-4fc9-bcef-27e0e0c528f9	mohora	 मोहोर	<p>n. eight-<a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener">ānā</a> silver coin.</p>
214005a1-99b9-4b73-9121-caf1887ce97f	pikhālakhu	पिखालखु	<p>n. 1) a spot usually marked by a stone lotus in front of the main entrance outside the eaves of roof. It is considered to be a guardian deity and has many functions. After the cremation of a deceased family member, the other members on their return from the cremation ground go through a purificatory ritual called <em>baliṃ pīgu</em> at <em>pikhālakhu</em> before they enter the house. This is done with the belief that any evil spirit that may have accompanied them from the cremation ground are cleansed before they enter the house. Also on the seventh-day ritual called <em>nhaynumā</em> performed in memory of the deceased, rice and other food items are discarded at <em>pikhālakhu</em>.</p>\n<p>2) common entrance of a courtyard <!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML/>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="&#45;-"/>\n   <m:smallFrac m:val="off