205111cd-8a2e-4803-bf81-82aaaa5463fa	tulasī maṭha	तुलसी मठ	<p>n. a little raised place where the sacred plant ocimum basilicum (<a href="../meaning/aa77e8c7-4421-401c-8712-968d8bcedbbd/" target="_blank" rel="noopener"><em>tulasī</em></a>) is grown for worship.</p>
ec861ad9-e8b7-4b84-bf48-671fe7364a1f	devagṛha	देवगृह	<p>[S.] var. <em>devagriha;</em> n. lit. house of god; a chamber where a deity is enshrined. Sometimes a niche of a relatively larger <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a> may also be called a <em>devagṛha.</em></p>
9af18534-918e-4811-971c-aa030ee98a8d	ghaṇṭākāra	घण्टाकार	<p>[S.] n. lit. shape of a bell; bell-shaped part of a pinnacle.</p>
c05e4427-d00e-4f58-8d44-0ad1ef48e34b	nhāykaṃjhyāḥ	 न्हाय्‌कंझ्या:	<p>var. <em>nhāykãjhyāḥ</em>; n. lit. window with a mirror; glazed window.</p>
5a7b26dd-a3b9-4590-a286-fd152ce62e86	gvaḥjhyāḥ	ग्व:झ्या:	<p>n. round window (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 29).</p>
2ee693c9-b787-47fb-9892-44a14da8507c	khālaḥpā	खल्अ:पा	<p>n. cornice brick with rounded moulding (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 26).</p>
9dfb84b2-b2d9-4b5b-8137-ab62688866a3	degaḥjhyāḥ	  देग:झ्या:	<p>n. a blind window; syn. <em>dyaḥjhyāḥ</em>, <a href="../meaning/gaḥjhyāḥ/" target="_blank" rel="noopener"><em>gaḥjhyaḥ</em></a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 46); lit. temple window (which suggests that such windows are usually found in temples); miniature window, usually with an image of a deity at its centre, making it a blind window. These windows commonly flank a building's main entrance on the ground floor and the central window on its upper floors. Some <em>degaḥjhyāḥ</em>s are elaborately carved, surmounted by a tympanum-like structure and adorned with decorative floral designs below. It seems that Newar artists began installing <em>degaḥjhyāḥs</em> on plain brick walls for aesthetic purposes.</p>
0720d485-26af-4449-b8e8-648fc78a2b1c	Tavajhyāra	 तवझ्यार	<p>[old New.] var. Tavajhyāla; n. a place named Taḥjhyāḥ in Patan. </p>
a15c454a-de25-414f-af96-572e04b814c4	tulasī cauko	 तुलसी चौको	<p>n. a platform raised round the sacred plant ocimum basilicum (<a href="../meaning/aa77e8c7-4421-401c-8712-968d8bcedbbd/" target="_blank" rel="noopener"><em>tulasī</em></a>).</p>
2743b380-083c-4a24-bb3b-096356841acf	pujā	पुजा	<p>[S.] var. <em>pūjā</em>; n. 1) worship, honour.</p>\n<p>2) formal expression of reverence to a deity or a venerable being by performing certain ritual accompanied by various items in offering.</p>
fa2a41a3-7f76-4780-9a85-18e7d06acd34	kvāḥpāḥju	 क्वा:पा:जु	<p>[New.] n. <em>hon</em>. principal deity of a Buddhist Monastery; see <a href="../meaning/meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>.</p>
b16a74ce-bb6d-4fc6-a23b-dd7c12bdab52	jīsvāṃ	जीस्वां	<p>var. <em>jīsvā̃</em>, <em>jilasvāṃ</em>; n. white or yellow jasmine.</p>
7fa14c5c-dea8-4bd7-bd35-aaa6cb29c9ec	khiṃ	खिं	<p>var. <em>khĩ</em>; barrel-drum that almost invariably accompanies a <a href="../meaning/10958029-7ce0-4c0e-a88a-f758e39f271b/" target="_blank" rel="noopener"><em>dāphā</em></a> troupe. Also called <em>lālākhiṃ</em> in Bhaktapur, this instrument is unique to the Newars and is more smoothly curved in outline than the North Indian <em>pakhāvaj</em> (which the Newars also play, calling it <em>paścimā</em>), and it has a permanent black tuning-spot on each of its two drum-heads (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/widd/titleCreatorYear/items/RVJCFV2G/item-list" target="_blank" rel="noopener">Widdess 2016</a>: 3).</p>
