le 2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a small shrine or temple usually of a single floor that houses the <a href="../meaning/meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a> of the monastery. There are very few of such monasteries that does not have a proper <a href="../meaning/5ac0990c-6080-43b3-928e-d42ce4b7e67c/" target="_blank" rel="noopener"><em>kvāḥpāḥchẽ</em></a> and the <em>kvāḥpāḥdyaḥ</em> is enshrined in a <em>kvāḥpāḥdegaḥ</em>.</p>
4d40dca1-99e8-4c42-8302-655a9d896ea0	sanāḥ	सना:	<p>var. <em>sanāṃ</em>, <em>sanā</em>, <em>sanhāḥ</em>; n. 1) bathing, ablution.</p>\n<p>2) act of going to cremation ground by a river.</p>
857baa5b-09dd-413c-9b3c-256e0f27934c	Āśvina	 आश्विन	<p>[S.] var. <em>Asauja</em>, <em>Asoja </em>(Nep.); n. the sixth month of the solar calendar adopted by the Vikrama era that corresponds to September-October; of a month in the rainy season (during which the moon is near to the constellation <em>Aśvinī</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 159).</p>
a2c86d1a-a308-4dc7-9dad-5f00ec3991e0	guthi	  गुथि	<p>[fr. S. <em>goṣṭhī</em>] var. <em>guṭha</em>, <em>gūṭha</em>, <em>guṭhī</em> (Nep.); n. a community-based organization formed with a specific purpose and guided by religious and traditional norms and values. The income of land endowed by one or more donors is the financial base of a <em>guthi</em> for financing religious and charitable functions. A <em>guthi</em> was formed mostly for carrying out annual rituals of a deity or religious monument and for its upkeep. There are other <em>guthi</em>s that deal with social activities like funeral or construction of a <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a>. With the concept of collective efforts for the greater good of the community, people used to form a <em>guthi</em> and strengthen it by endowing land enough to carry out rituals and other activities throughout the year. For instance, a <em>sīguthi</em>, also called <a href="../meaning/e42b0c1a-12e1-41ef-a1e7-a2a4dd4e0978/" target="_blank" rel="noopener"><em>sanāḥguthi</em></a>, specifically deals with carrying out funeral procession of a deceased member, but also hosts an annual feast for its members. Likewise a <em>guthi</em> formed after the construction of a <em>phalcā</em> or shrine is responsible for observing its anniversary and carrying out renovations if needed.</p>
f43c2b5b-0711-40d1-a702-4aab09ae8920	amāla	 अमाल	<p>[fr. A.] n. a village level revenue collection office with semi-judicial functions (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/adhikar/titleCreatorYear/items/6U2ZVC34/item-list" target="_blank" rel="noopener">Adhikari 1984</a>: 344). In the Mulukī Ain, the <em>adālatas</em>, <em>ṭhānās </em>and <em>amālas </em>were the central institutions for judicial administration (see, for example, MA-KM 1854 1.5, 19 and 21).</p>
6a7baaad-3c07-4090-9076-d6e00723d2e8	subbā	 सुब्बा	<p>var. <em>subā</em>; n. governor or chief administrative officer of a province or district (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/documents%20from%20the%20/titleCreatorYear/items/NV263K55/item-list" target="_blank" rel="noopener">M.R. Pant 2002</a>: 135). According to Edwards, <em>subbā</em>s were stationed at Gorkha and Chitwan, “with five others being administrators in the Terai” (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/7U2DNN7W/library" target="_blank" rel="noopener">Edwards 1975</a>: 106). Edwards further mentions that “men of <em>subba</em> rank were also assigned in the capital to the Kumari Chowk, and Kat Bhandar offices, where they were the deputies of the <em>kājī</em> and <em>kapardāra</em> in charge” (ibid.).</p>
fca248be-dff7-443c-81ab-798e897ad31e	kilāyaḥpā	किलाय्‌अ:पा	<p>var. <em>kilāyappā</em>; n. <em>masonry</em>. header (brick); a brick laid in a wall in a way that its shorter ends are exposed or parallel to the surface.</p>
3a781c3a-21d6-4032-915d-30812a8afa77	gathāṃ	  गथां	<p>var. <em>gathā̃</em>; n. top post (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 27); upright post supporting the roof.</p>
