2612a670-dde8-450d-86d0-8ffaf853288d	kulu	कुलु	<p>n. caste name among the Newars that refers to a tanner or drum maker; considered to be untouchable caste fellows in the social gradification of the past who have the profession of leatherworking. The Mulukī Ain classifies the caste of Kulus as the 8th lowest (superior to Cyāmes, Poḍhes, Vādīs, Gāinyās, Damāī̃s, Kadārās, Kāmī and Sārkī) among the Untouchable castes (MA-54.160.8).</p>
8f18d20b-c6b4-4989-b527-f88092c3d6b2	gaḥguṃbā	 ग:गुंबा	<p>var. <em>gaḥgumbā</em>; n. Buddhist monastery with several rooms (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 28).</p>
d9463838-8dae-470c-9005-4f601bc3a929	digudyaḥ	 दिगुद्य:	<p>[fr. New. <em>deguḍi</em>, <em>degura</em>, <em>deguri</em>, <em>degula</em>, <em>deguli</em>, <em>deghuri</em>] var. <em>degudyaḥ</em>; n. patron deity of a family or clan (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 231); lineage deity.</p>
6e604b44-c7c9-47f1-b962-55655c1daf19	kurha	  कुह्र	<p>[fr S. <em>kuḍava</em>] var. <em>kuḍa</em>, <em>kurha</em>, <em>kurhu</em>; n. 1) a measure of grain or of wood or of iron (4th part of a <a href="../meaning/ef6257a3-11b0-4655-b8bb-bbaa5facda68/" target="_blank" rel="noopener"><em>prastha</em></a>, described by some as a vessel four fingers wide and as many deep and containing 12 <em>prakṛiti</em>s or handfuls; also said to contain 13 ½ cubit <a href="../meaning/24473fd2-76f9-4350-b520-038c26016340/" target="_blank" rel="noopener"><em>aṅgula</em></a>s, or to contain 64 cubic <em>aṅgula</em>s, or to be a finger and a half deep and three fingers each in length and breadth (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 289).</p>\n<p>2) a measure word for two <a href="../meaning/53d25379-a4ed-4b85-9372-a67517986fec/" target="_blank" rel="noopener"><em>mānā</em></a>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 54). Another term, <em>kuḍā</em>, is very similar to this one, but appears to be a term for measuring land (Malla 2000: 52).</p>
8fbf5fac-a712-48b8-b0f3-72939f7d0e40	Candra	   चन्द्र	<p>n. the moon; also personified as a deity who rides on a swan. This deity is white in colour and holds discs of the moon on lotuses in both of his hands (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 367). The moon deity is usually depicted on the top outer frame of an entrance. Such images tend to show the deity riding a chariot driven by seven swans (to the viewer's left) along with <a href="../meaning/9e170f5e-4fec-4e0e-bb46-37b5c5c91bbc/" target="_blank" rel="noopener">Sūrya</a>, the sun deity, who rides a chariot driven by seven horses (to the viewer's right).</p>
2a6f5c00-7417-4918-bb74-47cec76cfc1f	kīrtimukhatoraṇa	कीर्तिमुखतोरण	<p>[S.] n. tympanum above doors or windows surmounted by an image of Kīrtimukha, a mythical creature whose name literally translates to the 'Face of Glory'.</p>
f0fad391-4955-4d16-84ad-03ba7637163c	ghaḥmā	 घ:मा	<p>[New.] n. var. <em>dhaḥmā</em>; see <a href="../meaning/1d656404-eb8f-431d-b479-403da44aa88b/" target="_blank" rel="noopener"><em>dhaḥmā</em></a>.</p>
46c79146-52e9-4af7-9051-70098a22f74b	katāṃcā	कतांचा	<p>n. spacer for the plumb bob (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 21).</p>
e8526b91-6f58-4a87-a4db-b57764506f6f	kaygūcā	कय्‌गूचा	<p>n. pea pattern (carving or interlacing cane) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 21).</p>
9ced0df1-b370-4fe6-aa1a-55f79047a1ba	ugaḥ	उग:	<p>n. wooden mortar mostly used to prepare <a href="../meaning/1eda2543-9f4f-4623-bd75-3b6120184b7d/" target="_blank" rel="noopener"><em>baji</em></a> (beaten rice), a popular Newar food item, by boiling paddy and then flattening it by pounding in an <em>ugaḥ</em> with a wooden pestle.</p>
5f91a2c8-2a77-4e06-865c-7a3969445686	icikājhyāḥ	 इचिकाझ्या:	<p>var. <em>īcikājhyāḥ</em>, <em>itikājhyāḥ</em>, <em>ecikaṃjhyāḥ</em>; n. latticed window with 45-degree diagonal grillwork (see also <a href="../meaning/ec993ada-627e-4094-8e30-28e229164a00/" target="_blank" rel="noopener"><em>icikā</em></a>); latticed window with its battens fixed onto one another to overlap diagonally.</p>
e341add3-b20a-4240-aaf9-fae8a79f26b7	kvācapālaju	क्वाचपालजु	<p>[fr. S. <em>koṣṭhapāla</em>] n. <em>hon</em>. principal deity of a Buddhist Monastery (see <a href="../meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>).</p>
7ca30a72-1917-4486-9c02-9374b51ae03a	toraṇathāṃ	  तोरणथां	<p>var. <em>tvalaṃthāṃ, tolaṃthāṃ</em> (New); n. pillar that bears the load of a <a href="../meaning/e7f31a6a-0841-4129-98cb-507abbb18749/" target="_blank" rel="noopener"><em>toraṇa</em></a>.</p>
17730bd2-909e-4538-8e65-dfe100f2eb09	khaḥjalā	ख:जला	<p>n. railing of a chariot.</p>
80bda275-3951-43a4-8333-83ca2351ff18	khaṭvāṅga	  खट्वाङ्ग	<p>[S.] n. magic wand; the stick is generally surmounted either by <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> or <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a>, or the <em>triśūla</em> or the banner, or all of them. In any case, for a <em>khaṭvāṅga</em> the skulls are necessary and it will be so called even if nothing else is present. a club or staff with a skull at the top (considered as the weapon of <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> and carried by ascetics and <em>yogins</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 335).</p>
352cff84-8911-40b2-93e5-eb9a3fd09d33	pāyaḥ	पाय:	<p>n. 1) person who carries a sword in a trance during a sword procession called <a href="../meaning/ad1ff239-40f0-4b09-96ac-76d0600f2361/" target="_blank" rel="noopener"><em>pāyāḥ</em></a>.</p>\n<p>2) silver anklet for young girls (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 358).</p>\n<p>3) anklet flower in block pattern (carving) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 54).</p>
2a5cc242-50d5-49bb-8560-439a8e01b400	yalay	यलय्	<p>n. inhabitant of <a href="../meaning/b6e19a48-10f8-4bad-9f7c-915acdb4d0ea/" target="_blank" rel="noopener">Yala</a> (Patan).</p>
8171f555-8030-4778-bbda-2dbd294cd3d3	aṃbaḥsāḥ	  अंब:सा:	<p>var. <em>aṃbaḥsā</em>, <em>ambaḥsā</em>, <em>ambāsi</em>; n. 1) A myrobalan pattern (usally carved).</p>\n<p>2) base of a strut; syn. <em>tunāḥtvākaḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
063dae1f-37d1-43b9-bf33-5ff3bd435678	Māgha	 माघ	<p>[S.] var. <em>Māga</em>, <em>Māgh </em>(Nep.); n. the 10th month of the calendar adopted by the Vikrama era, which has its full moon in the constellation <em>Māgha</em>. The month corresponds to January-February.</p>
6d8f32b9-02a4-4e1d-b02c-140f337b00bd	kvanā	क्वना	<p>n. wooden tub for washing or feeding (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 24).</p>
2cb0b088-238b-429f-a229-beee1cc1333f	ãlāy	 अँलाय्	<p>var. <em>ãlā</em>; wall plate; syn. <em>asa</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
76e5cd90-e6d0-4ed1-885d-03a612613d3c	dātiaḥpā	 दातिअ:पा	<p>var. <em>dāciaḥpā</em>, <em>dāciappā</em>, <em>dātiappā</em>; n. conical brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 45).</p>
a3e6de09-0e5d-4e41-bcb9-20e9db650e82	desajātrā	 देसजात्रा	<p>n. the most important annual festival of a town or village.</p>
4700cf14-ada0-4586-8db0-f8fdc629aa8e	siṃmvaḥ	 सिंम्व:	<p>n. lion-faced base for a window frame (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 75).</p>
cc033944-86dc-4bf8-b54d-dec0d03d6a19	kapaḥ	 कप:	<p>1) rebate (for panels). 2) wall between pillars (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 21).</p>
be0af582-9e5d-4f51-94a4-a39132d61f7a	laṃcā	लंचा	<p>n. scumble of red clay (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 69).</p>
404cd9e7-f639-40a1-a121-b2d9266acb00	caylā	  चय्‌ला	<p>var. <em>cailā</em>; n. a base (such as plank, reed or bamboo) for roof tiles (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31).</p>
f78094f3-4b9c-48dc-85b2-0be9f4ae9014	patāḥchā	पता:छा	<p>n. lit. offering of a <a href="../meaning/72913b3c-d88a-4723-a381-99091a822d4d/" target="_blank" rel="noopener"><em>patāḥ</em></a>, it is a ceremony of installing a <em>patāḥ</em> on a temple.</p>
