4b7a7e41-0a33-45c2-9fbd-cdf284333ef4	dillāvanegupujā		<p><strong>[to be revised] </strong></p>\n<p>n. veneration of the goddess Ajimā on the eleventh day after a birth.</p>
4ed97b2c-c535-4bc0-b7eb-038aa1c41d03	āgaṃdyaḥ	आगंद्यः	<p>var. <em>āgãdyaḥ</em>; n. literally the deity of <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a>, it is the patron deity of the clan the <em>āgaṃ</em> belongs to.</p>
