 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a small item of offering during worships that is made in a conical shape out of moistened <em>cvakābaji</em> (broken pieces of <a href="../meaning/1eda2543-9f4f-4623-bd75-3b6120184b7d/" target="_blank" rel="noopener"><em>baji</em></a>) to take the shape of a <a href="../meaning/aa9bcc95-15c5-4ee3-b7ce-70bf358e7b31/" target="_blank" rel="noopener"><em>gajū</em></a> or <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. The tip of about 3 centimeters tall <em>gvaḥjā</em> is colored by dipping it into vermillion powder. There are larger <em>gvaḥjā</em>s that are used in special worships. They are also made in conical shape that are usually about 2 feet tall, but cooked rice is used instead of <em>cvakābaji</em>.</p>
07674e9f-12d8-4cd1-9ec1-723a500d6dc9	kapi	कपि	<p>n. 1) inner corner of a wall; syn. <em>kuṃ</em>. 2) narrow place.</p>
967ad9f3-4a78-4949-b0fd-49d7c0f3dd9c	kisi	किसि	<p>n. <em>mod. constr</em>. foundation pile.</p>
6d193101-79c7-4b95-aad2-e1d70cf3c5f6	pikhālakhudyaḥ	पिखालखुद्य:	<p>n. Lord <a href="../meaning/74fbb417-0ad0-4929-8e9c-ace08c20348d/" target="_blank" rel="noopener">Kumāra</a>, who is represented by a small stone usually in the form of a lotus placed in front of the main entrance. <em>Pikhālakhudyaḥ</em> is also considered as a <em>kṣetrapāla</em>, a guardian deity.</p>
8aa1efc2-fc51-4428-b26c-517e289c67c8	takhtājhyāḥ	 तख्ताझ्या:	<p>var. <em>takhtājhyāla</em>; see <a href="../meaning/a36e1185-697a-49e3-a4fd-459af12a98d4/" target="_blank" rel="noopener"><em>taujhyāḥ</em></a>.</p>
187b7146-05e5-4404-8e4e-26da15db29da	calū	  चलू	<p>var. <em>calu, cvalū</em>; <em>archit</em>. n. 1) the horizontal bar on which the roof beam rests (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 57).</p>\n<p>2) a top plate on struts supporting the eaves; strut rail; syn. <em>jācalu</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31/159).</p>
0a468911-739f-4ed0-bd04-dee870ab1d37	ghaḥsū	घ:सू	<p>n. purification ritual performed on either the 7th, 11th or 12th day of the death of a family member or kinsman.</p>
9d0f394d-0541-416a-ae51-536f75f59e98	mvaḥaḥpā	म्व:अ:पा	<p>var. <em>mvaḥappā, mvoappā</em>; n. brick with slanting and throating edge (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 176). It is one of the many designs of bricks used as part of an elaborate cornice plan.</p>
b6606be2-97ff-43c0-8b17-dcf868cfda86	Śiva	  शिव	<p>n. Lord Śiva, the destroyer within the Hindu trinity. He is also known as Mahādeva, the great deity. In vedas, the word Śiva, the auspicious, occurs as an epithet of Rudra, who is praised in all hymns as a malevolent deity causing death and disease among men and cattle and is therefore specially prayed to by the hymnists for allaying his wrath towards them (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/5HTW3RD2/library" target="_blank" rel="noopener">Rao 1997</a>: 39). When Śiva was besought by the gods to destroy certain demons, he sought and obtained one half of their strength from all the gods; he was thenceforth known among the gods as Mahādeva or Maheśvara, because he became the greatest among them. Since he consumes flesh, blood and marrow (as Agni-the fire deity), is fiery and glorious, he is called Rudra. Since he makes men prosper in all their actions, he bears the appellation Śiva, the auspicious (Rao 1997: 47-48). He wears a garland of a serpent and holds a <em>triśūla</em> (trident). He is usually represented by a <em>liṅga</em> (phallus) in temples.</p>\r\n<!-- [if gte mso 9]><xml>\r\n <o:DocumentProperties>\r\n  <o:Version>16.00</o:Version>\r\n </o:DocumentProperties>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:Bre