8c6cd4c3-8b4f-4715-887a-bc4af3b5c1f7	gurumandaḥ	गुरुमन्द:	<p>[frm. S <em>gurumaṇḍala</em>] var. <em>gulumandaḥ</em>; n. lit. the <em>maṇḍala</em> of the guru, it is the <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>mandaḥ</em></a> (<em>maṇḍala</em>) that is worshipped first before proceeding to any ritual. The worship of this mandaḥ is called <em>gurumandaḥ danegu</em>, which begins with the cleansing of <em>kāya</em> (body), <em>vāka</em> (speech) and <em>citta</em> (mind). Vajrasattva is the central deity of this <em>mandaḥ</em>, who represents <em>kāya</em>, <em>vāka</em> and <em>citta</em> collectively (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/guruma/titleCreatorYear/items/R88QI8T6/item-list" target="_blank" rel="noopener">Vajrācārya 1120 NS</a>: 54).</p>
b8d1f62e-6b39-412d-a8d4-422c3d42448d	śaṅkha	 शङ्ख	<p>[S.] var. <em>saṃkha</em>; n. 1) conch shell; a particular kind of large shell used for blowing, conch-shell (as a wind instrument, attribute of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a>). 2) one of the eight emblems of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a>.</p>
47d65bb3-4505-460d-8ebe-8c3a5c48deea	dāciaḥpā	दाचिअ:पा	<p>var. <em>dacīappā</em>; see <a href="../meaning/76e5cd90-e6d0-4ed1-885d-03a612613d3c/" target="_blank" rel="noopener"><em>dātiaḥpā</em></a>.</p>
e8e81092-cc6a-4b7a-ab5c-7cc03b168e62	digupujā	 दिगुपुजा	<p>[fr. old New. <em>deghuri pujā</em>] var. <em>degupujā</em>, <em>depujā</em>; n. worship of the patron/lineage deity. The families of the <a href="../meaning/d9463838-8dae-470c-9005-4f601bc3a929/" target="_blank" rel="noopener"><em>digudyaḥ</em></a> usually go to the <a href="../meaning/324e3d5b-1eea-444e-94a8-a5df47deb6bf/" target="_blank" rel="noopener"><em>digukhyaḥ</em></a> together to collectively worship their <em>digudyaḥ</em>. The first <em>digupujā</em> after a new bride has married into the family sees her join the worship in a bride's attire; with this, she is formally inducted into the family clan.</p>
ab743a7b-0dc9-4501-87c0-957fadda2829	nāsaḥpvāḥ	नास:प्वा:	<p>n. narrow oblong opening in walls for admitting passage of the <a href="../meaning/da2907e8-d43b-40d3-9a4b-10b5ff674ec9/" target="_blank" rel="noopener">Nāsaḥdyaḥ</a>.</p>
0bf22b48-4d4e-47ef-9813-3663673083fe	jajaṃkā	  जजंका	<p>var. <em>jajaṅkā</em>, <em>jajãkā</em>, <em>jajamakā</em>/<em>jajomakā</em> (Old New.); n. small garland of three rounds of sacred white thread that is about the size of a wrist. A small piece of red cloth attached to it is called <em>jajaṃkānāyaḥ</em>. <em>Jajaṃkā</em> is offered to deities, <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>mandaḥ</em></a>s and rituals vessels. It is a bundle of thread that symbolizes dress of an enlightened being that is used as an object of offering to the Buddhist monks during alms-giving ceremonies (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/neva%20bau/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 13). A large garland of multiple rounds of sacred thread to be worn around the neck during Mhapujā (the ritual worship of the self) and <em>Kijāpujā</em> (the ritual worship of brothers by sisters) is called <em>mhajajaṃkā</em>.</p>
75d8a03f-e7ab-460c-af4c-d3187e2f6578	libiṃ	 लिबिं	<p>[New.] var. <em>libĩ</em>; n. 1) lace. 2) canopy; syn. <a href="../meaning/63bc0bd4-4abe-4df0-8d6c-1d014eef0e4b/" target="_blank" rel="noopener"><em>ilāṃ</em></a>. 3) frilled belt. 4) frilled belt pattern (carving or metal work); syn. <a href="../meaning/6378658e-a621-4a9e-884c-710d811f229c/" target="_blank" rel="noopener"><em>jhallara</em></a>, <em>halphā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 70).</p>
08c5357e-978e-4953-8209-8ce528df6991	kaci	कचि	<p>adj. uncooked, unripe, unbaked.</p>
99af3de6-317f-4c9a-94f8-744acfd2ab8b	keheṃmayju	केहेंमय्‌जु	<p>n. <em>hon</em>. 1) younger sister. 2) female cousin.</p>
ad721c0a-8783-4944-b617-01babfa1a655	matakalãli	 मतकलँलि	<p>n. see <a href="../meaning/28b017ef-7966-4bbb-b886-610e657c5307/" target="_blank" rel="noopener"><em>ālamata </em></a>and <a href="../meaning/ad51bfcb-7b6c-4baa-975b-3ded274774cf/" target="_blank" rel="noopener"><em>matakalaḥ</em></a>.</p>
78a696d1-e59a-4d51-834a-48a894c81bfc	mva	म्व	<p>var. <em>ma</em>, <em>mvã</em>; n. rice husk.</p>
5bb83296-2285-4b18-822c-3b4ef6236051	pikhalu	पिखलु	<p>n. outer entrance of a palace.</p>
8951dcd3-9a89-4c10-b2b4-c33e7671e2ea	pikhālukhā	पिखालुखा	<p>n. entrance of a courtyard.</p>
428a0772-c085-4d9f-885d-930043e57a3e	syāḥbaji	 स्या:बजि	<p>n. puffed rice; derived from <em>siyābaji</em>, which literally means dry-heated beaten rice, <em>syāḥbaji</em> is actually dry-heated rice that is taken as a form of <a href="../meaning/1eda2543-9f4f-4623-bd75-3b6120184b7d/" target="_blank" rel="noopener"><em>baji</em></a> (beaten rice). <em>Syāḥbaji</em> is an important item of <a href="../meaning/67a48449-1b93-451f-ae64-021366c96009/" target="_blank" rel="noopener"><em>samay</em></a> that is prepared for esoteric worships. <em>Syāḥbaji</em> is also used in <a href="../meaning/be0b5c8d-469a-4610-9fc8-57c861bb0fd0/" target="_blank" rel="noopener"><em>samaybaji</em></a>.</p>
63ffbaea-0b88-418e-b48a-e65a359f567f	dāphā2	दाफा	<p>n. a kind of <a href="../meaning/7fa14c5c-dea8-4bd7-bd35-aaa6cb29c9ec/" target="_blank" rel="noopener"><em>khiṃ</em></a> (traditional Newar drum); musical instruments used while singing devotional songs (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 290).</p>
bd668f17-df1b-4b24-ae76-e382a50089a2	palehaḥcā	पलेह:चा	<p>n. 1) small lotus leaf. 2) pattern of lotus leaves.</p>
8814bac2-3171-41fd-802f-d23893d935dd	gvãgaḥkva	 ग्वंग:क्व	<p>n. wall bracket (part of the outer window or door frame with figural designs) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 29).</p>
