erif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. <em>bhuchyāḥ</em> (Bhaktapur dialect); n. a pair of large cymbals made of brass that is played together with <a href="../meaning/8c15626e-b7aa-4c56-98e3-d444c4897d01/" target="_blank" rel="noopener"><em>dhāḥ</em></a> and <a href="../meaning/a733add3-2ad2-452b-87cd-65eb77921e0b/" target="_blank" rel="noopener"><em>dhimay</em></a> drums; see <a href="../meaning/dcc1480f-6cd8-4f96-a282-11959a2778de/" target="_blank" rel="noopener"><em>chusyāḥ</em></a> and <a href="../meaning/0a80b8eb-35d5-4c6d-b06f-8a616bcb2712/" target="_blank" rel="noopener"><em>sichyāḥ</em></a>.</p>
b513034f-c326-49ac-8fab-13736cc47b20	kã	कँ	<p>n. 1) rainbow. 2) rainbow pattern (wood carving); syn. <em>laḥsāḥ</em>, <em>kapaṃ</em>.</p>
292ba010-424b-4176-9947-b62932dd57b2	dhusaḥ3	धुस:	<p>n. upper part of the back.</p>
a8484a25-a9f7-4c77-afcb-a92f6df96ba1	digubhaḥ		<p><strong>[to be revised]</strong></p>\n<p>n. vessel for keeping offering materials used by priests.</p>
8de6733f-4b7e-4701-a50c-e81ea48d2536	jeri	जेरि	<p>n. sweet made of thick paste of dough in the shape of the blossom of a flower that is deep-fried in ghee and dipped into caramelized sugar. It is usually eaten with <em>svāḥri</em>, a thin flat piece of dough deep-fried in ghee.</p>
6997ac4f-4c71-463d-819e-7dd54ade1c83	kacimāaḥpā	कचिमाअ:पा	<p>n. unbaked brick that is larger in size compared to modern bricks.</p>
430e69e0-20a0-45e0-8578-e62cabd00e09	khasigaḥ		<p><strong>[to be revised]</strong></p>\n<p>n. upright post of a window or door frame.</p>
06af70ff-a34b-4e09-90bc-5892761ce507	kikiṃpā	किकिंपा	<p>[New.] var. <em>kikĩpā</em>, <em>kikīpā</em>; silver banner, silver or gold leaf that decorates the crown of a deity; a leaf-like ornament made of gold or silver sheets adorned on the head of a deity and is sometimes also used as a representative of the deity during certain worships. Usually a <em>kikiṃpā</em> is plain in design, but sometimes may also be decked with a precious gem at its upper central part.</p>
3ffb5c29-bc0a-419a-8ff5-2ea5dfa48584	kvaṃlijhyāḥ	क्वंलिझ्या:	<p>n. dormer window; syn. <em>kvapujhyāḥ</em>, <em>burjājhyāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 25)</p>
eae61da1-58bc-4919-b1e0-3dc477b5b41a	yaḥsĩ	    य:सिँ	<p>[New.] var. <em>lyaḥsĩ</em>; n. 1) ceremonial pole. 2) flagstaff erected during various festivals such as <a href="../meaning/d2de8b1e-2496-4958-ba19-059d065d52a2/" target="_blank" rel="noopener"><em>Yẽnyāḥ</em></a> and <em>Biskāḥ Jātrā</em>, the two major festivals of the Kathmandu valley that require the erection of a <em>yaḥsĩ</em>. Two <em>yaḥsĩ</em>s are erected in Bhaktapur on the last day of <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a> and is then hauled down the next day, the first day of <a href="../meaning/2a49e7df-d2fe-481b-9d7a-61583faddfa8/" target="_blank" rel="noopener">Vaiśākha</a> or the New Year's day of the Vikrama era. The first <em>yaḥsĩ</em> is erected at Kumhāḥtvāḥ (Potter's Square). This <em>yaḥsĩ</em> is locally known as <em>lhāḥ madugu yaḥsĩ</em> (the flagstaff without arms), as it does not contain a horizontal bar at the top. The main <em>yaḥsĩ,</em> also known as <em>lhāḥ dugu yaḥsĩ</em> (the flagstaff with arms), is erected late in the afternoon at Bhelukhyaḥ. This one also contains a long banner called <a href="../meaning/7b5babd4-6b8a-48bf-81be-32b6bd80ea48/" target="_blank" rel="noopener"><em>haliṃpatāḥ</em></a> ([S.] <em>viśvadhvaja</em>; the banner of the world). In Kathmandu, a <em>yaḥsĩ </em>is erected at Hanumāna Ḍhokā during the <em>Yẽnyāḥ</em> festival every year. On the 12th day of the bright fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhadra</a>, the Sāymis (caste of oil-pressers now known as Mānandhara) of Kathmandu gather and erect the <em>yaḥsĩ </em>and hoist the banner called <em>Indradhvaja</em> (the banner of Indra) along with it. A week later, the <em>yaḥsĩ</em> is hauled down by the Sāymis on the 4th day of the dark fortnight of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvīna</a>.</p>
b05f2976-cb3a-4aa5-bc04-d14fe44cc9d3	pālāḥaḥpā	पाला:अ:पा	<p>var. <em>pālāḥappā</em>; n. uncut brick.</p>
5cc6b6ee-f60d-404e-a5d7-884fa2772542	sīsvāṃ	सीस्वां	<p>var. <em>sīsvā̃</em>; wax-flower; artificial flower usually shaped like an umbrella offered to the Buddha images.</p>
e0f90425-f161-444a-9171-7f14578320f1	trayodaśī	त्रयोदशी	<p>[S.] n. the thirteenth day of a fortnight of the lunar calendar.</p>
e66ec301-0f7f-43a6-a663-5cdbc23aa742	thāpiṃ	 थापिं	<p>[fr. old New. <em>thāpina</em>, <em>thāpinapo</em>, <em>thāpini</em>] n. a kind of container for ritual liquor (<a href="..https:/www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 201). A ritual container without a spout made of brass or clay used to keep <em>thvã</em> (fermented beer) during esoteric Buddhist worships. <em>Thāpiṃ</em> is also used at times of giving <em>sagaṃ</em> (blessings) to someone on auspicious occasions like birthdays, marriages, etc. Another container very similar to <em>thāpiṃ</em> but with a spout is called <em>dhālā</em>, which is also used to keep <em>thvã</em>, but for the purpose of serving it during feasts and not in a ritual.</p>
394c30f1-40f5-40c6-a662-111013955370	yajña	 यज्ञ	<p>[S.] act of worship or devotion by performing a fire oblation or sacrifice.</p>
82aa0338-d861-4c02-a830-0200e6fbbec4	tauchẽ	 तउछेँ/तौछेँ	<p>n. terraced house (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 38).</p>
5727da11-893f-4741-bf77-d85a1b3fc2db	dekhā bīgu	  देखा बीगु	<p>var. <em>dekhā biyegu</em>; v. to give the initiatory mantra. A wide range of <em>dekhā</em>s for various deitites can be conducted; those who undergo these initations are then authorised to perform the worship of the respective deity on his/her own. There are other higher forms of <em>dekhā</em> in the Vajrayāna tradition that requires both husband and wife to be initiated together. Such <em>dekhā</em>s mostly involve <em>prajñā</em> (knowledge) and <em>upāya</em> (compassion), which are represented by a female and male consort respectively.</p>
7bd32d3c-971a-404f-a085-762640bd5ba2	chẽ	 छेँ	<p>[New.] n. a house.</p>
2d29b70a-933e-4483-a62a-5bb9f2e0005d	karaṇa mudrā	 करण मुद्रा	<p>[S.] n. a hand gesture with the palm outstretched with the index and the little fingers erect, while the thumb presses the two remaining fingers against the palm of the hand (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 435).</p>
9df10b72-35b6-47c7-8299-465b0b2e3e77	Ināy	  इनाय्	<p>var. Inā, Ināydyaḥ; n. Lord Gaṇeśa; derivative of Vināyaka; see <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a>.</p>
703fac59-ccd2-4952-b668-193a1628e637	agū	 अगू	<p>n. a charcoal stove. Such stoves were frequently used in the kitchen before modern stoves displaced them.</p>
e37de63b-c9fd-4900-9ab7-d7676b819f81	asu	  असु	<p>n. a brick (laid without clay or concrete). (syn. <em>kacisu</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
d1dfe6d6-c74d-405d-af6d-87de5cd6febd	gumbajajhyāḥ	गुम्बजझ्या:	<p>n. arched window.</p>
3b001176-4553-43a9-bc03-a70fb4a36bd8	vihāra	   विहार	<p>[S.] n. Buddhist monastery; see <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener">bāhāḥ</a> and <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>.</p>
