\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a supplementary religious function (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 172); a special religious function organised exactly a year after an important religious event such as <a href="../meaning/ffa16ff7-2ccb-48c9-be57-1f79959edc93/" target="_blank" rel="noopener"><em>samyak mahādāna</em></a>. Some of these annual functions may also be called <em>daḥru</em>.</p>
a99ebe58-532b-4834-9648-4100a3a25e98	Cābuṅgabhaṭṭāraka	 चाबुङ्गभट्टारक	<p>n. see <a href="../meaning/b1fb118e-2e42-4926-8447-d99cbb02691d/" target="_blank" rel="noopener">Cakvāḥdyaḥ</a>.</p>
7c514d36-bae0-4aeb-a0b5-2ac2e9a3d049	Yaṃlā	 यंला	<p>var. Ñalā; n. the eleventh month of the Newar lunar calendar (twelfth in a leap year) occurring during the months of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a> and <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvina</a> (August-September).</p>
7b06b52d-c9da-4d7d-8894-44b61142fa98	dhalĩpūjā	 	<p><strong>[to be revised]</strong></p>\n<p>n. a ritual to appease the eight mother Goddesses (<a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a>).</p>
340986bc-10bd-47b2-b415-dd69ad4e1829	gā1	गा	<p>n. 1) cover, 2) shawl.</p>
f4f625aa-4cf5-439b-8af3-72c661ba6bbb	keheṃbhata	केहेंभत	<p>var. <em>keheṃbhvata</em>; n. husband’s younger sister.</p>
56586a67-745d-42c7-8eb0-50a742c7aa94	kisidhvākā	किसिध्वाका	<p>var. <em>kisidhvākhā</em>; n. additional small door of a large gate.</p>
7d265a2d-2f79-4211-b34d-d0fc4503f290	lakṣāhuti yajña	लक्षाहुति यज्ञ	<p>[S.] n. fire ritual of one hundred thousand oblations.</p>
061ae285-a999-4f58-8b09-59c6ba792bfb	ratha	 रथ	<p>[S.] var. <em>rath</em>; n. chariot; see <a href="../meaning/5340ae49-fb92-4022-9053-3283a7ac3e80/" target="_blank" rel="noopener"><em>khaḥ</em></a>.</p>
39e76340-b74e-433b-940d-b5a6323fe50f	āratī	आरती	<p>[fr. S. <em>ārātrika</em>] a ceremony performed by moving a platter containing lamps in circles round the image of a god.</p>
a16f29c8-6f53-4f71-ad8c-8929ec42b499	īlvahaṃ	ईल्वहं	<p>var. <em>īlhvaṃ</em>; n. stone base of a pillar; a large stone with a hole or socket in the middle that serves as a base for a pillar.</p>
a745eb96-7671-43b5-9fa8-c2ac14a562a3	cibhāchẽ		<p><strong>[to be revised]</strong></p>\n<p>[New.] var. <em>cibhācheṃ</em>; house of refuge, monastery.</p>
1619e50b-93a3-4c07-a530-a641db6de04f	Śītalā Māju	शीतला माजु	<p>See <a href="../meaning/1b7dd1d9-4e97-4e81-b692-3c33fce9f139/" target="_blank" rel="noopener"><em>ajidyaḥ</em></a>.</p>
1912063a-4393-47ac-b05c-1d51a636172c	abhaya mudrā	     अभय मुद्रा	<p>[S.] n. the gesture of protection and assurance that is also identified as the gesture of providing refuge. In this gesture, the hand is slightly elevated and bent with the palm turned outward, the fingers being outstretched and elevated (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Bhattacharyya%20/titleCreatorYear/items/F3DUFDJB/item-list" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 432). In the Buddhist world, the gesture is widely associated with <a href="../meaning/0ce1986d-ee1d-4818-afcf-6fcf31bc0b1d/" target="_blank" rel="noopener">Amoghasiddhi</a> of <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a> that represents his protection from all fears of the cycle of birth.</p>
