i",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. image of Lord <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> riding on the back of his <a href="../meaning/1335c012-fc27-47d1-84bd-a99e358c755d/" target="_blank" rel="noopener"><em>vāhana</em></a> <a href="../meaning/774586ee-7cf6-4533-969c-474181dbb222/" target="_blank" rel="noopener">Garuḍa</a>.</p>
23ac7443-3d62-4696-b267-335c2df55054	gvārā	 ग्वारा	<p>var. <em>gvarā</em>; n. the original meaning is unclear, but it is the main hymn of praise dedicated to a particular deity that is performed before singing a <em>cāliṃ</em>. The lyric of a <em>gvārā</em> song is usually very short but the same lyric is repeated a number of times in different <em>tāla</em>s (rhythms). The <em>tāla</em>s used in a <em>gvārā</em> are of unique character, as they do not conform to any of other <em>tāla</em>s popularly used in <a href="../meaning/meaning/94126120-b001-4f04-975c-5c08a3dd2656/" target="_blank" rel="noopener"><em>bhajana</em></a>s. Therefore, it is a heterometric song that is performed continuously in many rhythmic variations with the same lyric. The <em>tāla</em> of a <em>gvāra</em> is always much longer than the lyric that is performed without any possibility of a pause in between. If a person playing the <a href="../meaning/7fa14c5c-dea8-4bd7-bd35-aaa6cb29c9ec/" target="_blank" rel="noopener"><em>khiṃ</em></a> instrument misses a beat in between a <em>gvārā</em> performance, only a seasoned player is able to catch the rythm again, as the <em>tāla</em>s keep changing and never repeated. There are no separate names given to <em>tāla</em>s used in <em>gvārā</em>; they are simply known by the name of the deity the <em>gvārā</em> is dedicated to. For instance, Jayanti <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a> Gvārā, etc. <em>Cāliṃ</em> is another form of devotional song that is sung in a single <em>tāla</em> with a longer lyric, but the tempo of the <em>tāla</em> may vary in between.</p>
5225b364-9ccd-4b39-8494-06c2f7e2c5c8	nāga	 नाग	<p>[S.] n. serpent. In Hinduism, Buddhism and Jainism, the <em>nāgas </em>are divine, semi-divine deities, or a semi-divine race of half-human half-serpent beings that reside in the netherworld (<em>pātāla</em>) or in the world of <em>nāgas </em>(<em>nāgaloka</em>) and can occasionally take human form. They are principally depicted in three forms: wholly humans with snakes on the heads and necks; common serpents or as half-human half-snake beings. <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> is originally portrayed in the form sheltered by Śeṣanāga or reclining on Śeṣa, but the iconography has been extended to other deities as well, e.g., <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> is often shown garlanded with a snake and the serpent is a common feature in <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a> iconography.</p>
0b57733c-31f2-4ca6-a51a-1b06b374733d	sataḥ	सत:	<p>[fr. old New. <em>satara</em>, <em>satare</em>, <em>satala</em>] n. 1) an inn, a public resting-place (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 479). 2) A building or house designated for charity to be used by religious people, mendicants, and ascetics (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 246). Although resembling a private building, a <em>sataḥ</em> usually has a large window at the center flanked by smaller windows. Mostly of two floors with an open ground floor similar to that of a <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a>, a <em>sataḥ</em> usually has a deity enshrined on the first floor. For instance, two non-existing <em>sataḥ</em>s in Patan still have deities attached to a wall. An image of Bhagavatī can be seen attached to the outer wall of the building at the right corner of the road leading to Pyaṃgaḥthāṃ from Gāḥbāhā. The building used to be a <em>sataḥ</em> and the deity was enshrined on its first floor. Another non-existing <em>sataḥ</em> in Dhālāchẽ also has two images covered with <em>dhakiṃ</em>s (curtain covering a deity behind) on the eastern and northern walls where the <em>sataḥ</em> once stood. In most cases, a <em>sataḥ</em> is the residence for the <a href="../meaning/2764e1a5-7587-4702-9976-8ff8f6a3f891/" target="_blank" rel="noopener"><em>jogī</em></a> community.</p>
716b4f94-f144-4556-8dd7-6831b1e2f99b	Citrakāra	 चित्रकार	<p>n. lit. an artist, painter; the Newars caste of painters. Locally known as <em>puṃ</em>, Citrakāras have traditionally taken up the profession of painting idols and masks of deities, ritual pots, and even the main entrance of a private building with auspicious emblems ahead of rituals like <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a>.</p>
9bf73751-e478-471e-9d15-7fd2330501eb	agniśālā	   अग्निशाला	<p>[S.] n. Sanskrit term for <em><a href="../meaning/b0fb08c6-f86b-4002-9c52-4bc072deef81/" target="_blank" rel="noopener">agiṃmathaḥ</a></em>.</p>
0ce1986d-ee1d-4818-afcf-6fcf31bc0b1d	Amoghasiddhi	   अमोघसिद्धि	<p>n. one of the five <em>dhyānī </em>Buddhas who faces north; see <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>.</p>
