ption>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. one of the five <em>dhyānī </em>Buddhas who faces east; see <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>.</p>
5459aaaf-b305-4be0-8f1e-c601de58de04	digi	  दिगि	<p>n. a multiple-storey building of a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> that also houses an esoteric deity and has long halls for organizing feasts.</p>
0aeae6c8-ac95-40af-8c7e-3e9ba1e4bb29	degaḥ	 देग:	<p>[New.] var. <em>degala</em>, <em>dyaḥgaḥ</em>; n. lit. house of god; a temple.</p>
22c6f4d8-6fbc-4743-af29-c74b4519f035	pasukājhyāḥ	  पसुकाझ्या:	<p>var. <em>pasūkājhyāḥ</em>; n. window with a row of three or five small openings. <em>Pasukājhyāḥ</em> can be seen both in residential buildings and monasteries mostly on the first floor. A row of three openings symbolize the Buddha, <em>Dharma</em> (Buddha's teachings) and <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>Saṃgha</em></a> (monastic association), while the row of five openings symbolize the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>.</p>
bf7d2491-0e40-4ce9-a44d-8eb26124030f	maṭha	 मठ	<p>[S.] n. a hut, cottage, retired hut or cell of an ascetic (or student) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 774); abode of ascetics. In the Kathmandu valley, <em>maṭha</em> is a kind of monastery with a courtyard in the middle like in the Buddhist <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>s. People of Girī, Purī, Bhāratī castes, who follow asceticism, live in the <em>maṭha</em>s.</p>
50edb378-7186-490f-9764-b6a8b872c102	abhiṣeka	  अभिषेक	<p>[S.] anointing, inaugurating or consecrating (by sprinkling water), inauguration of a king, royal unction (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 71).</p>
24c7cfb7-5235-4439-a93d-780e4e80b7c8	akulāṃ	 अकुलां	<p>n. cornice brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
2ade2fc1-3316-465d-abee-ff4e119a62f5	akāpalaṃ	    अकापलं	<p>n. a mallet used to compress and provide the size of the ruffian (raw clay put inside a mould to give it a fixed shape, often used for making bricks); syn. <em>cikātapalaṃ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 19).</p>
e2c91165-4a65-4542-a88d-407d8305c0a1	vajradhātu maṇdala	   वज्रधातु मण्डल	<p>[S.] var. <em>bajradhātu maṇḍala</em>, <em>vajradhātu mandaḥ</em> (New.); n. one of the most popular <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>mandaḥ</em></a>s (<em>maṇḍala</em>) in the Kathmandu Valley. Many of the <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s found here have been constructed based on the <em>vajradhātu maṇḍala</em>. <a href="../meaning/d5ce7e1e-b0fa-44a6-a831-a541f8b20c41/" target="_blank" rel="noopener">Vairocana</a> is the central deity of this <em>maṇḍala</em> and here is shown with four faces and eight arms, thus taking the form of Vajradhātu (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 54). As such, the <em>manda</em><em>ḥ</em> is known as the <em>maṇḍala</em> of Vajradhātu; correspondingly, the <em>caitya</em>s constructed on the basis of the <em>vajradhātu maṇḍala</em> are known as <em>vajradhātu caitya</em>s. Altogether, the <em>vajradhātu maṇḍala</em> has 53 deities, including, but not limited to, the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a> and their consorts, as well as the 16 great <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener"><em>Bodhisattva</em></a>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/vajradhatu/titleCreatorYear/items/5PENZU6N/item-list" target="_blank" rel="noopener">Tachikawa 1991</a>: 1074).</p>
56bb6f77-3727-4149-9456-f5e0e10f3c7e	Rañjanā	  रञ्जना	<p>var. <em>Raṃjanā</em>; n. highly decorative script originated in the Kathmandu valley in the 11th century that is considered to be divine and used mostly for writing mantras and holy scriptures. Some believe that it is the calligraphic version of <em>Nepāla Lipi</em>, the script adopted by the Newars. There are many examples of manuscripts of <a href="../meaning/ee70aa6e-c5ae-4e48-8e64-bb1a0be4e75b/" target="_blank" rel="noopener"><em>Prajñāpāramitā</em></a> written in Rañjanā script in the Kathmandu valley.</p>
793d51f4-882d-4e4a-86c6-b925ac3cbd98	kisalī	   किसली	<p>var. <em>kisaliṃ</em>, <em>kisli</em>; n. lit. a <em>salī</em> (small wide-mouthed clay cup) with <em>ki</em> (rice); <em>salī</em> filled with rice grains, an areca nut and a coin. It is used as an object of offering to the main deity for being inducted into the Buddhist <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>saṃgha</em></a> (monastic association) or used as registration fee to perform any religious ceremonies (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/neva%20baudhh/titleCreatorYear/items/4EWURQPS/item-list" target="_blank" rel="noopener">Vajracharya et al. NA</a>: 4). Sometimes during the worship, a <em>kisalī</em> is placed on top of a <a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>kalaśa</em></a>.</p>
551d42ac-aa42-487f-b7e7-388588900daa	haimā	 हइमा	<p>n. 1) the left side of a Newar drum that does not contain <em>khau</em> (black tuning spot). 2) the god of mood, terrific aspect of <a href="../meaning/da2907e8-d43b-40d3-9a4b-10b5ff674ec9/" target="_blank" rel="noopener">Nāsaḥdyaḥ</a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 345); proper name of a god or spirit, complementary to the Nāsaḥdyaḥ, and just as the latter usually manifested in the shape of a hole in walls (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 77).</p>
084d106d-be63-492c-8512-4fc03730328a	Satva Pujā	सत्व पुजा	<p>n. ritual of expressing reverence to Avalokiteśvara and Tārā in seven stages popularly known as the <em>Saptavidhānottara</em> (<em>Saptavidhāna</em>) <em>Pujā</em>. The seven stages are: <em>vandanā</em> (profound obeisance), <em>pūjanā </em>(worship), <em>pāpadeśanā</em> (confession of sin), <em>anumodanā </em>(concurrence of acts of merit of oneself and others), <em>adhyeṣaṇā </em>(beseeching for turning the Wheel of the <em>Dharma</em>), <em>yācanā</em> (prayer for welfare and peace of all sentient beings) and <em>bodhicittotpādanā</em> (cultivation of will for deliverance all beings from sorrow) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Vajr%C4%81c%C4%81rya/titleCreatorYear/items/WB6KFD3H/item-list" target="_blank" rel="noopener">Vajrācārya et al. NA</a>: 1-6). <em>Satva Pujā</em> is performed on occasions like someone's birthday or if someone is sick. <em>Pujā</em> items must always be present while performing a <em>Satva Pujā</em>, but <em>Saptavidhāna Pujā</em> may also be performed as a mental worship, that is, a worship performed by the mind without the involvement of any <em>pujā</em> items. Therefore, <em>Satva Pujā</em> can be termed as a part of <em>Saptavidhāna Pujā</em> (Vajrācārya et al. NA: 9).</p>
4ba10f8d-257f-4344-b094-f080fb02748a	anālā	  अनाला	<p>[fr. New. <em>anāmalā</em>] var. <em>analā</em>; n. the name of the additional month (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 7). This intercalary month appears once in every three years in the lunar calendar. Also known as <em>adhikamāsa, malamāsa, puruṣottamamāsa</em>.</p>
7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0	varada mudrā	  वरद मुद्रा	<p>[S.] n. ‘boon-granting’ gesture in which the palm is held down facing outwards with all the fingers loosely outstretched or curved slightly inwards. If a jewel is seen stamped on the hand showing the <a href="../meaning/5aa03fe4-2e17-4b9b-b8aa-f102a581315e/" target="_blank" rel="noopener"><em>mudrā</em></a>, the gesture is known as <em>ratnasaṃyukta varada mudrā</em>, that is, the gift-bestowing attitude together with a jewel (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 441).</p>
622b3411-6d2e-442f-8557-0b1e50336c67	saṃgha	    संघ	<p>[S.] var. <em>saṅgha</em>; n. 1) monastic association; number of people or inhabitants living together. The term is most commonly used to refer to the order of Buddhist monks and nuns of Theravāda tradition. In the context of the Newars of the Kathmandu valley, all <em><a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener">bāhāḥ</a></em>s and <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>s are inhabited and tended to by initiated members of Śākyas and Vajrācāryas, who are householder monks residing in and around the respective monastery to form its <em>saṃgha</em>. The <a href="../meaning/7905baa8-f0fb-469d-b63c-ec63ec6b3790/" target="_blank" rel="noopener"><em>bare chuigu</em></a> ritual formally inducts a boy to the <em>saṃgha</em> of his monastery, keeps him in line to take his turn to serve as the <em>dyaḥpāḥlāḥ</em> (guardian of the main deity), and paves way for him to eventually become an <a href="../meaning/2b21bab6-ce62-4564-8ace-8b6db905138b/" target="_blank" rel="noopener"><em>āḥju</em></a> (elder) of the monastery during the later half of his life. Some of the monasteries are very strict in the induction of a new member and do not allow boys from an inter-caste marriage to be initiated at the monastery. 2) one of the Buddhist trinity: the Buddha, the <em>Dharma</em> (his teachings) and the <em>Saṃgha</em> (monastic association)̣. In <em>bāhā</em>s and <em>bahī</em>s, besides the image of the Buddha, one can see the personification of the <em>Dharma</em> in the form of the image of <a href="../meaning/ee70aa6e-c5ae-4e48-8e64-bb1a0be4e75b/" target="_blank" rel="noopener">Prajñāpāramitā</a> seen to the right and the <em>Saṃgha</em> in the form of an image of <a href="../meaning/e97695b3-6374-4b40-bba5-87ae00c986f5/" target="_blank" rel="noopener">Ṣaḍakṣarī Lokeśvara</a> to the left of the Buddha.</p>
132bad3b-3ca3-499a-90dc-66ac5ef49b55	latyā	 लत्या	<p>n. 1) one and a half months.</p>\n<p>2) ceremony held on the 45th day of someone's death. Also known as <em>sapiṇḍīkaraṇa</em>, the <em>latyā</em> ritual consists of mainly seven rites: <em>pūrvāṅga</em> (the preparatory ritual), <em>pañcadaśapiṇḍadāna</em> (offering of fifteen balls), <em>sapiṇḍīkaraṇa</em> (unification of the deceased with his or her forefathers), <em>jaladāna</em> (offering of water jugs), <em>śaiyyādāna</em> (offering of a bed), <em>piṇḍavisarjana</em> (dismissal of the balls) and <em>śivaliṅgapujā</em> (the worship of a <a href="../meaning/dabf6234-fd09-4619-a1ac-d14aa3598737/" target="_blank" rel="noopener"><em>śivaliṅga</em></a>). The rituals serve to help the deceased on his one-year-long journey through the netherworld by providing him with food, water and other gifts, and to unite him with his forefathers (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/handling%20death/titleCreatorYear/items/MDPHVDSR/item-list" target="_blank" rel="noopener">Gutschow et al. 2005</a>: 129).</p>
