ion>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. var. <em>aṃjali</em>; the name of a <a href="../meaning/5aa03fe4-2e17-4b9b-b8aa-f102a581315e/" target="_blank" rel="noopener"><em>mudrā</em></a>, also known as the <em>sarvarājendra mudrā</em> or the <em>sampuṭāñjali</em>. This position sees two hands clasped together against the chest, palm to palm. Both hands extend upwards with all fingers erect or slightly bent. This <em>mudrā </em>is common to images of <a href="../meaning/e97695b3-6374-4b40-bba5-87ae00c986f5/" target="_blank" rel="noopener">Ṣaḍakṣarī Lokeśvara</a> and is also often performed by <a href="../meaning/cd757bdf-7c3f-4ecb-af25-3ac4f2a03046/" target="_blank" rel="noopener">Nāmasaṅgīti</a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 432).</p>
c27f3c54-429d-4444-82f9-609352e6a0b9	mahāpātra	महापात्र	<p>[S.] n. a prime minister (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 797); a local functionary of the medieval period with a status equal to a minister, who is authorized to rule the distant states, but remain loyal to the king. In accordance with the orders of the central administration, a <em>mahāpātra</em> remains under and pay taxes to the central government. The post of a <em>mahāpātra</em> is inherited and the central administration has no role in their appointment (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mahapatra/titleCreatorYear/items/627QJNDQ/item-list" target="_blank" rel="noopener">Śākya 2008</a>: 14); syn. <em>sāmanta.</em></p>
ea075c74-1674-4aa6-8b13-7a8691e483e2	taṃkā	तंका	<p>[Old. New.] var. <em>ṭaṃkā, ṭaṅkā, taṅkā, takā</em> (Mod. New.); a unit of money widely understood as synonymous with the rupee. For instance, five <em>taṃkā</em> is understood as five <em>takā</em> at the present day, which means five rupees.</p>
78cb2841-d2a5-4f64-bd65-55ac9ba9909e	kinnara / kinnarī	किन्नर / किन्नरी	<p>[S.] lit. 'what sort of man/woman?'; a mythical being with a human figure and a head of a horse or with a horse's body and a man's head, reckoned among the gandharvas or celestial choristers, and celebrated as musicians (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 283). They are usually referred to as <em>kinnara</em> in general, but sometimes also mentioned as <em>kinnara</em> and <em>kinnarī</em> to differentiate their gender. In the Hindu mythology, <em>kinnara</em> is described as half-human, half-horse and half-bird. Buddhists, on the other hand, understand <em>kinnara</em> as half-human and half-bird. They sometimes appear in sculptures holding garland in the right hand and a tray containing flowers in the left for the worship of <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Krishna%20Murthy/titleCreatorYear/items/PSHFNJFI/item-list" target="_blank" rel="noopener">Krishna Murthy 1985</a>: 14).</p>
2e3ef741-cf76-4f34-84d8-27022f3b3a02	pādasthāpanā	पादस्थापना	<p>[S.] n. laying of the foundation.</p>
dbdfb21e-2b84-4ff9-b6dd-8721d49fe6ba	Dasaĩ	  दसैँ	<p>[fr. S. <em>Daśāha</em>] var. <em>Dasaiṃ</em>, <em>Daśaĩ, Daśaiṃ</em>; n. festival to worship female divinities like the nine forms of goddess Durgā, the slayer of Mahiṣāsura (buffalo demon), held over the bright half of the autumn month of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvina</a> (<em>Baḍādasaĩ</em>/<em>Mahādasaĩ</em>) and, on a smaller scale, over the bright half of the spring month of <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a> (<em>Caitedasaĩ</em>).</p>
7d687a2b-8484-4146-b394-ba8236e64506	ataḥdegu pujā	   अतःदेगु पुजा	<p>var. <em>ataḥdigu pujā</em>; n. an alternate worship of the family patron deity performed during <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a> or <a href="../meaning/2a49e7df-d2fe-481b-9d7a-61583faddfa8/" target="_blank" rel="noopener">Vaiśākha</a>.</p>
ea75bca9-710e-42d4-a212-ae998e7081ba	Mañjuśrī	मञ्जुश्री	<p>var. Maṃjuśrī; n. widely revered in the Kathmandu Valley as the deity of wisdom, Mañjuśrī is credited to founding a new settlement at a former lake inhabited by the <em><a href="../meaning/5225b364-9ccd-4b39-8494-06c2f7e2c5c8/" target="_blank" rel="noopener">nāga</a></em>s. In doing so, he formed the valley that is now known as Kathmandu. Popular legends describe him slicing a gorge into the south-western hill of the vale to let the water out of the lake. He is frequently depicted in <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s and <a href="../meaning/63a4e521-052f-4fbf-920b-13e3cb7ed2bb/" target="_blank" rel="noopener"><em>dharmadhātu</em> <em>maṇḍala</em></a>s of the Valley, and is commonly shown holding a sword in his right hand and carrying the <em><a href="../meaning/ee70aa6e-c5ae-4e48-8e64-bb1a0be4e75b/" target="_blank" rel="noopener">Prajñāpāramitā</a></em> manuscript in his left. The sword symbolises the removal of ignorance, whilst the manuscript represents transcendental wisdom. The Niṣpannayogāvalī describes Mañjuśrī as having three faces - one yellow, one blue and one white - as well as six arms. His three right hands are described as holding a sword, an arrow and performing <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada mudra</em></a> whilst his three left hands hold the <em>Prajñāpāramitā</em> manuscript, a blue lotus and a bow (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 95). Mañjuśrī has many forms and many names, such as Mañjuvajra, Mañjughoṣa, Darmadhātuvāgīśvara, etc.</p>
4affb43b-9e27-4b80-a11d-4daa6b1f7d6e	asa	  अस	<p>n. see <a href="../meaning/2cb0b088-238b-429f-a229-beee1cc1333f/" target="_blank" rel="noopener"><em>ãlāy</em></a>.</p>
28317e27-8193-4b17-8184-9d6c8fee3070	haliṃpau	हलिंपौ/हलिंपउ	<p>[New.] var. <em>haliṃpati;</em> n. the shield in the <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> architecture. It is placed above the roof cornice of <a href="../meaning/4f56ca65-4f2c-4d5d-ae51-7ed7dfbe42ee/" target="_blank" rel="noopener"><em>cakū</em></a>/harmikā. Haliṃpau generally covers the lower two to four tiers of the trayodaśabhuvana spire. It is not seen on Licchavi caityas, but occur on all <a href="../meaning/a22c0aa1-6e98-49a3-94b8-3cd30ee9b634/" target="_blank" rel="noopener"><em>śikharakūṭa caitya</em></a>s. For more on <em>haliṃpau,</em> see <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/gutschow/titleCreatorYear/items/TMRR73VW/item-list" target="_blank" rel="noopener">Gutschow 1997</a>: 21.</p>
54c9d92a-a13a-484e-bd75-8c859ac08333	sukhāsana	 सुखासन	<p>[S.] cross-legged sitting posture in <em>haṭha</em> yoga, sometimes used for meditation in both Buddhism and Hinduism (lit. easy pose). The word <em>sukhāsana</em> means any easy attitude of sitting. It may be <a href="../meaning/35a51611-26c8-4600-b1d0-3beb0822b4b5/" target="_blank" rel="noopener"><em>paryaṅkāsana</em></a>, <a href="../meaning/d9747f76-d55e-4d13-bbef-3bfd25e27f8a/" target="_blank" rel="noopener"><em>lalitāsana</em></a> or <em>ardhaparyaṅkāsana</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 433).</p>
601f68e4-2ab1-42ed-9656-33aa9f826c52	yakṣa	यक्ष	<p>[S.] n. a semi-mythical class of beings who are supposed to preside over treasures and shower wealth on mankind when propitiated. <a href="../meaning/f18a33ab-7e79-4414-a5ef-36a462ebbef4/" target="_blank" rel="noopener">Kubera</a> is said to be the greatest among the <em>yakṣa</em>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 379).</p>
cd757bdf-7c3f-4ecb-af25-3ac4f2a03046	Nāmasaṅgīti	 नामसङ्गीति	<p>n. hymn of praise dedicated to <a href="../meaning/ea75bca9-710e-42d4-a212-ae998e7081ba/" target="_blank" rel="noopener">Mañjuśrī</a>. It is the short form of <em>āryamañjuśrīnāmasaṅgīti</em>. The verses of <em>nāmasaṅgīti</em> is actually a recitation of the names of Mañjuśrī. Therefore, it is the song of 812 names of Mañjuśrī described in the form of a mantra-letters to be sung in the right manner (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/vajracarya/titleCreatorYear/items/MACEZDSG/item-list" target="_blank" rel="noopener">Vajrācārya 2006</a>: b). A twelve-armed image highly revered by the Buddhists is the deification of the <em>nāmasaṅgīti</em> hymn. The deity is also known by the same name Nāmasaṅgīti.</p>
b544fcba-6b7a-4dac-a60e-a5c2cabe45b5	ayli	 अय्‌लि	<p>var. <em>aylĩ</em>, <em>ayliṃ</em>; n. unbaked clay vessel used for sacrificial gifts.</p>
ae175c99-b039-446a-9fa3-87756f63a2a1	aylāḥ	  अय्‌लाः	<p>[fr. old New. <em>ayarāka/ayalaka</em>] n. an alcoholic liquor made by distilling a fermented mixture of various ingredients mixed with cooked rice or millet.</p>
ff01eb73-6aa5-416c-9dcc-4d55b870538e	trayodaśabhuvana	त्रयोदशभुवन	<p>[S.] n. lit. 13 worlds; pinnacle of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> consisting of 13 tiers representing the 13 worlds. There are caityas with a pinnacle consisting lesser number of tiers as well. A <em>caitya</em> with five tiers is a <em>Śrāvakabhūmicaitya</em>, which is a reference to a lay person. A <em>caitya</em> with seven tiers is a <em>Pratyekabhūmicaitya</em>, which commemorates every person who lives in seclusion and obtains emancipation for himself only. A <em>caitya</em> with 11 tiers is called <em>Mahāyānabhūmicaitya</em>, a reference to <em>Mahāyāna</em> doctrine, and a <em>caitya</em> with 13 tiers is called <em>Vajrayānabhūmicaitya</em> that refers to <em>Vajrayāna</em> doctrine. The 13th tier is identified as <em>vajrabhūmi</em>, the ultimate stage of spiritual development (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow 1997</a>: 23).</p>
c5b1d892-7287-4332-89ce-9126691c56fd	ācāḥ luigu	आचाः लुइगु	<p>var. <em>ācāḥ luyegu</em>; n. a tantric initiation in Newar Buddhism by which a novice is consecrated into a Vajrāchārya priest. It is known as <em>Vajrācārya-abhiṣeka</em>. It is the consecration of Vajra-master (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/gellner/titleCreatorYear/items/TJX3TK6V/item-list" target="_blank" rel="noopener">Gellner 1992</a>: 199). After the <em>ācāḥ luigu</em> ritual, a Vajrācārya formally enters Vajrayāna - the Diamond Way. Only sons of a Vajrācārya is eligible for the <em>ācāḥ luigu</em> ritual, which then serves as a license for him to officiate life-cycle and other rituals. A son of a Vajrācārya who has not undergone the <em>ācāḥ luigu</em> ritual is not eligible for officiating any rituals and culturally his status, therefore, is equivalent to a Śākya, who is a Mahāyānist.</p>
6ec21b9c-5c7b-4aab-9d0e-3e916f404fcc	jaḥdhuṃ	 ज:धुं	<p>[fr. old New. <em>jaladhuna</em>, <em>jaladhuni</em>] var. <em>jaḥdhũ, jarhũ, jaḥrhuṃ</em>; n. manmade water tank usually constructed on roadsides for the people passing by to drink water from. Built specifically for the purpose of drinking, a <em>jaḥdhuṃ</em> contains a stone water trough that has a spout in the shape of a woman's breast. Local belief portrays drinking water from a <em>jaḥdhuṃ</em> as drinking mother's milk. The water is filled manually into the stone trough. A <em>jaḥdhuṃ</em> can be free standing, attached to a wall of a private house, temple or monastery, or it can be found in a <a href="../meaning/03c490ac-53db-4cfc-a9cf-09a5e62c08a9/" target="_blank" rel="noopener"><em>hiti</em></a> (stone water spout) complex. One of the earliest records of a <em>jaḥdhuṃ</em> is from Subāhāḥ (<a href="https://danam.cats.uni-heidelberg.de/report/ce814212-e698-11e9-8bc4-0242ac130002" target="_blank" rel="noopener">LAL1920</a>). This <em>jaḥdhuṃ</em> is no longer in existence, but its one-line inscription was dated 187, which is Mānadeva Era that corresponds to 763 CE. The <em>jaḥdhuṃ</em> was attached to a wall in front of a well east of the Subāhāḥ complex (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Tev%C4%81r%C4%AB%20/titleCreatorYear/items/83FIA3EI/item-list" target="_blank" rel="noopener">Tevārī et al. 2020 VS</a>: 22). Almost all of the <em>jaḥdhuṃ</em>s are non-functional these days except a very few like the one at Tangaḥ, Patan, which is also the biggest <em>jaḥdhuṃ</em> in Patan that has a capacity of around 2,200 liters of water (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/furukawa/titleCreatorYear/items/MJ42STCW/item-list" target="_blank" rel="noopener">Furukawa et al. 2010</a>: 121); syn. <em>jaḥdhuṃhiti</em>.</p>
