ption>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. procession to Nugaḥ; the chariot procession of <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> from Gāḥ Bāhāḥ (<a href="https://danam.cats.uni-heidelberg.de/report/e4dcd814-3927-11ea-a19a-0242ac130006" target="_blank" rel="noopener">LAL0510</a>) to Nugaḥ (Sundhara) that normally takes place on the 6th of the bright fortnight of <a href="../meaning/2a49e7df-d2fe-481b-9d7a-61583faddfa8/" target="_blank" rel="noopener">Vaiśākha</a>. This is the second stop Buṅgadyaḥ makes during his annual chariot procession. A key feature of Nugaḥyāḥ is Buṅgadyaḥ's crossing of Hvakhu, a river believed to have flown from the south to north at Mangal Bazaar ages ago. Although the river is no longer in existence, the tradition of offering a new <em>dhoti</em> (loin cloth) to the deity upon crossing the river is still in practice. On the same occasion, Rājabhaṇḍārīs from Iku Bāhāḥ area in Kathmandu offer a <em><a href="../meaning/72913b3c-d88a-4723-a381-99091a822d4d/" target="_blank" rel="noopener">patāḥ</a></em> to the deity.</p>
916d2741-6605-40f5-bcab-07d27eb4431a	jaṃko	जंको	<p>[New.] var. <em>jaṃku, jaṅku, jaṃkva</em>; n. 1) rice feeding ceremony of a child performed at the age of 5 months in case of a girl child and 6 months in case of a boy; also called <em>jā nakegu</em>.</p>\n<p>2) series of Newar old age rituals also known as <em>jyāḥ jaṃko</em> performed at a specific age. The first old age <em>jaṃko</em> is performed at the age of 77 years, 7 months, 7 days. Locally known as <em>nhāpāṃ jaṃko</em>, the Sanskrit term for it is <em>Bhīmarathārohaṇa</em>. The second <em>jaṃko</em> locally known as <em>nikaḥ jaṃko</em> is performed when one gets to observe a thousand full moons. Therefore the ritual is known as <em>Sahaśracandrarathārohaṇa</em> or <em>Sahaśracandradarśana</em>. This occurs somewhere between 81 to 84 years of age, depending on whether one counts full moons of intercalary months or not. The third <em>jaṃko</em>, <em>svakaḥ jaṃko</em>, is performed at the age of 88 years, 8 months, 8 days. It is also known as <em>Mahārathārohaṇa</em>. The fourth and fifth <em>jaṃko</em>s are rare. The fourth <em>jaṃko</em>, <em>pyakaḥ jaṃko</em>, is performed at the age of 99 years, 9 months, 9 days. It is also known as <em>Devarathārohaṇa</em>. The fifth one, <em>nyākaḥ jaṃko</em>, is only heard about in oral accounts and is supposedly performed at the age of 110 years, 10 months, 10 days. This ritual also known as <em>Mahādevarathārohaṇa</em> has not been performed so far in living memory. If both husband and wife are living, the <em>jaṃko</em> ritual is performed on both when the husband reaches the designated age disregarding the wife's age. In case a wife is already widowed, she goes through these rituals when she reaches the designated age.</p>
bfda0750-5fb6-40af-a87f-15739ec36fb5	pūrṇakalaśa	    पूर्णकलश	<p>[S.] n. lit. a complete <a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>kalaśa</em></a>; ritual vessel that is complete in the sense that it contains all eight emblems of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a>. A <em>pūrṇakalaśa</em> can be divided into three parts: the base, the pot body and the entrance. The base features one of the eight emblems, <em>puṇḍarika</em> (<a href="../meaning/b30eeaf4-81f7-4794-97c9-decba80d2463/" target="_blank" rel="noopener"><em>padma</em></a>), while the pot body contains three emblems <em>śrīvatsa</em>, <em>matsyayugma</em> and <em>kalaśa</em>. The remaining four emblems–<em>śaṃkha</em>, <a href="../meaning/f465e832-89b1-4f2f-8f73-acc149dbb8a8/" target="_blank" rel="noopener"><em>cāmara</em></a>, <em>dhvaja</em> and <a href="../meaning/97e0c640-8af5-4307-98b0-748e0a757889/" target="_blank" rel="noopener"><em>chatra</em></a>–can be seen at the entrance or the opening on the top of the vessel. They represent the eight <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener"><em>Bodhisattva</em></a>s who are regularly featured in <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s. A <em>pūrṇakalaśa</em> is known by other names like <em>bhadraghaṭa</em>, <em>sādhanakalaśa</em>, <em>sarvārthasiddhakalaśa</em>, <em>suvarṇakalaśa</em> and <em>aṣṭamaṅgalayuktakalaśa</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/nepala%20sam/titleCreatorYear/items/P55KF2MA/item-list" target="_blank" rel="noopener">Śākya 1089 NS</a>: 120). Iconic representation of <em>pūrṇakalaśa</em> can be seen on either side of the golden gate at the Bhaktapur Durbar Square. The Vatsalā temple in front of the Golden Gate has a stone <em>pūrṇakalaśa</em> as its main deity. The Annapūrṇa temple at Asana, Kathmandu also contains a silver <em>pūrṇakalaśa</em> as the main deity.</p>
02cf2861-e8e5-43f6-abd9-624f79d04fbd	pañcacaitya bhaṭṭāraka	पञ्चचैत्य भट्टारक	<p>n. a reference to a set of five <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s as seen in Cilancva Caitya (<a href="https://danam.cats.uni-heidelberg.de/report/83b26802-2953-4afc-baf7-e9ea63fd5fd6" target="_blank" rel="noopener">KIR0001</a>), Kirtipur.</p>
a159adbb-575d-49bd-9b55-02a189bf335c	Umāmaheśvara	  उमामहेश्वर	<p>n. Lord <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> and his wife Goddess Pārvatī are collectively known as Umāmaheśvara. In the images, Umā, another name of Goddess Pārvatī, is seen sitting to the left of Lord Śiva, who is also known as Maheśvara.</p>
ee70aa6e-c5ae-4e48-8e64-bb1a0be4e75b	Prajñāpārāmitā	 प्रज्ञापारमिता	<p>n. lit. perfection of knowledge, it is the manuscript that elucidate the fundamental philosophy of Buddhism - the concept of <em>śūnya</em> (voidness). It is a Mahāyāna scripture restored from the nether regions by Nāgārjuna in the second century AD (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 197). The scripture or the knowledge contained in the scripture is deified into an image of a goddess with four arms and yellow in colour. Her two principal hands display the <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra mudrā</em></a>. Her other left hand holds the <em>Prajñāpāramitā</em> scripture on a lotus while the other right hand holds <em>cintāmaṇi</em> banner (Bhattacharyya 1958: 326). Prajñāpāramitā, as a deity, also represents the <em>Dharma</em> of the Buddhist trinity and her image is found to the right of the image of the Buddha.</p>
ef2e0fa1-30a6-441b-af77-fbe67c18a0cb	aṣṭamaṅgala	    अष्टमङ्गल	<p>[S.] var. <em>aṣṭamaṅgal</em>, <em>astamaṅgal</em>; n. the Eight Auspicious Emblems, popular predominantly among the Newars and Mahāyāna Buddhists in Nepal. The Newar <em>aṣṭamaṅgala</em> consists of <em>Śrīvatsa</em> (an endless knot), <em>Puṇḍarīka</em> (a lotus), <em>Dhvaja</em> (a victory banner), <a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>Kalaśa</em></a> (a sacred water pot), <a href="../meaning/f465e832-89b1-4f2f-8f73-acc149dbb8a8/" target="_blank" rel="noopener"><em>Cāmara</em>/<em>Cvāmvaḥ</em></a> (fly whisk made from a yak's tail), <em>Matsyayugma</em> (a pair of golden fish), <a href="../meaning/chatra/" target="_blank" rel="noopener"><em>Chatra</em></a> (a five-layered parasol) and <em>Śaṅkha</em> (a conch shell) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/P55KF2MA/library" target="_blank" rel="noopener">Śākya 1089 NS</a>: 2). The Mahāyāna tradition identifies the same emblems as <em>aṣṭamaṅgala</em> though here a <em>Dharmacakra</em> (the Wheel of the Law) replaces the <em>Cāmara</em>.</p>\n<p>The eight emblems are sometimes collectively represented in both Newar and Mahāyāna traditions in the form of <em><a href="../meaning/bfda0750-5fb6-40af-a87f-15739ec36fb5/" target="_blank" rel="noopener">pūrṇakalaśa</a></em>. These emblems vary according to tradition. For instance, the Hindus consider a Brahmin, a cow, a fire, gold, ghee, the sun, water and a king to constitute <em>aṣṭamaṅgala,</em> whilst another tradition venerates a lion, bull, elephant, water-jar, fan, flag, trumpet and lamp as its auspicious emblems (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 116). In the ancient Sinhalese tradition, <em>śrīvatsa</em>, <em>vāladhi</em> or <em>cāmara</em>, <em>aṅkuśa</em>, <em>mīna</em>, <em>nandi</em> or <em>svastika</em>, <em>veṣṭhana</em> or <em>bhadrapīṭha</em>, <em>śaṅkha</em> or <em>ghaṭāyudha</em> are taken to be <em>aṣṭamaṅgala</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/QFDQTE7M/library" target="_blank" rel="noopener">Karunaratne 1997</a>: 81).</p>
c0d8546f-2a57-4e90-8ce2-54f560372923	aṣṭamātṛkā	   अष्टमातृका	<p>[S.] n. the group of the 'Eight Mother Goddesses'. The Eight Mother Goddesses are revered in the Kathmandu valley as protective deities. Each goddess is invariably enshrined in one of the four cardinal or four intermediate directions. Gutschow et al. claim that these are as follows: Brahmāyaṇī (E), Māheśvarī (N), Kaumārī (SE), Vaiṣṇavī (SW), Vārāhī (S), Indrāyaṇī (W), Cāmuṇḍā (NW) and Mahālakṣmī (NE) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/IRBIUBTR/library" target="_blank" rel="noopener">Gutschow et al. 1977</a>: 10). However, a ritual map obtained from Bhaktapur aligns the goddesses with different directions, namely Brahmāyaṇī (E), Māheśvarī (SE), Kaumārī (S), Vaiṣṇavī (SW), Vārāhī (W), Indrāyaṇī (NW), Mahākālī (N) and Mahālakṣmī (NE) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/CECXS2TV/library" target="_blank" rel="noopener">Kölver 1976</a>: 69).</p>\n<p>It is believed that the Kathmandu Valley and the three cities within it lie under the protection of the goddesses. In contrast to the Seven Mother Goddesses (<em>saptamātṛkā</em>) in India, <em>aṣṭamātṛkā</em>s are venerated in Nepal. A number of the deities in India are considered to be non-violent, but in Nepal all of the <em>aṣṭamātṛkā</em>s are classed as <em>hitvaṃdyaḥ</em>, i.e. deities who expect blood sacrifices. Cāmuṇḍā (also sometimes known as Mahākālī) and Mahālakṣmī have complex origins, but the other goddesses are related to Brahmā, <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a>, <a href="../meaning/74fbb417-0ad0-4929-8e9c-ace08c20348d/" target="_blank" rel="noopener">Kumāra</a>, <a href="../meaning/a55759f8-d6bd-49e4-81f2-c437e372fece/" target="_blank" rel="noopener">Viṣṇu</a> and Indra (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZD7MU4JM/library" target="_blank" rel="noopener">Slusser 1982 vol. 1</a>, 322). Vārāhī is related to Varāha.</p>
4e40b1ae-00b4-4871-8baf-ee3470575ea9	tāḥ	ता:	<p><!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML/>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--> n. a pair of small but thick cymbals held only with the thumb and index finger of both hands to beat time in music. <em>Tāḥ</em> always accompanies <a href="../meaning/khiṃ/" target="_blank" rel="noopener"><em>khiṃ</em></a> drum together with <a href="../meaning/b8788966-1617-4edd-a7ec-3f7b860b83f8/" target="_blank" rel="noopener"><em>jhyāli</em></a>; syn. <em>tiṃchu</em>; see <a href="../meaning/6a7ecb0c-bfde-4fc1-ac5c-6187eca35224/" target="_blank" rel="noopener"><em>bhusyāḥ</em></a>, <a href="../meaning/dcc1480f-6cd8-4f96-a282-11959a2778de/" target="_blank" rel="noopener"><em>chusyāḥ</em></a> and <a href="../meaning/0a80b8eb-35d5-4c6d-b06f-8a616bcb2712/" target="_blank" rel="noopener"><em>sichyāḥ</em></a>.</p>
a35df042-90e2-4f8b-811f-3f8a8de91ce4	pañcacaitya	पञ्चचैत्य	<p>var. <em>paṃcacaitya;</em> n. lit. five <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a>s;</em> a reference to a set of five <em>caitya</em>s.</p>
411b3767-16d9-4625-b723-44cec312f72d	gunpunhipyākhaṃ	 गुन्पुन्हिप्याखं	<p>var. <em>gũpunhipyākhaṃ, guṃpunhipyākhaṃ</em>; n. a seasonal play staged on the full moon day of <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a> (August-September).</p>
e2f384e2-d435-46b6-b37d-16c0705290fc	guṃlādharma	  गुंलाधर्म	<p>n. religious activities performed within the holy month of <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a>, for instance, visiting Buddhist monasteries and shrines early in the morning accompanied by traditional drums and cymbals or abstaining from consuming meat products and alcoholic drinks.</p>
ffa16ff7-2ccb-48c9-be57-1f79959edc93	samyak mahādāna	   सम्यक् महादान	<p>n. lit. the 'great righteous charity'; a periodic ceremony of alms-giving carried out in a grand manner. An act often considered as one of the ten perfections an individual requires to achieve to attain Buddhahood, <em>samyak mahādāna</em> is a series of activities that include preparation and gathering of deities (mostly <a href="../meaning/8d0ebac4-c2d9-4424-ba17-aad279872771/" target="_blank" rel="noopener">Dipaṅkara</a> Buddha images), their welcome at the venue and subsequent seating at their respective spots, and the alms-giving that is sponsored occasionally as a special act of merit by a private donor, or regularly by the concerned <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a>. <em>Samyak mahādāna</em> is organized once in every twelve years at Bhuikhyaḥ near the Svayambhū Caitya in Kathmandu, in every five years at Nāga Bāhāḥ in Patan, and annually at Thathu Bahī in Bhaktapur.</p>
58f13a84-6147-4cf9-9800-d16843f93227	PURPP/LMC	पीयूआरपीपी/एलएमसी	<p>n. the acronym stands for the Pro-Poor Urban Regeneration Pilot Project that comes under the Japan Social Development Fund of the World Bank and the Lalitpur Metropolitan City.</p>
62d3764d-5292-44ae-9fa8-03fa61f72889	garbhagṛha	    गर्भगृह	<p>[S.] n. the sanctuary or adytum of a temple (where the image of a deity is placed) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 349); the main sanctum of a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> or <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>. In the case of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>, the <em>garbha </em>(another term for <em>garbhagṛha</em>) is an elongated dome and is surmounted by the eyes on the <em>harmikā </em>and rings surmounted by another small elongated <em>caitya </em>(<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/locke/titleCreatorYear/items/5A9SNX3X/item-list" target="_blank" rel="noopener">Locke 1985</a>: 356).</p>
c0db4271-ab00-4981-a92f-49174668b342	gathāṃmugaḥ caḥrhay	   गथांमुग: च:ह्रय्	<p>n. the 14th day of the dark fortnight of <a href="../meaning/cb906d38-016b-47d0-92bc-a8fdd8c3e821/" target="_blank" rel="noopener">Śrāvaṇa</a> that is also known as <em>ghaṇṭākarṇa caturdaśī</em>; the first festival after the completion of rice plantation when the Newars smoke evil elements out from their house. The burnt straws are disposed of at the nearest effigy of <em>gathāṃmugaḥ</em>, who is then pulled all the way to the nearest river in the evening and discarded. People wear an iron ring on their finger on this day with the belief that it protects them from evil spirits. As evil elements from all households are cleansed and discarded at the effigy of <em>gathāṃmugaḥ</em>, who is then discarded at a nearby river, it was believed that evil elements roamed the riversides on this evening. As such, this evening was perceived to be an opportune time for learning witchcraft or even practicing tantra. Stories of people gathering at riversides late in the evening to practise witchcraft feature prominently in the oral history of the Newars. <em>Gatḥāṃmugaḥ caḥrhay</em> is also a harbinger of festivals, as the holy month of <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a> begins two days later. The earliest documentary evidence of <em>gathāṃmugaḥ</em> <em>caḥrhay</em> dates back to 504 NS (1384 CE) and is recorded in the <em>Gopālarājavaṃśāvalī</em>, which talks about the day of <em>gaṇṭhakarṇṇa cavadaśa</em>, a variation of <em>ghaṇṭākarṇa caturdaśī</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/gopalaraja/titleCreatorYear/items/FSJVMIWH/item-list" target="_blank" rel="noopener">Vajrācārya et al. 1985</a>: 69).</p>
da2907e8-d43b-40d3-9a4b-10b5ff674ec9	Nāsaḥdyaḥ	 नास:द्य:	<p>[fr. old New. Nāśvaradeva] n. lit. the deity of <em>nāsaḥ</em> (charm, grace and ability to be the center of attraction), nāsaḥdyaḥ is widely revered by the students of dance, drama and music, as <em>nāsaḥ</em> is the chief quality they need to possess if they are to succeed in the field. Nāsaḥdyaḥ is, therefore, a unique deity of amorphous nature usually represented only by a triangular or oblong hole on a wall in the Newar pantheon. The center of worship is a hole or several holes through which divine energy flows, spiritually perceived by Nāsaḥdyaḥ's devotees. In all adjacent walls and buildings in front of and behind the shrine these holes (<a href="../meaning/ab743a7b-0dc9-4501-87c0-957fadda2829/" target="_blank" rel="noopener"><em>nāsaḥpvāḥ</em></a>) continue like a flight path which must not be blocked, either by buildings or humans. While performing a <em>nāsaḥpujā</em>, the devotee steps a little aside to avoid interference with the subtle flow. This practice and the concept of a linear progression of divine energy prompts one to suspect that origin of the Nāsaḥdyaḥ worship is a pre-Hindu tradition (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/7SS8ZNUE/library" target="_blank" rel="noopener">Wegner 1992</a>: 125). Every new session of lessons on Newar musical instruments or rehearsals of dance and drama begins with the worship of Nāsaḥdyaḥ.</p>
7ebeb8d7-4321-4896-bb39-1ab6a2815f67	Vāsuki	वासुकि	<p>[S.] var. Bāsuki (Nep.); n. The name of a serpent-king (one of the three chief kings of the <em><a href="../meaning/5225b364-9ccd-4b39-8494-06c2f7e2c5c8/" target="_blank" rel="noopener">nāga</a>s</em>, the other two being Śeṣa<em> </em>and Takṣaka) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 948).</p>
d2f8d5a7-85f4-4eb3-8583-29d4a78abf03	caityaraṅa	चैत्यरङ	<p>[old New.] var. <em>caityaraṃga;</em> n. another name of Cilancva Caitya (<a href="https://danam.cats.uni-heidelberg.de/report/83b26802-2953-4afc-baf7-e9ea63fd5fd6" target="_blank" rel="noopener">KIR0001</a>) of Kirtipur.</p>
7e91b99d-407a-44ad-9159-34a4fbb76bbc	phujā	  फुजा	<p>n. uppermost roof of a temple; balconied pinnacle found in <a href="../meaning/ac240bd1-c4f7-44d3-a4d2-3ebe4b2e6abf/" target="_blank" rel="noopener"><em>āgaṃchẽ</em></a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 117). Similar structure is found also in <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a> architecture referred to as <a href="../meaning/2ef8ec3f-a937-4fda-8e12-da7d9ed64c32/" target="_blank" rel="noopener"><em>pula</em></a>.</p>
17e908a4-676c-4503-82e0-b4e58b72496b	Guṃlā	  गुंला	<p>var. Gũlā; n. the tenth month of the Newar lunar calendar (August/September); holy month of the Buddhists. Many devotees throng Buddhist shrines early in the morning playing traditional drums and cymbals. <a href="../meaning/10958029-7ce0-4c0e-a88a-f758e39f271b/" target="_blank" rel="noopener"><em>Dāphā bhajana</em></a>s are performed in many localities and temples. <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>Phalcā</em></a>s come to life in the evenings, as the locals perform devotional songs throughout the month. Many people abstain from consuming meat and alcoholic drinks. <em><a href="../meaning/60cb8a43-0800-4aba-8b72-eed832bd5987/" target="_blank" rel="noopener">Bahīdyaḥ</a> bvaygu</em>, the annual exhibition of rare items, is the main attraction of this month. Rare items, idols, scriptures and relics are put on display at both <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>s and <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>s for about two weeks starting from the second week of the month.</p>
69b1b443-f444-451a-89b0-002c8341deaa	Khapiṃchẽ	खपिंछेँ	<p>var. Khapiñchẽ, Khapinchhen; n. lit. house of jewel wasp (emerald cockroach wasp), a place in Patan that lies to the east of the route from Saugal to Cyāsal Square.</p>\n<p>Old name [Occurance]: Ṣapiche [<a href="../../../report/bb7faf70-abe2-469e-af49-155168b3fc7a" target="_blank" rel="noopener">LAL_1780 _0002</a>]</p>
7c8c0f99-2b95-4b1a-8c69-087233daba06	Kvaḥne	क्च:ने	<p>var. Kone, Kwane; lit. lower part of the city; name of a place or area in both Patan and Kathmandu.</p>
01165966-959f-42cc-86e2-34401968ce6c	nāulo	नाउलो	<p>[D.] a water tank in the Doteli languages of far-western Nepal.</p>
2764e1a5-7587-4702-9976-8ff8f6a3f891	jogī	 जोगी	<p>[fr. S. <em>yogin</em>] var. <em>jugi</em>, <em>jogi</em>; n. 1) ascetic, religious mendicant; especially a follower of the <em>Nātha</em> tradition. 2) a caste-based community of the Newars also referred to as Kusle. The caste-based occupation of the Newars in the traditional social set up also needs to be noted here. The <em>jogi</em> community with the castes Darśandhārī or Kapālī lived in <a href="../meaning/0b57733c-31f2-4ca6-a51a-1b06b374733d/" target="_blank" rel="noopener"><em>sataḥ</em></a> (<em>sataḥchẽ</em>) built in almost every <em>tvāḥ</em> or <a href="../meaning/f904d88c-ef4b-4756-9354-dc2e40fb432c/" target="_blank" rel="noopener"><em>ṭola</em></a>. They kept records of new births and deaths in the families of the neighborhood. The social responsibilities of the <em>jogi</em> community include receiving the offerings from the families that are observing the purificatory rites after any new birth or death in the family. The <em>jogi</em> community is offered <em>nhaynumābva</em> (a set of all the dishes prepared for the feast during the purificatory rite of the 7th day of the death in the family), <em>sībva</em> (similar set of dishes especially dedicated to the deceased), etc. (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 223).</p>
