is widely portrayed as a young and amorous shepherd. He has dark blue skin, is adorned with a peacock feather on his head, and carries a flute in his hand. His birth anniversary, known as Kṛṣṇāṣṭamī or Kṛṣṇa Janmāṣṭamī, is observed on the eighth of the dark fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a>.</p>
1fd23de1-7fca-463e-b5df-ba2702ce5c4a	kavaṃ	 कवं	<p>[New.] n. a living skeleton considered to be an evil being. Generally this figure is seen in pair with a <a href="../meaning/fedc6269-2782-4f61-98c7-e5fb4b6de3fe/" target="_blank" rel="noopener"><em>khyāḥ</em></a>, an ugly but unevil being. <em>Kavaṃ</em> is seen to our left while <em>khyāḥ</em> to our right in paintings in cloth that are used as <em>dhakiṃ</em>, a curtain that covers a window-like structure that may contain three wrathful eyes representing <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a>. It can be found painted on the wall to the right of the main entrance of a temple in Kathmandu valley. For example, this can be observed at Śvetabhairava temple (<a href="https://danam.cats.uni-heidelberg.de/report/1e4bfd8c-dc8a-11e9-81a8-0242ac140006" target="_blank" rel="noopener">LAL0100</a>) located in Ikhālakhu and Khapĩchẽ Bhairava temple (<a href="https://danam.cats.uni-heidelberg.de/report/a5df6af2-eb05-11e9-b125-0242ac130002" target="_blank" rel="noopener">LAL1780</a>) located in Khapĩchẽ Ṭola, Patan. In the Newar oral tradition, <em>kavaṃ</em> is regarded as a tall entity who strolls at midnight with <em>khyāḥ</em>, picks up humans from inside the house if windows are open and kills them. But if someone can hit it hard, break it into pieces of bones and run away with one major piece, then <em>khyāḥ</em> will come and offer large amount of wealth to the person in exchange for that piece of bone. Once <em>khyāḥ</em> gets the bone back, he rebuilds <em>kavaṃ</em> again and they move on.</p>
1aa25478-fa5c-47b8-b69b-f9ccf2029f5f	āgaṃ thyāke	 आगं थ्याके	<p>var. <em>āgã thyāke</em>; n. 1) a ritual of introducing infants to the family deity on the day of the first feeding of solid food. 2) a special worship performed at the family <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> to induct newly married bride into the family by getting her to offer a <a href="../meaning/793d51f4-882d-4e4a-86c6-b925ac3cbd98/" target="_blank" rel="noopener"><em>kisali</em></a> to the <em>āgaṃdyaḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 36-37).</p>
08b18b67-a95a-4b3b-be66-f1a1a009fdd8	casalāḥju	  चसला:जु	<p>[New.] var. <em>casilāḥ āḥju</em>, <em>casilāḥju</em>; n. <em>hon</em>. spiritual preceptor of a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>; oldest Vajrācārya of the <em>bāhāḥ</em>. The term originates from a mix of Sanskrit and Newar terms <em>cakreśvara āḥju</em>, which refers to the title Buddha. After being inducted to <em>daśapāramitā āḥju</em> (10 seniormost elders), each elder represents one <em>pāramitā</em> (perfection). With each elder passing away, the elder below him gets promoted a position up. Each promotion implies accomplishment of one <em>pāramitā</em>. Becoming a <em>casalāḥju</em>, therefore, means to attain Buddhahood after accomplishing all ten <em>pāramitā</em>s in terms of action, but not in terms of knowledge as done by the Buddha himself. In the <em>Vajrayāna</em> tradition, the concept behind the induction of <em>daśapāramitā āḥju</em>s is to enable a person to become the Buddha in a single life.</p>
7905baa8-f0fb-469d-b63c-ec63ec6b3790	bare chuigu	      बरे छुइगु	<p>var. <em>bande luigu, bare chuyegu</em>; v. a monkhood initiation ritual (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 170). It is mandatory for all Śākya and Vajrācārya boys to go through this initiation ritual; in doing so, they are officially recognised as members of the <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>saṃgha </em></a>(monastic association) of their respective <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> or <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>. Initiation in a monastery also means membership to it, i.e. the right and duty to participate in the monastery's recurrent functions (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/TJX3TK6V/library" target="_blank" rel="noopener">Gellner 1992</a>: 163). The initiation ritual signifies the boy's entrance into the Theravāda tradition and sees him lead the life of a monk for four days. During this period, he wears a <em>cīvara</em> (robe) until the fourth day, when he renounces the <em>cīvara</em> in a ritual called <em>cīvara kvakāygu</em>, locally known as <em>cyaḥ kvakāygu</em>. This ritual signifies that the boy has now entered into the Mahāyāna tradition. A <em>Nau</em> (a person from the barber caste) shaves the boy's head in the most important part of this ritual. The boy's <em>ninipāju</em> (his father's sister's husband) must then shave off his <em>āṅsa</em> (a tuft of hair at the center of the head). The removal of the <em>āṅsa</em> signifies a break with the system of the four <em>varṇas</em>. This procedure is also called <em>cuḍākarma</em> and <em>pravrajyāvrata</em>.</p>
f18a33ab-7e79-4414-a5ef-36a462ebbef4	Kubera	कुबेर	<p>n. mostly associated with wealth, he is one of the semi-mythical beings called <a href="../meaning/601f68e4-2ab1-42ed-9656-33aa9f826c52/" target="_blank" rel="noopener"><em>yakṣa</em></a>s. Considered as the greatest among the <em>yakṣa</em>s, who according to the Hindus, lives in the north along with the <em>yakṣa</em> hordes. The name of his capital is said to be Alakāpuri adjacent to Mount Kailāśa in the Himalayan region (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 379).</p>
60cb8a43-0800-4aba-8b72-eed832bd5987	bahīdyaḥ	     बहीद्यः	<p>n. in general, <em>bahīdyaḥ</em> refers to any image of Buddhist deities including other relics and artifacts that are put on display once a year in respective monasteries during the holy month of <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a> (July-August). However, the annual exhibition known as <em>bahīdyaḥ bvaygu</em> is mostly dominated by large images of <a href="../meaning/Dīpaṅkara/" target="_blank" rel="noopener">Dipaṅkara</a> Buddha. Such images are primarily a large heavily ornamented head with two palms. They are set on to a wooden frame made in a way that a person can remain inside to carry the larger-than-life image. The body of the image is clothed with brocade embroidered with gold thread. Such images are locally known as <em>Kuyāmpāṃju</em>. It is not clear why such images are called <em>bahīdyaḥ</em>, which tends to wrongly describe them as the deities of <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>, as such exhibitions are held in <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>s as well. Probably it is <em>bahiridyaḥ</em> meaning 'the deities that are brought out' of their monastic confinements for public view. The dates for this annual exhibition vary from one monastery to another, but it usually starts from the 10th of the bright fortnight of <a href="../meaning/cb906d38-016b-47d0-92bc-a8fdd8c3e821/" target="_blank" rel="noopener">Śrāvaṇa</a>.</p>
9b874fa8-c7e0-4484-b710-30d89a831ae7	kaciaḥpā	  कचिअ:पा	<p>n. unbaked brick. <em>Kaciaḥpā</em> has ritual significance in the Newar tradition. A <em>yajñaśālā</em> (hearth for performing fire oblation) is always made of <em>kaciaḥpā</em>. In the case of a death in the family, a set of three <em>kaciaḥpā</em> is discarded at the nearby <a href="../meaning/40a25dde-2936-4183-a871-7c3ff5e80dcc/" target="_blank" rel="noopener"><em>chvāsa</em></a>. The tradition is called <em>kaciaḥpā vāygu</em>, which is an offering to the spirit of the deceased in the form of a hearth that is done immediately after the death. It is believed that the spirit will use the <em>kaciaḥpā</em> for a hearth (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/handling%20death/titleCreatorYear/items/MDPHVDSR/item-list" target="_blank" rel="noopener">Gutschow et al. 2005</a>: 29).</p>
cdde7d77-8446-4ee7-8a8e-9be385287dc3	batu	 बतु	<p>n. brace and bit (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 269). A tool used for drilling by carpenters.</p>
568c8f9b-bd96-4c84-9cc9-5899236aafd9	āṃkhvarā	आंख्वरा	<p>var. <em>āmkhorā, āmkhvarā;</em> n. 1) water pot without a spout that is used for drinking usually made of brass or clay.</p>\n<p>2) baluster (lit. sater pot pattern).</p>
2b21bab6-ce62-4564-8ace-8b6db905138b	āḥju	   आ:जु	<p>[fr. S. <em>ārya</em>] var. <em>āju</em>; n. seniors/elders of a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> or <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>. Most of the major <em>bāhāḥs</em> have 10 <em>āḥjus </em>locally known as <em>Daśapāramitā Āḥju</em>, who represent the 10 perfections (<em>pāramitā</em>). When one of them passes away, the <em>āḥju </em>next in line replaces him while a new <em>āḥju </em>is inducted as the tenth <em>āḥju</em>. The induction of a new<em> āḥju </em>is done based on the seniority in terms of age. The promotion in position also marks the accomplishment of a perfection and being inducted to the senior-most position marks the attainment of Buddhahood not in terms of knowledge but in terms of actions.The senior-most <em>āḥju</em>, also called <em>Cakreśvara āḥju</em>, has the responsibility of performing the daily rituals and all other worships at the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ </em></a>of the <em>bāhāḥ</em>.</p>
4904516c-25e1-4601-855e-b94ace341ae4	ājudyaḥ	 आजुद्यः	<p>n. 1) the main deity. 2) the oldest and most senior deity of the country; e.g. Bāgha <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a> is considered as the <em>ājudyaḥ</em> of Kirtipurians (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 38). Similarly, the large head image of Ākāśa Bhairava at Vaṃghaḥ (Indrachok) in Kathmandu is revered as the <em>ājudyaḥ</em> of Kathmandu. 3) hon. grandfather (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 11).</p>
ba9b1fbf-92c9-462c-b0a3-1695a45a1343	Bhailaḥdyaḥ	  भैलःद्यः	<p>[fr. S. Bhairavadeva] var. Bhairaḥdyaḥ, Bhairāḥdyaḥ, Bhailaḥdyaḥ, Bhelu; n. God Bhairava, the wrathful manifestation of Lord <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a>. Bhairava is revered as the male consort of the <a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a>. Correspondingly, a set of eight Bhairavas are considered to be the masters of the four cardinal and four intermediate directions. These are as follows: Asitāṅga (E), Ruru (SE), Caṇḍa (S), Kroḍha (SW), Unmatta (W), Kapāla/Kapālīśa (NW), Bhīṣaṇa (N) and Saṃhāra (NE) (Kölver 1976: 71). Occasionally, Bhailaḥdyaḥ is represented by two wrathful eyes with a third eye above and a <em>khadga</em> (sword) / <em>triśūla</em> (trident) / <em>khatvāṅga</em> (magic wand) between the two main eyes. Some of his major shrines in the Kathmandu Valley represent him with a cloth painting or a mural image. Bhailaḥdyaḥ is also known as Savaḥ, whilst Bhailaḥdyaḥ and Kumārī are known together as Savaḥbhakku.</p>
598444c7-396d-4310-9b32-ba22dce83a41	Cathāḥ	 चथा:	<p>n. a minor festival marked by worshipping the moon on the fourth of the bright fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a>. <em>Cathāḥ</em> literally means 'the fourth day' of the lunar calendar in old Newari. People remain indoors on the evening of <em>Cathāḥ</em> with the belief that seeing the <em>Cathāḥ</em> moon might result in a person being falsely accused of theft. They eat dry fried legumes in the evening. The day is also known as <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a> Caturthī, the day when Lord Gaṇeśa was born.</p>
b266cfad-ce2e-475b-bbf6-10aec94e032c	Saptapura Mahāvihāra	सप्तपुर महाविहार	<p>var. Saptapur Mahavihar; Sanskrit name of <a href="../meaning/07a0125b-4a4c-40e6-b539-8d2353ab7723/" target="_blank" rel="noopener">Cikaṃ Bahī</a>.</p>\n<p>Old name [Occurance]: Saptapurī Vihāra [<a href="../../../report/f9b69b3e-88a0-4008-8391-abab2afc13dc" target="_blank" rel="noopener">LAL_4108_0001</a>]</p>
4c71ead3-0319-4c15-b791-2f4016c94aa9	Haugaḥ Bāhāḥ	हौग: बाहा:	<p>var. Hauga Baha; n. a Buddhist monastery in Patan that lies few meters south from Mangal Bazaar to the west of the street to Lagankhel.</p>\n<p>Old name [Occurance]: Hastināgala Mahāvihāra; Hastināga Vihāra [<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/5A9SNX3X/library" target="_blank" rel="noopener">Locke 1985</a>, 229]; Hātīgala Vihāra [<a href="report/75dc395a-1401-4067-a7e9-49555b6eca00" target="_blank" rel="noopener">LAL_2670_0008</a>]</p>\n<p><!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG/>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves/>\n  <w:TrackFormatting/>\n  <w:PunctuationKerning/>\n  <w:ValidateAgainstSchemas/>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF/>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables/>\n   <w:SnapToGridInCell/>\n   <w:WrapTextWithPunct/>\n   <w:UseAsianBreakRules/>\n   <w:DontGrowAutofit/>\n   <w:SplitPgBreakAndParaMark/>\n   <w:EnableOpenTypeKerning/>\n   <w:DontFlipMirrorIndents/>\n   <w:OverrideTableStyleHps/>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"/>\n   <m:brkBin m:val="before"/>\n   <m:brkBinSub m:val="&#45;-"/>\n   <m:smallFrac m:val="off"/>\n   <m:dispDef/>\n   <m:lMargin m:val="0"/>\n   <m:rMargin m:val="0"/>\n   <m:defJc m:val="centerGroup"/>\n   <m:wrapIndent m:val="1440"/>\n   <m:intLim m:val="subSup"/>\n   <m:naryLim m:val="undOvr"/>\n  </m:mathPr></w:WordDocument>\n</xml><![endif]--><!-- [if gte