07734ba3-4482-4dc0-be30-a7bda0ec102f	caitya	 चैत्य	<p>[S.] n. widely known among the Newars as <em>cibhāḥ</em> or <em>cibhāḥdyaḥ</em>, <em>caitya</em> is the most common monument found in the Kathmandu valley. It is a Buddhist votive structure that is taken as a three-dimensional <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>mandaḥ</em></a>. The origination of <em>caitya</em> is believed to be a funeral monument or cenotaph that were not necessarily associated with Buddhism. Later there was a rise in tradition of worshipping a sepulchral monument called <em>caitya</em> that contained a relic of the Buddha buried underneath. Similar trend continued later in honor of other Buddhist monks as well, which eventually converted <em>caitya</em>s into a Buddhist monument. There are three types of <em>caitya</em>s: 1. <em>śārīrika</em> (<em>dhātu</em>) - a <em>caitya</em> that contains a relic of the Buddha or Buddhist monk buried underneath, 2. <em>paribhoga</em> - a <em>caitya</em> that contains objects that the Buddha used during his lifetime, 3. <em>dharma</em> - a <em>caitya</em> that has the Buddhist scriptures and miniature <em>caitya</em>s called <em>lucidyaḥ</em> buried underneath, and 4. <em>uddeśya</em> – a votive <em>caitya</em> constructed with an objective or purpose like eternal peace of one's deceased parents, protection from natural calamities, deliverance from sufferings, etc. (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/AAAFCKMW/library" target="_blank" rel="noopener">Śākya 1993</a>: 5-13). Compare <a href="../meaning/d082a037-83e2-412c-a4b4-71485feee8ee/" target="_blank" rel="noopener"><em>stūpa</em></a>.</p>
cb906d38-016b-47d0-92bc-a8fdd8c3e821	Śrāvaṇa	श्रावण	<p>[S.] var. <em>Sāuna</em>, <em>Sāun</em>, <em>Sāvana </em>(Nep.); n. fourth month of the solar calendar adopted by the Vikrama era that corresponds to July-August.</p>
