Table 2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. a <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a></em> that is home to <em>jina</em> (the Buddha); <em>caitya</em> that has the images of the <em><a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener">pañcabuddha</a></em> (except <a href="../meaning/d5ce7e1e-b0fa-44a6-a831-a541f8b20c41/" target="_blank" rel="noopener">Vairocana</a>) featured prominently. Images of <a href="../meaning/504909e8-0ade-4497-abd0-d58e091d36af/" target="_blank" rel="noopener">Akṣobhya</a> (east), <a href="../meaning/4b0c06a4-80e0-4429-8039-3b2929ef952c/" target="_blank" rel="noopener">Ratnasambhava</a> (south), <a href="../meaning/0516f979-9d32-49ce-80ec-5bd695955311/" target="_blank" rel="noopener">Amitābha</a> (west) and <a href="../meaning/0ce1986d-ee1d-4818-afcf-6fcf31bc0b1d/" target="_blank" rel="noopener">Amoghasiddhi</a> (north) can be seen occupying a major portion of the caitya that has a relatively smaller dome on top.</p>
0108b518-a483-4560-9948-bc72849f4f90	Hāratī	 हारती	<p>var. Hārati Mātā, Hāritī Ajimā; n. Goddess Hāratī; a Buddhist deity who protects children from illness. She was born in the <a href="../meaning/601f68e4-2ab1-42ed-9656-33aa9f826c52/" target="_blank" rel="noopener"><em>yakṣa</em></a> (semi-divine being) clan and was persuaded by the Buddha to protect children especially from smallpox. There is a shrine of Hāratī at the Svayambhū Caitya premise where a sitting image of her with five children can be seen. She sits with her left leg bent and the right leg stepping down on a lotus. Her left hand holds a child on her lap while her right hand can be seen exhibiting a <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada</em></a> posture. In Hindu tradition, Goddess Śitalā is also worshipped with similar objective and she is also seen with children in her images in Nepal.</p>
19d514f6-ab58-4d8f-9575-b8f05a4221a2	Sakimanā Punhi	सकिमना पुन्हि	<p>n. the full moon day of <a href="../meaning/595d9eb4-1430-4593-99a2-219660fc33f8/" target="_blank" rel="noopener">Kārtika</a>. The Newars observe a minor festival with the same name on this day and consume <em>hi</em> (sweet potato) and <em>saki</em> (arum root) on this day. Various figural designs of <em><a href="../meaning/bfda0750-5fb6-40af-a87f-15739ec36fb5/" target="_blank" rel="noopener">pūrṇakalaśa</a>,</em> etc. made out of <em>halimali</em> (dry-heated grains and legumes) are exhibited at monastic buildings and shrines on this day. The exhibition is known as <em>halimali bvaygu.</em> The tradition of offering <a href="../meaning/28b017ef-7966-4bbb-b886-610e657c5307/" target="_blank" rel="noopener"><em>ālamata</em></a> that starts from the previous full moon called <a href="../meaning/953f6989-6957-41e1-ae0e-b7864e5be46e/" target="_blank" rel="noopener">Kati Punhi</a> also comes to an end on this day<em>;</em> syn. Sakimilā Punhi, Hisaki Punhi, Halimali Punhi.</p>
5340ae49-fb92-4022-9053-3283a7ac3e80	khaḥ	 ख:	<p>var. <em>khata</em>; n. 1) chariot; ceremonial palanquin. A huge chariot like that of <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> as a whole is also called <em>khaḥ</em>, but the railing of the chariot is called <em>khaḥjalā</em>. Smaller chariots like that of Kumāri from Kathmandu and <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a> in Bhaktapur are called <em>dyaḥkhaḥ</em>. A ceremonial palanquin for the <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a> ritual of the elderly is called <em>jaṃkokhaḥ</em>, which is also referred to as <em>ghirighirikhaḥ</em>.</p>\n<p>2) scaffolding.</p>
8a978406-98d3-4148-baf5-8b5b13962971	ḍiṭṭhā	डिट्ठा	<p>var. <em>ḍīṭṭhā</em>, <em>ḍiṭhā</em>; n. a civil servant ranking above a <em>mukhiyā</em> and lower than a <em>subbā </em>during the Rāṇā and Śāha period (cf. <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/ludwig/titleCreatorYear/items/MN6VAPFC/item-list" target="_blank" rel="noopener">Stiller 1981</a>, 379). According to <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/edwards/titleCreatorYear/items/7U2DNN7W/item-list" target="_blank" rel="noopener">Edwards</a> (1975, 107), <em>ḍiṭṭhās </em>originally had been the judges who presided over the court in Kathmandu but later could serve in number of other offices, such as the Kausī, the Hāttisāra or the Sadara Daphtarakhānā (cf. also <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/6ZF7Z785/library" target="_blank" rel="noopener">Kumar 1967</a>, 165). The <em>Nepālikabhūpavaṃśāvalī</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/nepalika/titleCreatorYear/items/RLA2AXR2/item-list" target="_blank" rel="noopener">NBhV</a>, vol. II, 101) suggests that <em>ḍiṭṭhās </em>were given responsibility of the finance section of the royal court during the Malla period.</p>
