n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. Newar drum that looks like a <a href="../meaning/249fb246-140c-4af6-8c32-baf4d68dd043/" target="_blank" rel="noopener"><em>nāykhiṃ</em></a>, but is larger in size. It is also a double-headed drum covered with leather on both sides that does not contain <em>khau</em> (black tuning spot) on either side. The right side is played by a stick while the left side is played by the palm. It is played in accompany of <em><a href="../meaning/6a7ecb0c-bfde-4fc1-ac5c-6187eca35224/" target="_blank" rel="noopener">bhusyāḥ</a>.</em> <em>Dhāḥ</em> is usually referred to as <em>guṃlābājaṃ,</em> the instrument played during <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a>, and is associated with mostly the Newar Buddhist communities; syn. <em>dhāḥbājaṃ</em>, <em>dhāḥbājā.</em></p>
3cc936ab-092d-49b1-b05d-43fdee8490d8	ardhaparyaṅka	     अर्धपर्यङ्क	<p>[S.] the “half cross-legged” posture (<a href="../meaning/dd349648-a5e4-48fe-9e1f-d6d72c5590f2/" target="_blank" rel="noopener"><em>āsana</em></a>) practised in meditation. Also called <em>māhārājalīlā</em>, it is a particular <em>āsana</em> of sitting with both legs on the same pedestal, but one of the knees is raised while the other is bent in the usual position of a Buddha (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 432). The regular <em>ardhaparyaṅka</em> posture shows serenity while dancing in this posture displays wrath and horror (Bhattacharyya 1958: 390); see <a href="../meaning/35a51611-26c8-4600-b1d0-3beb0822b4b5/" target="_blank" rel="noopener"><em>paryaṅka</em></a>.</p>
7d492ec0-08ce-4f4c-9151-b129e9a4098c	Cvachẽ	च्वछेँ	<p>var. Cochẽ, Chwachhen; lit. house in uptown or house at an elevated area, it is a name of a place in Patan.</p>\n<p>Old name [Occurance]: Coche [<a href="../report/bb7faf70-abe2-469e-af49-155168b3fc7a" target="_blank" rel="noopener">LAL_1780 _0002</a>; <a href="../report/ae526be3-ff4a-4fd1-a2d3-a7303c606080" target="_blank" rel="noopener">LAL_1700_0001</a>]</p>
5aa03fe4-2e17-4b9b-b8aa-f102a581315e	mudrā	मुद्रा	<p>[S.] n. mystic pose of hand or hands. Some of the <em>mudrā</em>s can be shown by one hand, such as the <em>varada</em>, <em>abhaya</em>, etc. while others require both hands such as <em>añjalī</em>, <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra</em></a>, and many others. In the Sādhanāmālā, there are descriptions of an overwhelming number of <em>mudrā</em>s. But it is very difficult to comprehend them unless actually explained by the priest (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 437). The <em>mudrā</em>s are nothing but the manifestation of the <em>Bodhicitta</em>, the will to enlightenment. For instance, if protection is needed, <em>Bodhicitta</em> is conceived as the <a href="../meaning/1912063a-4393-47ac-b05c-1d51a636172c/" target="_blank" rel="noopener"><em>abhaya mudrā</em></a>; if boon is desired it becomes <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada</em></a>; when instruction in Buddhist Law is required it becomes <em>dharmacakra mudrā</em> (Bhattacharyya 1958: 393).</p>
66940c3a-749a-4985-a3b8-e8f8ac85dcc4	kalaśa	 कलश	<p>[S.] var. <em>kalasa</em>; n. 1) holy water vase with a stem of <em>dvāphvaḥsvāṃ</em> (a kind of scentless white jasmine) dipped in the holy water placed inside it and covered by a <a href="../meaning/793d51f4-882d-4e4a-86c6-b925ac3cbd98/" target="_blank" rel="noopener"><em>kisali</em></a>. A <em>kalaśa</em> of metal is used in worships and rituals. But during rituals like <a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener"><em>jaṃko</em></a> and <a href="../meaning/459c956c-7b3c-4cf7-afca-f5f83fc836a4/" target="_blank" rel="noopener"><em>ihī</em></a> and at times of performing fire oblation, eight clay pots collectively known as <em>aṣṭakalaśa</em> with a painting of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a> images are used as <em>kalaśa</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 83). The use of <em>kalaśa</em> in pair for welcoming Buddhist monks, newly wedded bride and groom, etc. symbolizes auspiciousness in the Newar tradition. The pair of <em>kalaśa</em> is known as <em>dvālyā kalaśa </em>that are placed on both sides of a marked space in front of the entrance where the welcoming takes place. In this case, the pair of <em>dvālyā kalaśa</em> also receive a three-legged metal seat called <em>may</em>.</p>\n<p>2) one of the eight emblems of <em>aṣṭamaṅgala</em>.</p>\n<p>3) bell-shaped segment of a finial of a temple made of gilt copper.</p>
3a0964aa-913e-4184-ae95-932e20dc3db5	gaṃchi	गंछि	<p>[fr. S. <em>gaṇa</em>] var. <em>gãchi</em>; n. the whole group of deities, a god together with his vehicle and his own special party (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 43); a term mostly used while identifying a complete group of all the deities of the respective group that accompany the main deity for the exhibition of their mask dance. For instance, the <em>gaṃchi</em> of Pacalī <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a>, who is the main deity of the group that includes Siṃhinī, Vyāgrinī, <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a>, along with the <a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a> deities who dance together in the Pacalī Bhairava dance.</p>
1d656404-eb8f-431d-b479-403da44aa88b	dhaḥmā	  ध:मा	<p>[fr. New. <em>dharamā</em>] n. the shaft used for steering a chariot (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 240); a shaft that passes through the chariot between the wheels and which is upturned at one end. There is always a painting of <a href="../meaning/ba9b1fbf-92c9-462c-b0a3-1695a45a1343/" target="_blank" rel="noopener">Bhailaḥdyaḥ</a> covered by a well-made gilt copper image of the same deity on the face of the upturned part of the <em>dhaḥmā</em> of <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> (Red Matsyendranātha). The <em>d</em><em>haḥmā</em> itself is considered to represent Karkoṭaka Nāgarāja, the serpent deity who, according to legend, stretched itself across a river from one end to another so that the King, his priest and his porter were able to cross the river with Bungadyaḥ. The water of the river had fantastical properties and turned everything which touched it into stone: as such, it was known as as <em>Śilā Nadi, </em>the stone river. After helping the trio, the serpent deity also sought to cross the river, but accidentally dipped the tip of his tail in the water. The part that touched the river immediately turned into stone and fell off. It is for this reason that the other end of the <em>dhaḥmā</em> does not have a pointed tip like a serpent’s tail; syn. <em>ghaḥmā</em>.</p>
1e10902f-0508-4edb-bd3d-a6bba2def825	bāhāḥ	 बाहाः	<p>[fr. S. <em>vihāra</em>] var. <em>bahāra</em>, <em>bahāla</em>, <em>bāhāra</em>, <em>bāhāla</em>; n. a Buddhist monastery (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 327). The term <em>bāhā</em> is a corruption of the Sanskrit term <em>vihāra</em>. The word went through various modifications: <em>vihāra</em> &gt; <em>vahāra</em> &gt; <em>bāhāra</em> &gt; <em>bāhāla</em> &gt; <em>bāhāl</em> &gt; <em>bāhā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/locke/titleCreatorYear/items/5A9SNX3X/item-list" target="_blank" rel="noopener">Locke 1985</a>: 3). There are two types of <em>bāhāḥ</em>: the main (<em>mū</em>) <em>bāhāḥ</em>, and the branch (<em>kacā</em>) <em>bāhāḥ</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/gellner%20/titleCreatorYear/items/TJX3TK6V/item-list" target="_blank" rel="noopener">Gellner 1992</a>: 167-168). A principal deity called <a href="../meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>, a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> in front of the main deity and a shrine of esoteric deity often placed upstairs in an enclosed room are the crucial elements of a Newar Buddhist monastery. Unlike in a <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>, a <em>bāhāḥ</em> does not have a flight of stairs leading to the main entrance, but is guarded by two lions (<em>siṃha</em>). There is no circumambulatory passage to the main shrine, but main <em>bāhāḥ</em>s may have a <em>digi</em>, a building with a large hall for meeting and feasting that may stand within the <em>bāḥāḥ</em> complex or separately.</p>
07a0125b-4a4c-40e6-b539-8d2353ab7723	Cikaṃ Bahī	चिकं बही	<p>var. Chikan Bahi, Chikan Bahil; vernacular name of one of the major Buddhist monasteries (<a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>) in Patan also known by its Sanskrit name Saptapura Mahāvihāra.</p>\n<p>Old name [Occurance]: Cikuna Bahiri [<a href="../../../report/f9b69b3e-88a0-4008-8391-abab2afc13dc" target="_blank" rel="noopener">LAL_4108_0001</a>]</p>
c928de13-2155-48fd-aa64-235a31a4e799	pāneju	पानेजु	<p>[New.] var. <em>pāñju</em>; n. priests of <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> (Rāto Matsyendranātha). They hail from Buṅgamatī and belong to the Vajrācārya and Śākya castes. Their organization, <em>Śrī</em> 32 <em>Pāneju Saṃgha</em>, looks after the roll of serving at the deity's shrine for each member of the organization, which has 32 seats. One seat belongs to <em>Śrī</em>, the Buṅgadyaḥ himself, and the remaining 31 seats go to 24 Śākya <em>pāneju</em>s and 7 Vajracārya <em>pāneju</em>s of Buṅgamatī. In case of the death of a <em>pāneju</em>, a Śākya <em>pāneju</em> is replaced by another Śākya and a Vajrācarya by another Vajracārya <em>pāneju</em>. The Guṭhī Saṃsthāna office of Patan carries out the appointment of a new <em>pāneju</em> known as '<em>pāneju baḍhābaḍha</em>' in an auction-like manner, where the highest bidder for a <em>salāmī</em> gets the vacant seat. At times, when there were more than one aspirant for the vacant post, the bidding went up to hundreds of thousands of ruppes.</p>
cfd541db-a125-4448-b69d-9a834e700e5a	Bhīmasena Ekādaśī	भीमसेन एकादशी	<p>var. Bhīma <em>ekādaśī</em>, <em>Bhiṃkādaśī</em>; the eleventh of the bright fortnight of <a href="../meaning/063dae1f-37d1-43b9-bf33-5ff3bd435678/" target="_blank" rel="noopener">Māgha</a> is observed as <a href="../meaning/e5348c05-8e9e-4045-acdd-af85b443190b/" target="_blank" rel="noopener">Bhīmasena</a> <em>Ekādaśī</em>. The following day, i.e. the twelfth of the bright fortnight of Māgha, a procession is taken out in Patan that goes round the city and devotees offer various items at 22 shrines of Bhindyaḥ, the local name for Bhīmasena. Till 2012, this procession was taken out on the ninth of the dark fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a> (Aug-Sep), the same day an image of Bhindyaḥ from the Bhīmasena Mandira in Patan Durbar Square (<a href="https://danam.cats.uni-heidelberg.de/report/3b68c5ca-e64a-11e9-b125-0242ac130002" target="_blank" rel="noopener">LAL1380</a>) is also taken round the city on a chariot in the evening. In 2013, the procession in late August was postponed for five months and was taken out in early February in 2014. Since then the annual procession in honour of Bhindyaḥ is taken out on the day after the Bhīmasena <em>ekādaśī</em>.</p>
