2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. Vajrajoginī; n. an important deity in the Buddhist tradition, who can be seen in three forms. In one form, she is headless and carries her own head while in another form, her head is intact. Her headless form is yellow in color, who carries in her left hand her own head severed by herself with her own <a href="../meaning/845aa05b-1009-4f23-b221-ce554bd4b266/" target="_blank" rel="noopener"><em>kartṛ</em></a> held in her right hand. She is nude, and her right leg is stretched while the left is bent down. She is accompanied by two Yoginīs on either side of her. She also has two other forms: the red and the yellow. In the red form, she stands in <a href="../meaning/634662c3-731d-4864-9530-d7cb383ab2c4/" target="_blank" rel="noopener"><em>ālīḍha</em></a> attitude, rides a corpse, is nude and has three eyes with protruding belly and tongue. She carries <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a> in her left hand a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a> in her right, while a <a href="../meaning/80bda275-3951-43a4-8333-83ca2351ff18/" target="_blank" rel="noopener"><em>khaṭvāṅga</em></a> hangs from her left shoulder. In her yellow form, she carries a <em>kartṛ</em> and <em>kapāla</em> while other features are identical to the red form (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 248). The Hindus burrowed Vajrayoginī from the Buddhist pantheon and incorporated her into their own as <a href="../meaning/80d52d0e-67e0-495c-a48b-327458276bb4/" target="_blank" rel="noopener">Chinnamastā</a> (Bhattacharyya 1958: 1). She is known as Ucheyma in the Tibetan tradition. There are two temples, one in Sakva (Sankhu) and the other in Phampi (Pharping), dedicated to her in the Kathmandu Valley.</p>
9ebc2fda-c7dc-45f1-89e7-ef41eceb1ffd	māne	माने	<p>var. <em>mānyā</em> (vernacular); n. prayer wheel; a cylindrical object of prayer that is covered from both ends with a handle on one side and has a six-lettered Buddhist matra '<em>Om ma ṇi pad me huṃ</em>' embossed on its body. Small <em>māne</em>s are carried by followers of Tibetan Buddhism who continuously turn it while reciting the six-lettered mantra. Larger <em>māne</em>s are installed around the Buddhist shrines where devotees come to turn them. The hollow body of a <em>māne</em> is usually filled with mantras printed thousands of times on paper. One full turn of a <em>māne</em> is believed to equal the recitation of the mantra for as many times as it is printed on papers that are stored inside. <em>Māne</em>s are usually made of brass but there are examples of wooden <em>māne</em>s, which can be seen at the temple of Hāratī Mātā at Svayambhū Caitya.</p>
ae7cef1a-6be1-40bc-911a-504aa6ac21be	Bārāhī	 बाराही	<p>n. a sub-caste of carpenters (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 175). Bārāhīs are the carpenters of <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> (Rāto Matsyendranātha). There are other carpenter castes in Newar community like Sthāpita, Sĩkaḥmi, Śilpakāra. But only Bārāhīs have the right to construct the chariot. They also carry out the <a href="../meaning/e8e81092-cc6a-4b7a-ab5c-7cc03b168e62/" target="_blank" rel="noopener"><em>digupūjā</em></a> (the worship of lineage deity) of Buṅgadyaḥ. The <em>digupūjā</em> is observed for four consecutive days during the chariot festival of Buṅgadyaḥ, the longest festival of Nepal.</p>
b1fb118e-2e42-4926-8447-d99cbb02691d	Cakvāḥdyaḥ	  चक्वा:द्य:	<p>var. Cākabāhāḥdyaḥ, Cākuvādyaḥ, Cukaḥbāhāḥdyaḥ, Cakvādyaḥ; n. vernacular name of Mīnanātha. He is enshrined as the main deity of the Mīnanātha temple (<a href="../../report/93b01588-d2f1-11e9-8411-0242ac140006" target="_blank" rel="noopener">LAL2770</a>) on the premises of Taṃgaḥ Bāhāḥ (<a href="../../report/63987fea-cd6d-11e9-92b4-0242ac140002" target="_blank" rel="noopener">LAL2780</a>). He is also known as Jaṭādhārī Lokeśvara, a name which references his <em>jaṭā</em> (matted hair). His chariot procession is held annually together with the <a href="../meaning/4a583261-770e-4ea1-8ceb-4cc733d539f5/" target="_blank" rel="noopener">Buṅgadyaḥ</a> procession in Patan. The Newars worship Cakvāḥdyaḥ as Yama-āryāvalokiteśvara, the rescuer of all beings suffering in hell (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/J25NG45V/library" target="_blank" rel="noopener">Vajrācārya 2003</a>: 2). Depictions of Cakvāḥdyaḥ show the deity with two arms, both of which are extended down to his waist. His right hand is shown performing the <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada</em></a> gesture whilst his left hand performs the <a href="../meaning/2d29b70a-933e-4483-a62a-5bb9f2e0005d/" target="_blank" rel="noopener"><em>karaṇa</em></a> posture (Vajrācārya 2003: 7).</p>
669079d4-2a69-4821-91ca-a176520ce1ce	capāḥ	 चपा:	<p>[fr. New. <em>capārha </em>/ <em>capari</em> /<em> capariṃ</em> / <em>capāra</em> / <em>capāla</em>] n. a roofed resting place, now called <em>dharmaśālā</em>, rest-house (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 113); a ceremonial <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā </em></a>(rest house) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 31); a community-owned building used for organising feasts or community meetings, found exclusively in <a href="../meaning/ae3f0f86-d2a5-422d-af4b-b5f92e2a8182/" target="_blank" rel="noopener"><em>jyāpu</em></a> localities. A <em>capāḥ</em> usually takes the form of a two-storey building with an open ground floor. The upper floor is spacious, and is used to host annual feasts of the <a href="../meaning/e42b0c1a-12e1-41ef-a1e7-a2a4dd4e0978/" target="_blank" rel="noopener"><em>sanāḥguthi</em></a> (funeral trust) of the local <em>Jyāpu</em>s. The open space on the ground floor of such monuments also serves as a temporary stop for an image of a deity to rest or shelter for the night during a procession.</p>
fb26622d-8223-4d30-b009-57df006db18a	cathāḥdyaḥ	 चथा:द्य:	<p>n. 1) the moon as seen on the fourth day of the bright fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a>.</p>\n<p>2) a man as clever as a thief; a cheater (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VQ5ZDBWQ/library" target="_blank" rel="noopener">Manandhar et al. 1986</a>: 56).</p>
df8c44cd-c75a-466f-8f6f-31b785f9b1f1	Saṅkaṭā 	 संकटा	<p><!-- [if gte mso 9]><xml>\n <o:DocumentProperties>\n  <o:Version>16.00</o:Version>\n </o:DocumentProperties>\n <o:OfficeDocumentSettings>\n  <o:RelyOnVML></o:RelyOnVML>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>NE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:BreakWrappedTables>\n   <w:SnapToGridInCell></w:SnapToGridInCell>\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\n   <w:DontGrowAutofit></w:DontGrowAutofit>\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val="Cambria Math"></m:mathFont>\n   <m:brkBin m:val="before"></m:brkBin>\n   <m:brkBinSub m:val="--"></m:brkBinSub>\n   <m:smallFrac m:val="off"></m:smallFrac>\n   <m:dispDef></m:dispDef>\n   <m:lMargin m:val="0"></m:lMargin>\n   <m:rMargin m:val="0"></m:rMargin>\n   <m:defJc m:val="centerGroup"></m:defJc>\n   <m:wrapIndent m:val="1440"></m:wrapIndent>\n   <m:intLim m:val="subSup"></m:intLim>\n   <m:naryLim m:val="undOvr"></m:naryLim>\n  </m:mathPr></w:WordDocument>\n</xml><![endif]--><!-- [if gte mso 9]><xml>\n <w