>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"></w:LsdException>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"></w:LsdException>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. a deity revered as the reliever of crises (<em>saṅkaṭa</em>) including all forms of fears, ill-fate and obstacles. Therefore, he is popularly knowns as Saṅkaṭā, but is also referred to as Caṇḍaroṣaṇa, Mahācaṇḍaroṣaṇa, Caṇḍamahāroṣaṇa and Acala. He is one-faced, two-armed and is squint-eyed. His face appears terrible with bare fangs. He wears a jeweled headdress, bites his lips and wears on his crown a garland of severed heads. His eyes are slightly red, and he carries the sword in his right hand and a noose round the raised index finger against the chest in the left. His sacred thread consists of a white snake; he is clad in tiger-skin and wears jewels. His left leg touches the ground while the right is slightly raised. He bears on his crown an effigy of <a href="../meaning/504909e8-0ade-4497-abd0-d58e091d36af/" target="_blank" rel="noopener">Akṣobhya</a>, as Saṅkaṭā is believed to have emanated from him (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 154-155). Although the tantras mention that he is always represented in yab-yum, his image at the <a href="../meaning/f0ac0a85-9fb9-4744-80dc-6c84d296b648/" target="_blank" rel="noopener">Ilā Nani</a> Digi (<a href="../../report/04e62546-0b04-41d7-9651-12189c45e5c6" target="_blank" rel="noopener">LAL1090</a>) is represented singly.</p>
9cf90c73-7608-44fc-beb4-981d7c540e9f	kalaḥ	कल:	<p>var. <em>kalāṃri</em>,<em> kalaṃ</em>, <em>kvalaṃli</em>; n. basket made of wicker or brass with a lid and a handle for storing and transporting ritual items. A <em>kalaḥ</em> is used mostly for esoteric worships at the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> of a monastery, Kumhaḥ (Kumārī) pujā or <a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a> deities at various <em>pīṭha</em>s. Items like <a href="../meaning/67a48449-1b93-451f-ae64-021366c96009/" target="_blank" rel="noopener"><em>samay</em></a> (a set of food items with small pieces of meat, ginger, black soybeans, dry-heated beaten rice called <a href="../meaning/428a0772-c085-4d9f-885d-930043e57a3e/" target="_blank" rel="noopener"><em>syāḥbaji</em></a>, etc.), <a href="../meaning/ae175c99-b039-446a-9fa3-87756f63a2a1/" target="_blank" rel="noopener"><em>aylāḥ</em></a>, <em>thvã</em> (beer made of rice or millet), <em>khāy</em> (yogurt seasoned with salt and mustard oil), etc. necessary for an esoteric worship. A simple <a href="../meaning/cefee9c1-f48e-486c-b437-d12c3dbc47c0/" target="_blank" rel="noopener"><em>pujābhaḥ</em></a> (a tray of worship items like flowers, incense, rice, etc.) suffices regular worships.</p>
b30eeaf4-81f7-4794-97c9-decba80d2463	padma	    पद्म	<p>[S.] n. 1) a lotus, especially the Nelumbium Speciosum (not the plant itself, but the flower which closes towards the evening; often confounded with the water-lily or Nymphaea Alba) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 584). 2) iconographically, a lotus, which may be of any color except blue. The blue lotus is designated by the word <em>utpala</em> or <em>nīlotpala</em>. In tantric works, <em>padma</em> is the day lotus while <em>utpala</em> stands for the night lotus. When the lotus shows petals in both upper and lower directions, it is called <em>viśvapadma</em> or double lotus. <em>Padma</em> indicates purity of descent (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 437). Philosophically, <em>padma</em> symbolizes purity and cleansed nature that one must aspire to attain in the sense that one must not allow the environment around to change one's nature just as a lotus blooms out from dirty water but manages to keep itself clean. 3) the form or figure of a lotus made of stone that marks up the space in a <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> on which the <a href="../meaning/053f8040-79ef-4662-8c32-dc185fb9dffb/" target="_blank" rel="noopener"><em>thapāḥju</em></a> sits for rituals that require fire oblation. Small figure of <em>padma</em> of stone or brass is placed in front of a house to mark as its <a href="../meaning/214005a1-99b9-4b73-9121-caf1887ce97f/" target="_blank" rel="noopener"><em>pikhālakhu</em></a>. 4) one of the symbols of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a> referred to as <em>puṇḍarika</em>.</p>
47794909-6cb4-449a-9d35-269d697f021d	kacābāhāḥ	  कचाबाहा:	<p>n. branch of a Buddhist monastery (<a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>). A <em>kacābāḥāḥ</em> refers to a <em>bāhāḥ </em>whose <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>saṃgha</em></a> (the monastic association) is not independent but considered a part of the <em>saṅgha </em>of the main <em>bāhāḥ </em>where initiations take place (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/buddhist%20monasteries%20of%20Nepal/titleCreatorYear/items/5A9SNX3X/item-list" target="_blank" rel="noopener">Locke 1985</a>: 9). However, there are exceptions, as initiations do take place in some of such <em>kacābāhāḥ</em>s.</p>
63a4e521-052f-4fbf-920b-13e3cb7ed2bb	dharmadhātu maṇḍala	धर्मधातु मण्डल	<p>n. a <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>mandaḥ</em></a> <em>(maṇḍala)</em> widely found in the monastic buildings and courtyards of the Kathmandu Valley and  may also be referred to as <em>dhārmadhātuvāgīśvara maṇḍala. Dharmadhātu maṇḍala</em> usually have an octagonal base with statues of eight <a href="../meaning/ed9a093b-9054-4be2-bcca-7c2a5cd742fb/" target="_blank" rel="noopener">Lokeśvara</a>s topped by the <em>maṇḍala</em> upon a double-decked lotus. The central deity of this <em>maṇḍala</em> is Dharmadhātuvāgīśvara, from which the <em>maṇḍala</em> takes its name. Iconographically, Dharmadhātuvāgīśvara is seen in many forms, but he is usually represented as a deity with eight arms and four-faces. His two main hands carry a bow and an arrow, whilst the second pair holds a noose and a goad, the third a book and a sword, and the fourth a bell and a <em><a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener">vajra</a>.</em> Another form depicts him exhibiting the <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra mudrā</em></a> with his first pair of hands instead of holding a bow and an arrow; here, the second pair also holds an arrow and a vessel instead of a noose and a goad (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 103).</p>
fc70b680-5d99-4541-961f-8fad56859b3f	daśakarma	दशकर्म	<p>n. lit. the ten actions; the ten rites of passage performed amongst the Buddhist Newars. The concept behind performing these rites is to purify and consecrate a human life both physically and spiritually. <em>Daśakarma</em> includes the 10 ceremonial rites beginning from the birth of a baby among the Buddhist Newars in general and Vajrācāryas and Śākyas in particular. The 10 rites of passage are: 1. <em>Jāti abhiṣeka/Jātābhiṣeka</em> (the rites of birth), 2. <em>Nāmābhiṣeka</em> (naming ceremony), 3. <em>Annaprāśanāhiṣeka</em> (rice-feeding ceremony), 4. <em>Cuḍākarmābhiṣeka</em> (rites of the first initiation inducts a boy to the <em><a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener">saṃgha</a>),</em> 5. <em>Vajrābhiṣeka</em> (rites of the second higher initiation, which authorizes the initiate to be a member of a Vajrācārya <em>saṃgha),</em> 6. <em>Svayamvarābhiṣeka</em> (matrimonial ceremony), 7. <em>Dikṣābhiṣeka</em> (secret initiation which entitles entry into the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> of the monastery), 8. <em>Sthavirābhiṣeka</em> (initiation of the <em><a href="../meaning/2b21bab6-ce62-4564-8ace-8b6db905138b/" target="_blank" rel="noopener">āḥju</a>),</em> 9. <em>Bhīmarathābhiṣeka (<a href="../meaning/916d2741-6605-40f5-bcab-07d27eb4431a/" target="_blank" rel="noopener">jaṃko</a>),</em> and 10. <em>Cakreśvarābhiṣeka</em> (initiation of <em><a href="../meaning/08b18b67-a95a-4b3b-be66-f1a1a009fdd8/" target="_blank" rel="noopener">casalāḥju</a>)</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/2BAQQQNZ/library" target="_blank" rel="noopener">Vajracharya 2010</a>: 25-26).</p>
4a583261-770e-4ea1-8ceb-4cc733d539f5	Buṅgadyaḥ	 बुङ्गद्य:	<p>[New.] var. Buṃgadyaḥ; n. lit. the deity of Buṅga (Buṅgamatī), Buṅgadyaḥ is the most popular name of the Red Matsyendranātha among the people of both Buddhist and Hindu faith. Buṅgadyaḥ is revered as the deity of compassion, rain and abundance. Bungadyaḥ is probably the only deity to have two separate temples that are home to the same idol. The idol of Bungadyaḥ is placed half a year in Taḥ Bāhāḥ (<a href="https://danam.cats.uni-heidelberg.de/report/6a2ca05c-3aaa-11ea-b44d-0242ac130006" target="_blank" rel="noopener">LAL0060</a>) and in Bungamati (<a href="https://danam.cats.uni-heidelberg.de/report/24afe176-f66a-11e9-a3c8-0242ac130002" target="_blank" rel="noopener">BUN0001</a>) for the other half of the year. Also known as Padmapāṇi Lokeśvara and Raktāryāvalokiteśvara, Bungadyaḥ is one of the four <a href="../meaning/bbbbf03b-7dd0-4bcf-9825-ba299ebf9862/" target="_blank" rel="noopener">Karuṇāmaya</a>s, the deities of compassion, of the Kathmandu Valley. The people of the Nāth cult and the Hindus worship him as Matsyendranātha, a variation of the name Machindranātha - the guru of Gorakhanātha. King Narendradeva, priest Bandhudatta and porter Rathacakra (Lalita Jyāpu) are credited for bringing Buṅgadyaḥ to the Kathmandu valley from Kāmarukāmākṣa (Assam). The dating of the event is confusing, as many sources give different dates. But many scholars believe that it took place during the reign of <a href="../meaning/f67f58f1-3839-4d81-95a6-4b78e97566ce/" target="_blank" rel="noopener">Licchavī</a> King Narendradeva (643-679 CE) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/%C5%9A%C4%81kya/titleCreatorYear/items/DCZ93BEZ/item-list" target="_blank" rel="noopener">Śākya 1127 NS</a>: 12). A 32 cubit-tall chariot is taken round the city of Patan every year in honour of the deity. The chariot procession is known as Buṅgadyaḥ <em>Jātrā</em>, which draws charioteers and revellers in thousands of number. A similar chariot festival of Buṅgadyaḥ with comparatively smaller chariot is observed in Dolakhā as well.</p>
