Priority="52"\n   Name="List Table 7 Colorful Accent 1"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 2"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 2"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 2"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 2"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 2"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 2"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 2"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 3"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 3"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 3"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 3"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 3"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 3"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 3"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 4"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 4"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 4"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 4"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 4"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 4"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 4"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 5"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. <em>Ñayāḥ</em>, <em>Yãnyāḥ, Yãyāḥ, Yẽyāḥ;</em> n. a jubilant festival observed in the Kathmandu Valley around August-September when the cities in the valley come to life with a traditional form of extravagant street festivals. With the erection of <em><a href="../meaning/eae61da1-58bc-4919-b1e0-3dc477b5b41a/" target="_blank" rel="noopener">yaḥsĩ</a></em> in Basantapur on the 12th of the bright fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a>, <em>Yẽnyāḥ</em> festival officially begins in Kathmandu and concludes on the 4th day of the dark fortnight of <a href="../meaning/857baa5b-09dd-413c-9b3c-256e0f27934c/" target="_blank" rel="noopener">Āśvīna</a> after the <em>yaḥsĩ</em> is hauled down. Poles are erected at most of the localities with an image of Yamāḥdyaḥ (Indra), while head images of <a href="../meaning/0f329aaa-3860-456a-ab1b-39e6fb8c17dd/" target="_blank" rel="noopener">Hāthudyaḥ</a> are also displayed at various places. Many revelers throng the images of Hāthudyaḥ to drink the alcoholic beverages discharged from the spout set on the mouth of the image. Chariots of Kumārī, <a href="../meaning/93dcf3c9-c606-4be9-be9d-6593ad95b9f3/" target="_blank" rel="noopener">Gaṇeśa</a> and <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a> are also taken round the city while many other processions are also taken out during the period. In Patan, <em>Yẽnyāḥ</em> begins on the 13th of the bright fortnight of Bhādra and is observed for four days. Four quarters of the city observe the festival on four separate days.</p>
0e8717f7-f449-443c-87dc-08e2317b5e5f	thapāḥju luigu	थपा:जु लुइगु	<p>var. <em>thapāḥju luyegu</em>; v. inauguration of a <em><a href="../meaning/053f8040-79ef-4662-8c32-dc185fb9dffb/" target="_blank" rel="noopener">thapāḥju</a>;</em> a ceremony held after the death of the incumbent <em>thapāḥju</em> in which the <a href="../meaning/2b21bab6-ce62-4564-8ace-8b6db905138b/" target="_blank" rel="noopener"><em>āḥju</em></a> who is second in line to the position takes on this role.</p>
55bb0257-45c7-432b-bd93-270c14f90954	bahī	   बही	<p>[fr. New. <em>bahiri]</em> var. <em>bahili;</em> n. a Buddhist monastery in which celibate monks live, usually located on the city outskirts (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 322). Architecturally, the four sides of a <em>bahī</em> courtyard are generally only partially enclosed and it is often possible to walk around the back of the main <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/" target="_blank" rel="noopener">Śākyamuni</a> shrine using a special circumambulatory passage (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/gellner%20/titleCreatorYear/items/TJX3TK6V/item-list" target="_blank" rel="noopener">Gellner 1992</a>: 167). The main entrance is usually the only way to access the ground floor and is generally accessed via a flight of stairs (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/locke/titleCreatorYear/items/5A9SNX3X/item-list" target="_blank" rel="noopener">Locke 1985</a>: 5).</p>
c86ea9a9-f68a-4835-b7bc-583c456a957f	bali	    बलि	<p>[S.] (New. <em>bau</em>) n. 1) any offering or propitiatory oblation (especially an offering of portions of food, such as grain, rice etc., to certain gods, semi-divine beings, household divinities, spirits, etc.) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 723). In the Buddhist context, <em>bali</em> is the renunciation of worldly attachments triggered by the five sensory organs. The Newar concept of offering rice grains, flowers, incense, sweets, etc. to a deity is a symbolic act of renunciating attachments or dislikes triggered by <em>rūpa</em> (form), <em>śabda</em> (sound), <em>rasa</em> (taste), <em>gandha</em> (smell) and <em>sparśa</em> (touch).</p>\n<p>2) grains or food offered to deceased ancestors or deities; an offering of water alongside small portions of the food that one is about to consume before having lunch in memory of one's deceased parents.</p>\n<p>3) items like rice, turmeric, salt etc. placed in a <em>bvaḥtā</em> (small bowl made of leaves) that is left at the <a href="../meaning/214005a1-99b9-4b73-9121-caf1887ce97f/" target="_blank" rel="noopener"><em>pikhālakhu</em></a> (a marked spot in front of the main entrance outside the eaves of roof) or the <a href="../meaning/40a25dde-2936-4183-a871-7c3ff5e80dcc/" target="_blank" rel="noopener"><em>chvāsa</em></a> (an area designated for ritually discarding certain items at times of death, birth and warding off spirits), as advised by divine healers when one feels sick.</p>\n<p>4) certain items that are ritually discarded in order to ward off evil spirits after a worship at a house to mark the completion of its construction (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 423).</p>\n<p>5) an animal sacrifice; among the Buddhist Newars, a duck's egg is offered as a substitute to an animal sacrifice.</p>
94c19cc9-a99f-4df1-8ef1-e0cd0983326a	pādukā	पादुका	<p>n. lit. shoe or slipper; an impression of the feet of any deity usually made of stone.</p>
c331e9f2-46f1-4ce0-9a0d-9fd90de46925	pañcabuddha	 पञ्चबुद्ध	<p>n. lit. the five Buddhas, who are also referred to as <em>pañcatathāgata</em> (five Tathāgatas) or <em>pañcadhyānībuddha</em>s (the five meditating Buddhas). They are: Vairocana, Akṣobhya, Ratnasambhava, Amitābha and Amoghasiddhi. They are the most prominent of all deities found on <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>s of the Kathmandu Valley. Vairocana (var. Vailocana) is white in color, who exhibits <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra mudrā</em></a>, represents water of <em>pañcatattva</em> (five basic elements) and resides in Vajradhātu <a href="../meaning/42fb6b7e-7f69-4839-8f36-4e3297bf16ee/" target="_blank" rel="noopener">Bhuvana</a>. His position is at the center and therefore usually not seen on <em>caitya</em>s. But when he does appear, he is enshrined at the south-east corner as seen on the Svayambhū Caitya. His vehicle is lion. Akṣobhya is blue in color, who exhibits <a href="../meaning/48efa4b7-4f19-4c25-bd3f-c752ca1b7dbd/" target="_blank" rel="noopener"><em>bhūmisparśa mudrā</em></a>, represents the sky (space) and resides in Abhirati Bhuvana. He faces east and rides an elephant. Ratnasambhava is yellow in color, who exhibits <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada mudra</em></a>, represents earth and resides in the Ratnavati Bhuvana. He faces south and rides a horse. Amitābha is red in color, who exhibits <a href="../meaning/b4ffbe50-7bcd-4f50-a3e5-887b8170b73b/" target="_blank" rel="noopener"><em>dhyāna mudra</em></a>, represents fire and resides in the Sukhāvati Bhuvana. He faces west and rides a peacock. Amoghasiddhi is green in color, who exhibits <a href="../meaning/1912063a-4393-47ac-b05c-1d51a636172c/" target="_blank" rel="noopener"><em>abhaya mudra</em></a>, represents air and resides in the Amoghavati Bhuvana. He faces north and rides a <a href="../meaning/774586ee-7cf6-4533-969c-474181dbb222/" target="_blank" rel="noopener"><em>Garuḍa</em></a>. On his remarks on the <em>pañcabuddha</em>, Gellner states that unlike Śākyamuni and the supposedly historical Buddhas of the other world eras, the <em>pañcabuddha</em>s do not appear as human beings. They are, in a sense, cosmic principles. All aspects of the universe can be classified in a pentadic fashion, under the heading of one or other of the <em>pañcabuddha</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/the%20nepalese%20caitya/titleCreatorYear/items/TMRR73VW/item-list" target="_blank" rel="noopener">Gutschow 1997</a>: 13).</p>
92c18b60-16a1-41ec-bb0d-bb0178e057c5	Mārgaśīrṣa	मार्गशीर्ष	<p>[S.] var. <em>Mārga</em>,  <em>Maṅsira</em>/<em>Muṅsir </em>(Nep.); n. the eighth month of the solar calendar abopted by the Vikrama era that corresponds to November-December in which the full moon enters the constellation <em>Mṛga-śiras</em>.</p>
8e22dec9-e889-4be1-9213-1b6e3a63403a	Pūcva	पूच्व	<p>var.Pūco, Puchwa, Pulchok/Pulchowk (Nep.); n. lit. a mound [outside] a city, it is a place in Patan where the Aśoka Stūpa West (<a href="../../../../../report/ccfc9e0a-70ea-11ea-966a-0242ac130006" target="_blank" rel="noopener">LAL0610</a>) is situated.</p>\n<p>Old name [Occurance]: Pulacva/Pulaco [<a href="../../../../../report/653b692d-ec63-4f85-86f6-b204a46c65d8" target="_blank" rel="noopener">LAL_1100_0004</a>]</p>
de91e2d6-0af2-4c7f-a87a-01e2e2c286eb	pramāṇa	प्रमाण	<p>var. <em>pramāna</em>; n. authority, ministerial post in the Malla period (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 302).</p>
06dcd0d9-836a-4d8c-b9f5-86351d739f32	Aparamitā	अपरमिता	<p>var. Aparimitā; another form of <a href="../meaning/0516f979-9d32-49ce-80ec-5bd695955311/" target="_blank" rel="noopener">Amitābha</a> Buddha that is worshipped especially for the longevity of life. Unlike his plain form as one of the <a href="../meaning/c331e9f2-46f1-4ce0-9a0d-9fd90de46925/" target="_blank" rel="noopener"><em>pañcabuddha</em></a>s, Amitābha in this form is seen richly clad in various ornaments. He sits in <a href="../meaning/b4ffbe50-7bcd-4f50-a3e5-887b8170b73b/" target="_blank" rel="noopener"><em>dhyāna mudrā</em></a> and carries an ambrosia vase, which is richly decorated and from its cover fall four strings of beads that represent sacred pills (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/72NKF3UH/library" target="_blank" rel="noopener">Sakya 2000</a>: 58).&nbsp; Aparamitā is also known as Amitāyusa or Buddha Amitāyusa-the Buddha of limitless life.</p>
fd4fe012-3475-4ffc-b1a0-5a8f7830b199	ardhamudita	अर्धमुदित	<p><strong>[to be revised]</strong></p>
a22c0aa1-6e98-49a3-94b8-3cd30ee9b634	śikharakūṭa caitya	शिखरकूट चैत्य	<p>[S.] n. a type of <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> that is found in the highest number compared to any other forms of <em>caitya</em>s in the Kathmandu Valley, its name comes from the <em>caitya</em>'s resemblance to the Indian <a href="../meaning/a6c9b246-2dd4-4b59-891d-dffc39dc249f/" target="_blank" rel="noopener"><em>śikhara</em></a>-styled temples. Its base storey in the shape of a cube houses <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener">Bodhisattva</a>s in the niches, above which is the whole upper structure with the roof-like covering, a thinner upper storey topped by the lotus throne, the drum, dome and finial. Its prototypes came into being at the end of the <a href="../meaning/f67f58f1-3839-4d81-95a6-4b78e97566ce/" target="_blank" rel="noopener">Licchavi</a> period in the eighth century and took a definitive shape by the middle of the 17th century after passing through many stages of development (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/the%20nepalese%20cai/titleCreatorYear/items/TMRR73VW/item-list" target="_blank" rel="noopener">Gutschow 1997</a>: 215).</p>
d327db7d-ce65-4882-a06d-4a13d284e69b	bhābo	भाबो	<p>n. a medieval term that refers to the <a href="../meaning/ae3f0f86-d2a5-422d-af4b-b5f92e2a8182/" target="_blank" rel="noopener"><em>jyāpu</em></a> community.</p>
