7901aee7-bb65-4883-8c46-02ab2054d327	mohara	मोहर	<p>n. monetary unit equivalent to two eight-<a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener"><em>ānā</em></a> silver coins, four <a href="../meaning/2865d637-f58d-4399-9aae-eed2a42c0a2c/" target="_blank" rel="noopener"><em>sukā</em></a>s, 16 <em>ānā</em>s or 64 <a href="../meaning/4b8b39b9-9191-4ee0-b68c-c90c53ffb291/" target="_blank" rel="noopener"><em>paisā</em></a>s.</p>
fedc6269-2782-4f61-98c7-e5fb4b6de3fe	khyāḥ	ख्या:	<p>[New.] var. <em>khyāka</em>; n. humanoid goblin that frightens people who is usually seen together with a <a href="../meaning/1fd23de1-7fca-463e-b5df-ba2702ce5c4a/" target="_blank" rel="noopener"><em>kavaṃ</em></a>. <em>Khyāḥ</em> is seen to our right in paintings in cloth that are used as a <em>dhakiṃ</em> (curtain) that covers a window-like structure that may contain three wrathful eyes representing <a href="../meaning/1a64c0f0-7fcb-4a20-afb0-c783c9e6f561/" target="_blank" rel="noopener">Bhairava</a>. It can be found painted on the wall to the left of the main entrance of a temple in the Kathmandu Valley. For instance, this can be observed at Śvetabhairava temple located in Ikhalakhu and Khapĩchẽ Bhairava temple located in Khapĩchẽ Ṭola, Patan (see, <a href="../../../report/1e4bfd8c-dc8a-11e9-81a8-0242ac140006" target="_blank" rel="noopener">LAL0100</a> and <a href="../../../report/a5df6af2-eb05-11e9-b125-0242ac130002" target="_blank" rel="noopener">LAL1780</a>). According to TDN (s.v. <em>khyāk</em>) people believe that black <em>khyāḥ</em> is a bad spirit, whilst white <em>khyāḥ</em> is a good one.  In the Newar oral tradition, <em>khyāḥ</em> is regarded as a fat, long-haired, short and ugly creature with hairy skin, round eyes and long dark-red tongue. In the traditional Newar paintings, <em>khyāḥ</em> is seen attending to Lakṣmī, the deity of wealth, by carrying a large overflowing bag of coins. Also associated with wealth, he is believed to be afraid of light and dwell in the dark corners of <em>baigaḥ</em> (attic) and come out to play with balls of gold at night. Stories of smart people getting rich by obtaining riches from <em>khyāḥ</em> were very popular in the past: a person would hide in the dark with a light covered by a basket. When <em>khyāḥ</em> came out to play with his golden balls, the person would remove the cover to expose the <em>khyāḥ</em> to the light. The <em>khyāḥ</em> would then disappear immediately and the person would collect all the gold. There are four types of <em>khyāḥ</em> known to the Newars: a. <em>bāḥrhāḥ khyāḥ</em> - a small white image of cotton made in the shape of a human that is worshipped and placed in the room of the girl undergoing <em>bāḥrhāḥ</em>, the puberty ritual. Some believe that he comes to life and plays with the girl during her ritual confinement of 12 days; b. <em>bhakuṃgvārā khyāḥ</em> - a <em>khyāḥ</em> with the shape of a football, who rolls around a narrow alley to block the way of a passerby; c. <em>dhāpalāṃ khyāḥ</em> - a hairy <em>khyāḥ</em>; and d. <em>lãpaṃ khyāḥ</em> - another <em>khyāḥ</em> who blocks the way in such a manner that a passerby collides head-on into a wall even when he knows that there is a way.</p>
035d657b-190c-4b63-831a-d9b41ce83430	chvaylābhū	छ्वय्‌लाभू	<p>n. an initial feast (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/3NN736ZK/library" target="_blank" rel="noopener">Śreṣṭhācārya et al. 2054 VS</a>: 105); a feast that is organized ahead of the main feast.</p>
ca010702-8e51-4623-8a36-0bafa9a32007	sīkāḥbhū	सीका:भू	<p>n. a feast organized after an animal sacrifice is offered to any deity and the <a href="../meaning/6e88022b-4703-4340-b7cc-35a66e01093e/" target="_blank" rel="noopener"><em>thakāli</em></a>s (seniors) of the respective <a href="../meaning/a2c86d1a-a308-4dc7-9dad-5f00ec3991e0/" target="_blank" rel="noopener"><em>guthi</em></a> get a share of the parts of the sacrificed animal's body, especially the head (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 572).</p>\n<p>&nbsp;</p>
0909813c-5896-424f-9fd1-14a6c4689bd4	jābhū	जाभू	<p>n. a feast in which cooked rice is served; a feast held for <a href="../meaning/2b21bab6-ce62-4564-8ace-8b6db905138b/" target="_blank" rel="noopener"><em>āḥju</em></a>s during worships at a monastery in which cooked rice is offered (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 218).</p>
29cf2cde-4151-4ce1-8a3c-93619d976939	dhvaja	ध्वज	<p>[S.] n. 1) flag, banner, ensign. 2) one of the eight emblems of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a>.</p>
b320c351-ed99-4ffc-82b1-003792200724	caturvāhū	चतुर्वाहू	<p>[S.] n. four-armed.</p>
a8e69791-6cb2-4229-9872-f46fda606cb3	sukimāḥ	सुकिमा:	<p>[fr. Old New. <em>sukimāra]</em> var. <em>śukimāra, sukīmāra;</em> n. garland of medieval coins worth a quarter of a rupee; see <em><a href="../meaning/2549ca93-ed48-4e86-bc15-ffacaadd2745/" target="_blank" rel="noopener">mvahamāḥ</a>.</em></p>
9d4958f1-2e55-4406-a206-a4edd5eb8178	tolā	तोला	<p>n. a unit of weight and standard measure for gold and silver comprising 11.6638038 grams.</p>
2549ca93-ed48-4e86-bc15-ffacaadd2745	mvahamāḥ	म्वहमा:	<p>[fr. Old New. <em>mohamāra</em>] var. <em>mohamāḥ, mvahamāla, mvaḥmāḥ;</em> n. garland of medieval coins usually made of silver; see <em><a href="../meaning/a8e69791-6cb2-4229-9872-f46fda606cb3/" target="_blank" rel="noopener">sukimāḥ</a>.</em></p>
e1e43a4f-2fe9-4954-92ed-26f4686b35c4	bhāro	भारो	<p>var. <em>bhārha</em>; adj. venerable, respectable, Lord. n. 1) a term of address for the nobility in Medieval Nepal Valley (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 353). 2) member of the rural nobility in the medieval Kathmandu Valley (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/whelpton/titleCreatorYear/items/LXCX9RXR/item-list" target="_blank" rel="noopener">Whelpton 2005</a>: 259)</p>
d3e864be-3566-4f1a-994c-2001d9fb8bcf	Nyākhā Cuka	न्याखा चुक	<p>var. Nyakha Chuka, Nyāḥcuka; lit. a courtyard of five houses, it is a large courtyard north of Naka Bahī (<a href="../../../report/e3074532-e806-11e9-8bc4-0242ac130002" target="_blank" rel="noopener">LAL0880</a>) in Patan.</p>\n<p>Old name [Occurance]: Ṅākhācuka [<a href="../../../report/cea31364-013a-4779-a365-551b86ad7b18" target="_blank" rel="noopener">LAL_1100_0001</a>]</p>
c84c2b60-7d0e-41eb-bff8-e5a386874353	nani	ननि	<p>[New.] var. <em>nanī</em>; n. courtyard; a large courtyard enclosed on all four sides by private buildings but may also include a monastery on one side. A relatively small courtyard enclosed by only four or five houses is called <em>cuka</em>. There are no specific numbers of houses that make a courtyard a <em>nani</em> or <em>cuka</em>. But it appears that a courtyard with more than a dozen houses enclosing it is called a <em>nani</em>. There are exceptions like in the case of Nyāḥcuka of Patan, a very large courtyard with dozens of houses, but its name identifies it as a <em>cuka</em>. It is believed that the area had only five houses and hence was named Nyāḥcuka or Nyākhā Cuka - a courtyard of five houses. Such courtyards are the center of Newar social life. Most of these brick-laid <em>nani</em>s serve as space for the <em>nani</em> residents to dry paddy after harvest, for children to play, for senior citizens to reflect upon their life with their fellows, etc.</p>
8ef7f468-3341-47f5-92ba-b0662327d6b8	yajñopavīta	यज्ञोपवीत	<p>[S.] var. <em>yagyopawita</em>; n. the Sacred Thread; the investiture of youths of the three twice-born castes with the sacred thread or, in later times, the thread itself that is worn diagonally over the left shoulder and hanging down under the right (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 840); syn. <a href="../meaning/147d4b9c-f71c-466e-a82c-b6f1cfed0426/" target="_blank" rel="noopener"><em>janai</em></a>.</p>
e6d36457-4c0e-4def-ba4a-a7b4896a9007	Micchu Bāhāḥ	मिच्छु बाहा:	<p>n. a <em><a href="../meaning/47794909-6cb4-449a-9d35-269d697f021d/" target="_blank" rel="noopener">kacābāhāḥ</a></em> of Kvāḥ Bāhāḥ of Patan.</p>\n<p>Old name [Occurance]: Caityavarṇa Mahāvihāra [<a href="../../../report/653b692d-ec63-4f85-86f6-b204a46c65d8" target="_blank" rel="noopener">LAL_1100_0004</a>], Michu Vihāra [<a href="../../../report/011c487d-d4f3-4b4a-8e9f-0929a0d01d2a" target="_blank" rel="noopener">LAL_1100_0003</a>]</p>
f4c60d1a-2368-42d8-aa1a-cb1ad39d1eae	mukuṭa	मुकुट	<p>[S.] n. a tiara, diadem, crown (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 819).</p>
648a2837-2339-405a-8af1-e7e802bc7ade	modakapātra	मोदकपात्र	<p>[S.] n. a <a href="../meaning/30a7a569-0c61-446a-af88-b815d8d2377e/" target="_blank" rel="noopener"><em>pātra</em></a> containing <em>modaka</em> (small round sweetmeat locally known as <em>laḍḍu</em>). It is usually seen being held by <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a>.</p>
60e924f8-afca-4961-b512-f77b5c54505b	pitṛ	पितृ	<p>[S.] var. <em>pitri</em>; n. deceased ancestors of an individual or progenitors of mankind in general. <a href="../meaning/4c3d1462-7609-4bbb-baff-e4720fc158b8/" target="_blank" rel="noopener"><em>Śrāddha</em></a> ritual is performed in honour of such ancestors and the oblation to them is called <a href="../meaning/fc089e2d-a21b-48b9-b58f-c5a91c041757/" target="_blank" rel="noopener"><em>piṇḍa</em></a>.</p>
ef6257a3-11b0-4655-b8bb-bbaa5facda68	prastha	प्रस्थ	<p>[S.] var. <em>pra</em>; n. 1) a particular weight and measure of capacity (= 32 <em>pala</em>s or = ¼ of an <em>āḍhaka</em>; or = 16 <em>pala</em>s = 4 <em>kuḍava</em>s = ¼ of an <em>āḍhaka</em>; or = 2 <em>śarāva</em>s; or = 6 <em>pala</em>s; or = 1/16 of a <em>droṇa</em>) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 699). 2) A volumetric unit; 32 <em>prastha</em>s = 1 <em>mānikā</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 386). Also called <em>paṃ</em> or <em>paṃchi</em>, it is also mentioned as <a href="../meaning/518ea6e2-371d-4b1a-8762-57be0f235f82/" target="_blank" rel="noopener"><em>pāthī</em></a>. A tradition of accepting a measure of 4 <em>kuḍa</em>/<em>kuḍava</em>s is equivalent to 1 <em>prastha</em> has continued from the ancient to medieval period and is still being accepted today (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/dhun%CC%87ge/titleCreatorYear/items/5EMKWRIH/item-list" target="_blank" rel="noopener">Ḍhuṅgela and Pradhānāṅga 2056 VS</a>: 236).</p>
4a2fad02-46df-4195-8011-f7e2949dabe6	Amoghapāśa Lokeśvara	अमोघपाश लोकेश्वर	<p>[S.] n. lit. the <a href="../meaning/ed9a093b-9054-4be2-bcca-7c2a5cd742fb/" target="_blank" rel="noopener">Lokeśvara</a> with unerring noose, he is one of the widely-revered Lokeśvaras in the Kathmandu Valley. He is mainly four-faced and eight-armed and stands on a lotus. He carries in his four right hands a <a href="../meaning/bff0ccaa-5703-4d2a-a7ff-d2d6caef57a5/" target="_blank" rel="noopener"><em>vajra</em></a>, sword, goad and bow, while his four left arms carry a <a href="../meaning/7fe1fd8b-9e18-4a5e-b3c6-8529bac35ece/" target="_blank" rel="noopener"><em>ghaṇṭa</em></a>, <em>tridaṇḍī</em>, noose and arrow (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 428). White in colour, he uses the <a href="../meaning/f4de003f-1941-4375-98ff-27a014419b9e/" target="_blank" rel="noopener"><em>pāśa</em></a> (noose) to bind the non-cognizants to draw them toward the path of knowledge. He is one of the eight tutelary deities of the valley, and is frequently represented in sculptures and paintings. People also commission artists to make paintings of Amoghapāśa Lokeśvara to bring long life prosperity and ample progeny to the donor. <em>Aṣṭamī vrata</em>, a worship of Amoghapāśa Lokeśvara on the eighth of the bright fortnight, is an important ritual among the Newar Buddhists that is performed with the muttering of the six-syllable mantra accompanied by ritual touching of the parts of the body and meditation (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/V6KI8AAH/library" target="_blank" rel="noopener">Lokesh Chandra, Vol. 1 2003</a>: 307-308).</p>
9954b314-f7e0-4e2a-9bfc-768ac4318b3c	thanājaḥdhuṃ		<p><strong>[to be revised]</strong></p>\n<p>var. <em>thanājaḥdhuṃ</em>, <em>thanājaḥrhũ;</em> water reservoir, water storage pot with a tap (made of stone) by the road.</p>
631ec54a-ad88-403f-9c4c-9d2ecc57f85c	dyaḥchẽ	  द्य:छेँ	<p>n. 1) lit. a deity's house, a <em>dyaḥchẽ</em> is a building that houses any idol or masks of various deities of certain groups (e.g. <a href="../meaning/c0d8546f-2a57-4e90-8ce2-54f560372923/" target="_blank" rel="noopener"><em>aṣṭamātṛkā</em></a>). Idols are taken round the city at least once a year in a procession, whilst masks are taken out of the <em>dyaḥchẽ</em> at least once a year and used by dancers who perform the dance of the respective group of deities. Unlike a <a href="../meaning/0aeae6c8-ac95-40af-8c7e-3e9ba1e4bb29/" target="_blank" rel="noopener"><em>degaḥ</em></a>, where a deity is permanently enshrined, a <em>dyaḥchẽ</em> mostly serves as a place for idols and items of any mask dance like masks, dresses and jewelry to be stored whilst not in use. However, the four <a href="../meaning/bbbbf03b-7dd0-4bcf-9825-ba299ebf9862/" target="_blank" rel="noopener">Karuṇāmaya</a>s (Matsyendranāthas) of the Kathmandu Valley are exceptions to this; though they are enshrined in a <em>degaḥ, </em>they are also are taken out for chariot processions.</p>\n<p>2) the main building of a monastery that houses its main deity.</p>
ecca97e5-84b3-4232-93f2-65ad4d29b130	bilaṃpau	बिलंपौ	<p>var. bilaṃpati; n. 1) strut with a figural design.</p>\n<p>2) a long, narrow painting on cloth, usually depicting images of various <em>jātaka</em>s and <em>avadāna</em>s, i.e. stories relating to the Buddha's past lives. A single <em>bilaṃpau</em> usually depicts a story of one of the Buddha's many past lives from the beginning to the end. The <em>bilaṃpau</em> of Siṃharasārthavāhū Avadāna displayed in Thã Bahī, Kathmandu is a good example of this. These scroll paintings are usually displayed in various monastic buildings during <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener"><em>Guṃlā</em></a> as part of the <em><a href="../meaning/60cb8a43-0800-4aba-8b72-eed832bd5987/" target="_blank" rel="noopener">bahīdyaḥ</a> bvaygu</em> event. Afterwards, they are rolled up and put back in storage for the rest of the year (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī 1130 NS</a>: 416).</p>
4b8664aa-be05-4fa0-a8bf-6952e0dc3ed6	bhaviṣyavyākaraṇa mudrā	  भविष्यव्याकरण मुद्रा	<p>[S.] n. a standing posture with the left hand bent to hold the <em>cīvara</em> (robe) over one's left shoulder while the right hand is held down in a gesture of <em>varada</em>. It is believed that the <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/">Śākyamuni</a> Buddha first exhibited this posture in announcing that this would be the posture adopted by <a href="../meaning/2906f351-f538-4451-8794-b6c1f8189ec6/" target="_blank" rel="noopener">Maitreya</a> <a href="../meaning/52cb884a-1fc3-4f5b-b20c-06d184f4677f/" target="_blank" rel="noopener">Bodhisattva</a>, the future Buddha. This posture appears to be popular among the Newars only, as it does not seem to be mentioned elsewhere. However, the <em>viśvavyākaraṇa mudrā,</em> translated by Locke (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/5A9SNX3X/library" target="_blank" rel="noopener">1985</a>: 8) as 'explaining the future', could possibly refer to this <em>bhaviṣyavyākaraṇa</em> posture as both terms share the same meaning. Interestingly, the iconography of Maitreya Bodhisattva does not show him in this posture. Rather, he is shown performing the <em>vyākhyāna</em> <em>mudrā</em> (<a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra</em></a>) with two of his hands whilst his other hands perform the <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada mudrā</em></a> and clasp a full-blown <em>Nāgakeśara</em> flower and its branches (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 81). To perform the<em> vyākhyāna</em> posture, one holds two hands against one's chest. This is the gesture that Lord Buddha performed while preaching his first sermon at Sāranātha (Bhattacharyya 1958: 434); it is simply another term for the <em>dharmacakra</em> posture. Images shown standing in the <em>bhaviṣyavyākaraṇa</em> posture are often identified as Maitreya and can be found in many <em>caturvyūha <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a></em>s in the Kathmandu Valley. However, one <a href="../meaning/a22c0aa1-6e98-49a3-94b8-3cd30ee9b634/" target="_blank" rel="noopener"><em>śikharakūṭa</em> <em>caitya</em></a> at Vana Bāhāḥ in Patan contains a notable example of a sitting image in <em>bhaviṣyavyākaraṇa</em> posture. This is also identified as Maitreya (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/TMRR73VW/library" target="_blank" rel="noopener">Gutschow 1997</a>: 50).</p>
e77ec8dc-c5b7-4def-b858-3395edc96ba2	Mahākāla	महाकाल	<p>var. Mahāṃkāla, Mahāṅkāla, Mahāṅkāḥdyaḥ, Māṅkāḥdyaḥ; n. a wrathful deity of protection usually enshrined next to the main entrance inside <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhā</em></a>s and <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>s of the Kathmandu Valley. He is seen in a variety of forms with one face and two, four or six arms, or with eight faces and 16 arms. He is ornamented with serpents, has canine teeth and a protruding belly, and wears a garment of tiger skin. In his two-armed form, Mahākāla is blue in colour having one face with three eyes and carries a <a href="../meaning/845aa05b-1009-4f23-b221-ce554bd4b266/" target="_blank" rel="noopener"><em>kartṛ</em></a> in his right hand and a <a href="../meaning/67c8dd6c-9bb6-45f5-a499-3c9921bd5174/" target="_blank" rel="noopener"><em>kapāla</em></a> in his left. He bears five skulls on his brown hair which rises on his head and is decorated with a chain of severed heads. In his four-armed form, he additionally carries a sword and a <a href="../meaning/80bda275-3951-43a4-8333-83ca2351ff18/" target="_blank" rel="noopener"><em>khatvāṅga</em></a> with his second pair of hands. The six-armed form has a <em>kartṛ</em>, rosary and <a href="../meaning/a0a25d43-66e8-4503-9f19-b74dd06f4abd/" target="_blank" rel="noopener"><em>ḍamaru</em></a> in his right hands and a <em>kapāla</em>, <em>śūla</em> (trident) and <a href="../meaning/f4de003f-1941-4375-98ff-27a014419b9e/" target="_blank" rel="noopener"><em>vajrapāśa</em></a> in his left. The sixteen-armed form has eight faces and four legs. In all of his forms, he tramples upon two human corpses (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 345-346). Locally, he is widely referred to as Māṅkāḥdyaḥ.</p>
994421be-ca6f-493a-aabd-b0dca3b034c2	cheli	छेलि	<p>var. <em>chyali</em>, <em>chẽdi;</em> the ground floor. In the traditional Newar architecture, <em>cheli</em> usually has an open ground floor with <a href="../meaning/99339dd4-e82e-477b-ac56-b8fd930da087/" target="_blank" rel="noopener"><em>dalāṃ</em></a> with the possibility of being used as a shop.</p>
128aa38c-4b9a-4b62-b6e9-53d44326d8c4	Śākyamuni	शाक्यमुनि	<p>n. the name of Gautama Buddha, who was born in Lumbini, Nepal in 563 BC as Prince Siddhārtha, the son of King Śuddhodana and Queen Māyādevī, in the Śākya clan of the Kapilavastu empire. He is seen sitting crosslegged and exhibiting the <a href="../meaning/48efa4b7-4f19-4c25-bd3f-c752ca1b7dbd/" target="_blank" rel="noopener"><em>bhūmisparśa mudrā</em></a>. Iconographically, he is identical to <a href="../meaning/504909e8-0ade-4497-abd0-d58e091d36af/" target="_blank" rel="noopener">Akṣobhya</a>, and is enshrined in the <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a>s and <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>s of the Kathmandu Valley as <a href="../meaning/35bbce88-d716-4b55-9bd0-bfc91bf5fdf5/" target="_blank" rel="noopener"><em>kvāḥpāḥdyaḥ</em></a>.</p>
2e703498-bec7-4dfc-a3e7-60ff422d4deb	pauvālī	पौवाली	<p>var. <em>paubālī;</em> n. a caretaker or guard of a <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a> or <a href="../meaning/0b57733c-31f2-4ca6-a51a-1b06b374733d/" target="_blank" rel="noopener"><em>sataḥ</em></a> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/ZU555U7T/library" target="_blank" rel="noopener">Mālī NS 1130</a>: 374).</p>
75df3e09-6bdd-4dca-a5ed-71efa3b206c2	pravacana	प्रवचन	<p>n. a sermon that is based on a holy scripture or religious literature delivered by a priest or scholar. A <em>pravacana</em> may be an independent programme or a part of a bigger religious service.</p>
44865f8c-26fe-4e29-a6b4-45a7f9bc7a53	ā̃ypā	आँय्‌पा	<p>var. <em>āypā;</em> n. roof tiles.</p>
03c490ac-53db-4cfc-a9cf-09a5e62c08a9	hiti	 हिति	<p>[New.] var. <em>iti</em>, <em>yiti</em> (Old New.), <em>hiṭī </em>(Nep.); n. water spout; a <em>hiti</em> is made of stone but may also have an artistic covering of gold or silver. A <em>hiti</em> covered with gold sheet is called <em>lũhiti</em> (golden spout). If there are more than one spouts at its complex, then the spout with a stone image of Bhagiratha below is considered the main <em>hiti</em>. A <em>hiti</em> complex usually contains a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> and a <a href="../meaning/dabf6234-fd09-4619-a1ac-d14aa3598737/" target="_blank" rel="noopener"><em>śivaliṅga</em></a> as well. <em>Hiti</em> is an example of ancient Newar engineering that brought water from a faraway source to a place where water is needed through a complex intra-canal system. The source of water of most of the <em>hiti</em>s in the Kathmandu valley is not known. Water is transferred from the source through a narrow canal built under the ground maintaining the right amount of slope for the water to flow through. The water flowing through the canal is then met with sharp 90° turns at regular intervals that allow sedimentation of solid particles. Every turn has a small pit filled with fine particles of sand that functions as a filter. Such filters are installed at regular intervals throughout the canal as well. Due to the construction of multi-storey buildings that require going further down for foundation, such intra-canal systems have been destroyed, causing <em>hiti</em>s to stop flowing. Some of the famous <em>hiti</em>s of the Kathmandu valley are <em>Lũhiti</em> (Kathmandu, Patan and Bhaktapur), <em>Sahasrahiti</em> (Pharping), <em>Nīnidhāḥhiti</em> (Bālāju), <em>Gudhāḥhiti</em> (Godāvarī), <em>Nhaydhāḥhiti</em> (non-existing), <em>Nyādhāḥhiti</em> (Hā̃ḍigāũ), <em>Svadhāḥhiti</em> (Jamal), etc. (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/svanigala/titleCreatorYear/items/RSE3N8Z5/item-list" target="_blank" rel="noopener">Śākya 1994</a>: 33-36).</p>
f72994ee-e04b-4c30-83fb-ab16a037adff	ratnanyāsa	रत्नन्यास	<p>[S.] n. ritual deposition of jewels during the construction of a new <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. Upon the base of a <em>caitya</em> under construction, a lotus throne is established with a plate as its top. The plate has 13 cavities <em>(koṣṭha),</em> which are arranged as a <em><a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener">mandaḥ</a>.</em> A deity is projected into each cavity. For each deity, a particular jewel is deposited in its cavity. The ritual, therefore, is known as <em>ratnanyāsa</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/QH65238P/library" target="_blank" rel="noopener">von Rospatt 1999</a>: 124).</p>
e2cca683-cde0-4a3a-8886-c29f8a1b2444	kaḥsimvaḥ	क:सिम्व:	<p>[New.] 1) top of a terrace wall.</p>\n<p>2) cornice brick (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 22). In building architecture, <em>kaḥsimvaḥ</em> bricks are seen among multiple layers of cornice brick patterns and are distinguishable by their floral design or lotus leaf pattern on their square face.</p>\n<p>3) Floral patterns similar to cornice bricks but made of stone found on caityas. Usually, the pattern is seen at the edge of a flat surface that appears to be a <a href="../meaning/7d43e6f5-e8bd-4d3d-8b5a-45b26dae0a06/" target="_blank" rel="noopener"><em>kaḥsi</em></a> (terrace) on which a double-decked lotus throne serves as the base for the drum, dome and finial of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. <em>Kaḥsimvaḥ</em> is not found in <a href="../meaning/f67f58f1-3839-4d81-95a6-4b78e97566ce/" target="_blank" rel="noopener">Licchavi</a> <em>caitya</em>s.</p>
b375bf77-1488-4345-951b-b980a9ba289e	jaymāṃ	जय्‌मां	<p>[fr. S. <em>yajamāna]</em> var. <em>jajamāna/jajumāna</em> (Old New.); n. donor, client of a priest (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/library" target="_blank" rel="noopener">Malla 2000</a>: 141). The person who pays the cost of a sacrifice or the institutor of a sacrifice who, to perform it, employs a priest or priests, who are ofter hereditary functionaries in a family (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 839).</p>
f6ab160e-9c73-4b0e-813d-b40e0d8f652d	Śākta	शाक्त	<p>n. a Hindu cult that worships the mother goddesses, mainly Durgā and her incarnations, along with Pārvatī, Lakṣmī, the <a href="../meaning/9b60ac91-cbb0-48df-9776-949c7e67a27e/" target="_blank" rel="noopener"><em>mahāvidyā</em></a>s, etc. The worship mainly focuses on gaining power to prevail against the enemies, both visible and invisible. It is based on the concept of divine energy (<a href="../meaning/df481572-4fcc-46f7-9e7f-fdf99a763b6c/" target="_blank" rel="noopener"><em>śakti</em></a>) as the activating principle of existence. But Śākta as a recognizable cult cannot be traced before the first half of the present era (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/2WGHSBJU/library" target="_blank" rel="noopener">Stutley and Stutley 1977</a>: 259). Animal sacrifices are observed widely by the followers of this cult, decapitating animals in such a way that at least some amount of blood spurt on the image of the deity.</p>
f40d1a1a-2612-40b9-a250-4b0623b04d7c	Kvaynāpujā	क्वय्‌नापुजा	<p><span style="color: #000000;">[New.] n. the worship of Kvaynā <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a> (<a href="../../../report/48fbbcba-9da1-11ea-82af-0242ac130005" target="_blank" rel="noopener">CHO0100</a>). The Newars of Patan have a tradition of offering a special worship to the Kvaynā Ganedyaḥ after accomplishing a major cultural or social event. The host of the event visit the Kvaynā Ganedyaḥ Temple in Chobhar or alternatively his shrine at Naḥ Ṭola in Patan to offer the worship, which is locally known as <em>Kvaynāpujā vanegu</em>.</span></p>
5e99a464-6fbe-47d0-bd8b-d4790b0e7a51	durgatipariśodhana caitya	दुर्गतिपरिशोधन चैत्य	<p>[S.] n. lit. <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> for the complete elimination of afflictive destinies; a <em>caitya</em> based on <em>durgatipariśodhana <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener">maṇḍala</a>,</em> which has <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/" target="_blank" rel="noopener">Śākyamuni</a> Buddha in the <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra mudrā</em></a> as its central deity (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/BSPVV5PJ/library" target="_blank" rel="noopener">Vajracārya NA</a>: 1). The <em>maṇḍala</em> is based on the <em>Sarvadurgatipariśodhana</em> Tantra, which describes various <em>maṇḍala</em>s of <em>Sarvadurgatipariśodhana</em> cycle in detail and deals with various initiations and consecrations like the rite for pacifying, procuring prosperity, subjugating and overcoming enemies, and several rites for the dead. The teaching of <em>Sarvadurgatipariśodhana</em> Tantra is geared towards procuring a better rebirth for the dead and a better life for those who are living (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/VF37UKH8/library" target="_blank" rel="noopener">Skorupski 1983</a>: vii).</p>
6d6a044e-6f0d-4fc9-a18f-e3d362c90cbb	pā̃ymvaḥ	पाँय्‌म्व:	<p>[New.] n. gold or silver coin stamped with a certain image that may or may not be issued by the authority of a government and is not used as money. Non-government organizations may also issue a <em>pā̃ymvaḥ</em> to commemorate any event like the centennial birth anniversary of an important figure.</p>
208cc185-faa6-4aa4-89c5-7b7282141e61	vaiśya	वैश्य	<p>[S.] n. 1) a community that takes up the occupation of agriculture, commerce, animal husbandry, etc. as per the social condition of the ancient āryas (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Nep%C4%81l%C4%AB%20B%E1%B9%9Bhat%20%C5%9Aabdako%C5%9Ba/titleCreatorYear/items/H9RUQ9IN/item-list" target="_blank" rel="noopener">Parājulī et al. 2010</a>: 1175). 2) third grade in the caste-based Hindu social hierarchy (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Rana%20Polity%20in%20Nepal/titleCreatorYear/items/6ZF7Z785/item-list" target="_blank" rel="noopener">Kumar 1967</a>: 168).</p>
348519e1-d761-4b73-8b99-fe7bb68195f7	sinhaḥ	सिन्ह:	<p>[New.] n. 1) vermillion powder used for putting a circular mark with the tip of a finger or thumb at the centre of the forehead as blessings from elders or deities during festivals and rituals. <em>Sinhaḥ,</em> in general, refers to vermillion powder that is sometimes called <em>hyāũsinhaḥ</em> to categorically mention the colour red. Powders of orange and yellow colours are also used as <em>sinhaḥ</em> on various occasions. They are known as <em>bhuyūsinhaḥ</em> and <em>mhāsusinhaḥ</em> respectively. Rice grains mixed with vermillion powder and curd are also used as <em>sinhaḥ</em> that is known as <em>jākisinhaḥ.</em></p>\n<p>2) a vermillion mark on the forehead.</p>
6c29dadb-0241-44ef-ae99-fa77d136bc79	Maṇigala	मणिगल	<p>var. Maṇigla, Māṇigala, Māṇigla, Mānigvala; n. it is a reference to the Patan Durbar Square, but later it became synonymous to the city of Patan. The first mention of the term Maṇigala comes in an inscription from Kumbheśvara in Patan dated NS 107 (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mahapatra%20/titleCreatorYear/items/627QJNDQ/item-list" target="_blank" rel="noopener">Śākya 2008</a>: 11). The inscription in a statue of Lord <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a>'s family refers to the place as Māṇigvala (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/abhilekha%20sam/titleCreatorYear/items/83FIA3EI/item-list" target="_blank" rel="noopener">Tevārī et al. 2020</a>: 24). </p>
5c45d66c-f89d-4f57-806c-452b69ed27c2	dāma	दाम	<p>var. <em>dām;</em> n. the smallest monetary unit, one-fourth of one <a href="../meaning/4b8b39b9-9191-4ee0-b68c-c90c53ffb291/" target="_blank" rel="noopener"><em>paisā</em></a> (in case of measurements of land etc.) and one-256th of one <em><a href="../meaning/81a46ca0-7234-42f9-86c4-efaee2127d5e/" target="_blank" rel="noopener">mohararupaiyā̃</a>.</em></p>
f86c1919-372c-43b2-af48-0031037a2837	Disi Puja	 दिसिपुजा	<p>var. <em>Diśi Pūjā</em>; n. lit. worship performed on the 10th of a lunar fortnight; <em>disi</em> is an old Newar term that refers to <em>daśamī,</em> the 10th day of the lunar calendar. <em>Disi</em> Puja is an important worship performed by the Śākyas and Vajrācāryas at their private <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> on the 10th and 11th of dark fortnight of <a href="../meaning/9c6b3887-5d93-409f-935d-a85b34f4f5a0/" target="_blank" rel="noopener">Pauṣa</a>. It is believed that after driving water out of the lake to inhabit the valley where Kathmandu is now situated, <a href="../meaning/ea75bca9-710e-42d4-a212-ae998e7081ba/" target="_blank" rel="noopener">Mañjuśrī</a> performed <em>jalastambhana yoga</em> in an attempt to stop water from shooting out of the ground, he received a vision of Hevajra along with his consort Nairātmā. <em>Disi</em> Puja is performed in memory of that event. On this occasion, Śākyas and Vajrācāryas consume <em>prajñābva</em>, the <a href="../meaning/be0b5c8d-469a-4610-9fc8-57c861bb0fd0/" target="_blank" rel="noopener"><em>samaybaji</em></a> set on two <em>catāṃmari</em> (thick pancake made of rice flour). <em>Disi</em> Puja is also referred to as <em>Sambarodaya Daśamī</em>.</p>
41105b58-f08b-4460-89d4-ae578e46611a	thvã	थ्वँ	<p><a style="color: black; text-decoration: none;" name="note--5"></a>[New.] n. homemade spirituous liquor prepared from fermented rice.</p>
5d888fca-b9eb-482e-be02-374f4927a889	dakṣiṇā	दक्षिणा	<p>[S.] var. <em>dachiṇā, dachīnā;</em> sacrificial fee or wage paid to the priest at the end of a ritual.</p>
4b8b39b9-9191-4ee0-b68c-c90c53ffb291	paisā	पैसा	<p>n. monetary unit equivalent to one-fourth of an <em><a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener">ānā</a>,</em> and consisting of four <a href="../meaning/5c45d66c-f89d-4f57-806c-452b69ed27c2/" target="_blank" rel="noopener"><em>dāma</em></a>s.</p>
4f56ca65-4f2c-4d5d-ae51-7ed7dfbe42ee	cakū	चकू	<p>var. <em>cakuri</em>, <em>cakuli</em>; n. it is the Newar term for <a href="../meaning/0b57f28b-6868-4dac-996b-c9303bb1fe2e/" target="_blank" rel="noopener"><em>harmikā</em></a> or cube of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. It is the part that is placed on top of the dome (New. <em>gvaḥ</em>/<em>cibhāḥgvaḥ</em>) and is the part that invariably contains a pair of eyes and a curl of hair called <em>urṇa</em>. The eyes represent <em>vajradṛṣṭi</em>, the Adamantine View (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/TMRR73VW/library" target="_blank" rel="noopener">Gutschow 1997</a>: 21). <em>Urṇa</em> in this case means a circle of hair between the eyebrows (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 221). This curl of hair is the <em>mahāpuruṣalakṣaṇa</em> that signifies nobility and illumination–one of 32 such special marks of the Buddha (Gutschow 1997: 21); syn. <em>gala</em> (neck).</p>
81a46ca0-7234-42f9-86c4-efaee2127d5e	mohararupaiyā̃	मोहररुपैयाँ	<p>var. <em>mohararupaiyāṃ, mohararūpaiyā;</em> often abbreviated as <em>moru, morū, moharu, moharū, moharru, mohorru;</em> n. monetary unit equivalent to two eight-<a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener"><em>anna</em></a> silver coins (<a href="../meaning/7901aee7-bb65-4883-8c46-02ab2054d327/" target="_blank" rel="noopener"><em>mohara</em></a>s), four <a href="../meaning/2865d637-f58d-4399-9aae-eed2a42c0a2c/" target="_blank" rel="noopener"><em>sukā</em></a>s, 16 <em>ānā</em>s or 64 <a href="../meaning/4b8b39b9-9191-4ee0-b68c-c90c53ffb291/" target="_blank" rel="noopener"><em>paisā</em></a>s (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/pant%20and%20p/titleCreatorYear/items/VRMHZ2FE/item-list" target="_blank" rel="noopener">Pant and Pierce 1989</a>: 93). In documents sums are represented in four numerical fractions, with the <em>rupaiyā</em> represented by numbers; the <em>sukā</em>s by one to three <em>daṇḍa</em>s (vertically straight line) or the <em>avagraha</em> sign representing zero; the <em>ānā</em>s by one to three diagonal dashes, sometimes as a loop with two or three jags; the <em>paisā</em>s again by <em>daṇḍa</em>s or numbers.</p>
2eaf799d-45c7-434a-a9a2-3984dc12947c	akṣatā	  अक्षता	<p>[S.] (old New. <em>ākhata</em>) n. grains of rice that have their hulls carefully removed to make sure that the grains are undamaged for using as an offering for deities during worships. Such grains of rice are indispensable for a worship that requires setting up a <a href="../meaning/66940c3a-749a-4985-a3b8-e8f8ac85dcc4/" target="_blank" rel="noopener"><em>kalaśa</em></a>, syn. <em>ākhey</em> (New.).</p>
d90aa579-2f1f-4583-b4e1-5c1373900c03	bajra	बज्र	<p>var. <em>barja</em>; n. brick dust used as a traditional form of plaster. It is a mixture of <em>cāku</em> (molasses), black pulse, jute, <em>surki</em> (brick dust) and <em>sakhvāḥ</em> (lime). The ground black pulse is mixed with molasses and jute and well pounded. Then brick dust and lime are added. Only a little water is added to let the lime develop its setting quality (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/XSYICRHF/library" target="_blank" rel="noopener">Gutschow et al. 1987</a>: 189).</p>
73788047-7ee5-4312-a416-8fce04c7a78e	Devanāgarī	 देवनागरी	<p>[S] n. the script of many Indic languages such as Sanskrit, Nepāli, Maithilī, Bhojapurī, etc. The characters are written from left to right and a straight line runs along the top of all full characters, ending with each word.</p>
49cb3a94-81c4-461e-9396-43a54c406e34	bāhāḥ puja	बाहा: पुजा	<p>var. <em>bāḥpujā</em>; n. a procession taken out from a particular location that visits all the Buddhist monasteries in the city. Devotees offer items of their choice mainly to all the caityas on the route. A <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> puja is usually organized after establishing a new caitya or after completing a major renovation/reconstruction work and it commences from the site where the new installation or renovation took place. The procession is accompanied by traditional musical instruments.</p>
e78321e8-b731-4a30-9900-8d6bc813a133	Śākyasiṃha 	शाक्यसिंह	<p>n. lit. the lion of the Śākya clan, it is another name of Gautama Buddha, who is also known as <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/" target="_blank" rel="noopener">Śākyamuni</a> Buddha.</p>
d71603d5-3d7d-481c-96ca-8f0673850a7a	daśa akuśala karma	दश अकुशल कर्म	<p>var. <em>daśākuśala</em>; n. lit. ten non-righteous actions; it is a Buddhist concept that categorizes ten improper actions as non-righteous that ruin one's future. Such actions are committed by one's body, mind and speech. 1) Violence, 2) theft and 3) illicit sexual acts are three non-righteous actions that one's&nbsp; body can commit; 4) greed, 5) anger and 6) superstition are the three improper actions that one's mind can commit; and 7) lying, 8) back biting, 9) harsh speech, and 10) nonsense talks are the improper actions that one can commit by the means of speech (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/bauddha%20dar/titleCreatorYear/items/3MTMCT2G/item-list" target="_blank" rel="noopener">Vajrācārya 2010</a>: 44). It is sometimes referred to as ten non-righteous sins as well.</p>
0aca5ad4-975b-4bcd-941d-5e60b9f655a1	jaḥsi	ज:सि	<p>var. <em>jarasi</em> / <em>jalasi</em> / <em>jalaśī</em> (Old New.); n. large cooking pot with deep round basin similar to a cauldron, but made of copper with rings on two sides for carrying it. It is mostly used for cooking meat items in large quantity over an open fire; syn. <em>khāsi.</em></p>
acc394cf-6ab3-4448-bdd1-3e117407e248	lakṣa caitya	लक्ष चैत्य	<p>var. <em>lakha caitya</em>; n. small <em><a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener">caitya</a></em>s of clay moulded by devotees that are deposited in the foundation in the course of constructing a new <em>caitya.</em> Usually a grand ceremony is organized that allows devotees to contribute in making them. The making of <em>lakṣa</em> <em>caitya</em>s is locally known as <em>lucidyaḥ thāygu</em>; syn. <em>lucidyaḥ</em></p>
328b31f5-e25e-4eb9-ae85-e3fcf0056d48	bhikṣu	 भिक्षु	<p>[S.] vernacular <em>bhicchu</em>, <em>bhikchu</em>; a Buddhist mendicant or monk. In the Newar context, however, members of the Buddhist castes like Śākya and Vajrācārya are all <em>bhikṣu</em>s, but they are not celibate. Therefore, they are sometimes called <em>gṛhastha bhikṣu</em> - a householder monk. They do lead a life of a monk for four days during the <a href="../meaning/7905baa8-f0fb-469d-b63c-ec63ec6b3790/" target="_blank" rel="noopener"><em>bare chuigu</em></a> ritual, when they also go around to receive alms. Some Śākyas used to identify themselves as Śākyavaṃśa, Śākyabhikṣu, Brahmacarya Bhikṣu, Bauddhācārya/Buddhācārya and <a href="../meaning/e2e9de60-fa4e-43a3-a9e7-a2f31b9b23a8/" target="_blank" rel="noopener">Cailaka Bhikṣu</a> in the past. About thirty to forty years ago (1950s to 1960s) all Śākyas changed their surname from various longer forms (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/TJX3TK6V/library" target="_blank" rel="noopener">Gellner 1992</a>: 165). But Bauddhācāryas/Buddhācāryas have retained their caste to date.</p>
2906f351-f538-4451-8794-b6c1f8189ec6	Maitreya 	मैत्रेय	<p>n. a Bodhisattva worshipped as the future Buddha, who is believed to be residing in the Tuṣita heaven preparing to descend to the earth in the human form 4,000 years after the disappearance of Gautama Buddha (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/F3DUFDJB/library" target="_blank" rel="noopener">Bhattacharyya 1958</a>: 80). He is sometimes portrayed as white in colour wearing a <em>jaṭāmukuṭa</em> (crown of matted hair). His two hands carry chowrie-jewel in the right and <em>nāgakeśara</em> flower in the left (Bhattacharyya 1958: 78). He is also described as a three-faced, three-eyed and four-armed deity with a gold-like yellow complexion. He is highly ornamented and his right and left faces are of blue and white. He sits in the <a href="../meaning/35a51611-26c8-4600-b1d0-3beb0822b4b5/" target="_blank" rel="noopener"><em>paryaṅka āsana</em></a> on an animal. His two principal hands exhibit the <a href="../meaning/2e98b0ba-5e6e-4df0-a61f-fc77ff553d8d/" target="_blank" rel="noopener"><em>dharmacakra mudrā</em></a> while the other two hands display <a href="../meaning/7efd0bcb-12c1-42ea-80c3-bb9151a0c2a0/" target="_blank" rel="noopener"><em>varada mudrā</em></a> with the right and carry a fully blown <em>nāgakeśara</em> flower with its branches with the left (Bhattacharyya 1958: 81). It is believed that <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/" target="_blank" rel="noopener">Śākyamuni</a> Buddha first exhibited <a href="../meaning/4b8664aa-be05-4fa0-a8bf-6952e0dc3ed6/" target="_blank" rel="noopener"><em>bhaviṣyavyākaraṇa mudrā</em></a> in announcing that this would be the posture adopted by Maitreya Bodhisattva. This posture appears to be popular among the Newars only, as it does not seem to be mentioned elsewhere.</p>
4d2a843c-f823-4ddd-ac3a-08fe835efefc	karṣa	कर्ष	<p>n. a unit of measurement of land that equals 1/4th of a <a href="../meaning/49d0fa1d-c208-44c1-8f93-f9c5aae84db3/" target="_blank" rel="noopener"><em>ropanī</em></a>. This unit is usually taken as equal to <a href="../meaning/e5cbbbfa-9980-47da-92db-b518d3276416/" target="_blank" rel="noopener"><em>javā</em></a>. But <em>javā</em> is sometimes understood as 1/8th of a <em>ropanī</em> instead of 1/4th. However, <em>karṣa</em> or <em>javā</em> is accepted as equal to the measurement of 4 <a href="../meaning/69a27c41-31df-40be-a57f-3cca9bfc9d4f/" target="_blank" rel="noopener"><em>ānā</em></a>s (1368 sq. ft.) at present. This unit was also known as <em>culchi</em> in the Newar language (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/dhun%CC%87ge/titleCreatorYear/items/5EMKWRIH/item-list" target="_blank" rel="noopener">Dhuṅgela and Pradhānāṅga 2056</a>: 239).</p>
e2e9de60-fa4e-43a3-a9e7-a2f31b9b23a8	Cailaka Bhikṣu	चैलक भिक्षु	<p>n. an archaic caste name that refers to Buddhist householder monks who are initiated at a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> and not a monastery. They are Śākyas by caste and are now known as Cibhāḥ Bare, which literally means '<em>caitya</em> monk'. '<em>Cailaka</em>' derives from a Sanskrit term '<em>cela</em>' that refers to a monk's robe. Cibhāḥ Bare is used for half-caste boys—sons of Śākya or Vajrācārya fathers by lower-caste mothers—who are initiated not in a monastery but at a <em>caitya</em>. They, therefore, are not a member of the <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener"><em>saṃgha</em></a> of any <a href="../meaning/1e10902f-0508-4edb-bd3d-a6bba2def825/" target="_blank" rel="noopener"><em>bāhāḥ</em></a> or <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a>, or obtain the rights, duties and public confirmation of the Śākya caste status of a monastic community (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/TJX3TK6V/library" target="_blank" rel="noopener">Gellner 1992</a>: 165). There is, however, another category of Cailaka Bhikṣus: the initiated members of Micchu Bāhāḥ (<a href="../../../report/054498ec-d633-11e9-beea-0242ac140006" target="_blank" rel="noopener">LAL1100</a>) in Patan. They are not half-caste Śākyas and have a fully functional <em>saṃgha</em> with five <a href="../meaning/2b21bab6-ce62-4564-8ace-8b6db905138b/" target="_blank" rel="noopener"><em>āḥju</em></a>s who take part in the esoteric worship at the <a href="../meaning/cddd0c49-3813-4d05-bd1a-dd91e02b0a6f/" target="_blank" rel="noopener"><em>āgaṃ</em></a> on the day of the <em>saṃgha bhojana</em>, the annual feast of all male members of the monastery. Boys of Micchu Bāhāḥ members are initiated at the <a href="../meaning/5e99a464-6fbe-47d0-bd8b-d4790b0e7a51/" target="_blank" rel="noopener"><em>durgatipariśodhana caitya</em></a> in front of its monastic building to be inducted into the <em>bāhāḥ</em>'s <em>saṃgha</em>; syn. Cailaka Bandeju, Cibāhāḥ Bare.</p>
35bbce88-d716-4b55-9bd0-bfc91bf5fdf5	kvāḥpāḥdyaḥ	 क्वा:पा:द्य:	<p>[fr. old New. <em>kvācapāla deva</em>] var. <em>kvāpaḥdyaḥ</em>, <em>kvāḥbhāḥju</em>; n. principal deity of a Buddhist monastery. Enshrined on the ground floor of the main building of a monastery, <em>kvāḥpāḥdyaḥ</em> is almost always facing the main entrace to the monastery complex. Excluding one exception in Vaṃ Bāhāḥ in Bhaktapur where Mahāvairocana is enshrined as the principal deity (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/buddhist%20monasteries%20/titleCreatorYear/items/5A9SNX3X/item-list" target="_blank" rel="noopener">Locke 1985</a>: 516), the <em>kvāḥpāḥdyaḥ </em>is always a non-tantric deity, usually an image of the Buddha such as, <a href="../meaning/504909e8-0ade-4497-abd0-d58e091d36af/" target="_blank" rel="noopener">Akṣobhya</a>, <a href="../meaning/128aa38c-4b9a-4b62-b6e9-53d44326d8c4/">Śākyamuni</a>, <a href="../meaning/2906f351-f538-4451-8794-b6c1f8189ec6/" target="_blank" rel="noopener">Maitreya</a> etc.</p>
b7a99b22-8958-42a9-9f99-57df63d2bccf	Om Namo Ratnatrayāya	ॐ नमो रत्नत्रयाय	<p>var. <em>Ratnatrayāyaḥ</em>; n. lit. three gems, i.e., the Buddha, the Dharma and the <a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener">Saṃgha</a>. The Buddha, his teachings (Dharma) and the monastic associations (Saṃgha) are collectively known as <em>Ratnatraya,</em> or the three gems of Buddhism. The Buddhists offer homage to the <em>Ratnatraya</em> before the start of any auspicious event. '<em>Om Namo Ratnatrayāya</em>' is a common phrase used at the beginning of any inscription installed by any Buddhist devotee/s.</p>
4ec36cb9-d4a4-4078-a13b-2c572e7d387c	Nepālamaṇḍala	नेपालमण्डल	<p>n. a reference to a geographical region in central Nepal during the ancient and medieval period that came under the jurisdiction of the ancient Nepāla kingdom. The territory of Nepālamaṇḍala stretched to Tāmākośī (Rāmechāpa) to the east, Triśulī (Nuvākoṭa) to the west, Śivapurī (Gosāī̃kuṇḍa, Rasuvā) to the north and Cisāpānī (Makavānapūra) to the south (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/9CMWW68H/library" target="_blank" rel="noopener">Tamoṭa NS 1126</a>: 13). An undatable inscription from Jñāneśvara, Kathmandu installed during the reign of <a href="../meaning/f67f58f1-3839-4d81-95a6-4b78e97566ce/" target="_blank" rel="noopener">Licchavī</a> King Jayadeva (713-733 CE) mentions 'the <em>adhikaraṇa</em>s (courts) within Nepālamaṇḍala', which appears to be the first mention of the term Nepālamaṇḍala in inscriptions (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/GLJIEING/library" target="_blank" rel="noopener">Vajrācārya VS 2030</a>: 574-575). </p>
d970fa39-7849-405b-8e5c-e987a244752f	dharmadhātu caitya	धर्मधातु चैत्य	<p>n. lit. a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> constructed on the basis of the <a href="../meaning/63a4e521-052f-4fbf-920b-13e3cb7ed2bb/" target="_blank" rel="noopener"><em>dharmadhātu maṇḍala</em></a>. It usually is a reference to a <em>dharmadhātu maṇḍala</em> itself rather than a <em>caitya</em> of a separate kind.</p>
51895416-eeb1-40ff-a8e4-48d0b2da4441	gandhakuṭī	गन्धकुटी	<p>n. the main sanctum of a <a href="../meaning/55bb0257-45c7-432b-bd93-270c14f90954/" target="_blank" rel="noopener"><em>bahī</em></a> where its <a href="../meaning/bd3d0c88-5a22-4da6-8fc4-0d138ada7166/" target="_blank" rel="noopener"><em>gandhurī devatā</em></a> is enshrined.</p>
06a61ae4-bfd1-43d6-bb4a-52f675514ef9	mākaḥdalū	माक:दलू	<p>n. lit. a lampstand with a monkey; a flat clay lampstand with a slightly concaved surface at one end and an image of a monkey at the other end. Its two sides are slightly raised so that when a <em>salī</em> (wide-mouthed small clay pot) is overturned on top of the burning wick, it does not put off the flame and an ample amount of soot is collected in it. The soot is then used as <em>Mohani sinhaḥ</em>, a black <em>ṭikā</em> that is put on someone's forehead together with vermillion powder. The process of collecting soot from oil lamp is called <em>Mohani phaygu</em>. <em>Mohani sinhaḥ</em> is used during the <em>Mohani</em> festival of the Newars that coincide with the <a href="../meaning/dbdfb21e-2b84-4ff9-b6dd-8721d49fe6ba/" target="_blank" rel="noopener"><em>Dasaĩ</em></a> and during esoteric worships.</p>
f0ac0a85-9fb9-4744-80dc-6c84d296b648	Ilā Nani	इला ननि	<p>var. Ilanani; a courtyard situated in between Kvāḥ Bāhāḥ and Nāga Bāhāḥ (<a href="../../../report/cb03ff18-e75a-11e9-8bc4-0242ac130002" target="_blank" rel="noopener">LAL0930</a>) in Patan. The name Ilā Nani comes from Ināyalaṅhe, the old name of the courtyard that means 'a rectangular yard right behind <a href="../meaning/9df10b72-35b6-47c7-8299-465b0b2e3e77/" target="_blank" rel="noopener"><em>Ināy</em></a>'. A <a href="../meaning/f3a3235a-8379-4970-abf0-22cd40b3149e/" target="_blank" rel="noopener"><em>phalcā</em></a> with an idol of <a href="../meaning/7aad7687-0518-4851-8023-8346d4239540/" target="_blank" rel="noopener">Ganedyaḥ</a> facing west stands at the north-western corner of the courtyard with an adjoining yard to its back.</p>\n<p>Old name [Occurance]: Ināyalaṅhe [<a href="../../../report/f137422b-7d56-4150-bd68-b1997b8ca42e" target="_blank" rel="noopener">LAL1100_I_001</a>/<a href="../../../report/0c92f054-8271-46e0-942a-8ec753f22260" target="_blank" rel="noopener">LAL1100_I_002</a>]</p>
