t 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->var. Kāma; n. the Eros of the eastern mythology; the god of love. He is sometimes said to be self-born <em>(ātma-bhū)</em> or un-born <em>(aja).</em> He is a <a href="../meaning/601f68e4-2ab1-42ed-9656-33aa9f826c52/" target="_blank" rel="noopener"><em>yakṣa</em></a> and identical with the Buddhist Māra. His wife <a href="../meaning/2efd6bc4-ac88-450c-9bc0-f81a8dceb56a/">Rati</a> or Revā is the embodiment of wifely love; their daughter Tṛṣṇā (or Tṛṣā) represents ‘thirst’ as a form of desire (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/2WGHSBJU/library">Stutley 1977</a>: 139).</p>
e5cbbbfa-9980-47da-92db-b518d3276416	javā	जवा	<p>var. java; n. an area measurement unit equal to 22.5 <em>hāta</em> (cubit) (Ain-54 5.38-40). It is equal to 1/4th of a <a href="../meaning/49d0fa1d-c208-44c1-8f93-f9c5aae84db3/" target="_blank" rel="noopener"><em>ropanī</em></a>.</p>
e00d96fa-eb37-404d-998d-97f6fa1e4153	vajradhātu caitya	वज्रधातु चैत्य	<p>n. a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a> constructed on the basis of the <a href="../meaning/e2c91165-4a65-4542-a88d-407d8305c0a1/" target="_blank" rel="noopener"><em>vajradhātu maṇḍala</em></a>. In the course of constructing a <em>caitya</em>, a <a href="../meaning/aa293109-2a65-4f22-97e2-e451e274f423/" target="_blank" rel="noopener"><em>maṇḍala</em></a> is traced on the ground to perform the ritual of <em>sūtrapātana</em> (the sanctification of the building ground), while a <em>maṇḍala</em> each is employed for other rituals like <em>pādasthāpanā</em> (laying of the foundation) as well as <a href="../meaning/f72994ee-e04b-4c30-83fb-ab16a037adff/" target="_blank" rel="noopener"><em>ratnanyāsa</em></a> (ritual deposition of jewels). These maṇḍalas are based on <em>vajradhātu maṇḍala</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/von%20rospatt/titleCreatorYear/items/GZF93MG8/item-list" target="_blank" rel="noopener">von Rospatt 2010</a>: 235).</p>
f5760da2-b6be-430d-828a-373d2b28a86f	Thiṃlā	थिंला	<p>n. the second month according to the Newar lunar calendar that falls around December. The month begins with the bright fortnight called Thiṃlā <a href="../meaning/077b980b-a53d-4f28-92f0-bf35229796fc/" target="_blank" rel="noopener">Thva</a> that corresponds to the bright fortnight of <a href="../meaning/92c18b60-16a1-41ec-bb0d-bb0178e057c5/" target="_blank" rel="noopener">Mārgaśīrṣa</a> while its dark fortnight, Thiṃlā <a href="../meaning/f6c385a4-13a2-485c-8e87-6559276cef50/" target="_blank" rel="noopener">Gā</a>, corresponds to the dark fortnight of <a href="../meaning/9c6b3887-5d93-409f-935d-a85b34f4f5a0/" target="_blank" rel="noopener">Pauṣa</a>. The full moon day of Thiṃlā is observed as <a href="../meaning/b52cfe2b-cdd4-4aae-a420-b3a1b9ffeaba/" target="_blank" rel="noopener">Yaḥmari</a> Punhi. <a href="../meaning/f86c1919-372c-43b2-af48-0031037a2837/" target="_blank" rel="noopener">Disi Puja</a> also falls in this month.</p>
96638974-9c21-4756-b26a-ecafd6d2f20a	Sillā	सिल्ला	<p>n. the fourth month according to the Newar lunar calendar that falls around February. The month begins with the bright fortnight called Sillā <a href="../meaning/077b980b-a53d-4f28-92f0-bf35229796fc/" target="_blank" rel="noopener">Thva</a> that corresponds to the bright fortnight of <a href="../meaning/063dae1f-37d1-43b9-bf33-5ff3bd435678/" target="_blank" rel="noopener">Māgha</a>, while its dark fortnight, Sillā <a href="../meaning/f6c385a4-13a2-485c-8e87-6559276cef50/" target="_blank" rel="noopener">Gā</a>, corresponds to the dark fortnight of <a href="../meaning/ced73f22-4362-407b-a7d8-32fc78f6dc5e/" target="_blank" rel="noopener">Phālguna</a>. The full moon day of Sillā is known as Sipunhi. <a href="../meaning/91e14fae-97ea-4d7f-b0cc-4fdaf0fe76dc/" target="_blank" rel="noopener">Śrīpañcamī</a> is observed this month.</p>
343fe941-3ccc-46dc-9c3e-9e9bab074788	abhaya	अभय	<p>[S.] n. <span style="font-family: Calibri, Helvetica, sans-serif; color: #000000; font-size: medium;"><span id="divtagdefaultwrapper" style="font-size: 12pt;"><span style="font-family: Calibri, Helvetica, sans-serif, Helvetica, EmojiFont, Apple Color Emoji, Segoe UI Emoji, NotoColorEmoji, Segoe UI Symbol, Android Emoji, EmojiSymbols; font-size: medium;"><span id="divtagdefaultwrapper" style="font-size: 12pt;"><span style="font-family: Trebuchet MS, sans-serif; font-size: medium;"><span style="font-size: 11.5pt;">brave, secure, fearless, undaunted </span></span></span></span></span></span>(see <a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 60)</p>
0b57f28b-6868-4dac-996b-c9303bb1fe2e	harmikā	 हर्मिका	<p>[S.] n. <em>gala</em> (New.); cube that serves as the base of the finial of a <a href="../meaning/07734ba3-4482-4dc0-be30-a7bda0ec102f/" target="_blank" rel="noopener"><em>caitya</em></a>. Each of the four faces of the cube is carved with a pair of eyes depicting <em>vajradṛṣṭi</em> (Adamantive View) and the <em>ūrṇa</em>, the curl of hair that grows between the brows, which signifies <em>mahāpuruṣalakṣaṇa</em>–the trait of nobility and illumination (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/nepalese%20caitya/titleCreatorYear/items/TMRR73VW/item-list" target="_blank" rel="noopener">Gutschow 1997</a>: 21). In <em>caitya</em>s, the <em>ūrṇa</em> usually takes a shape of a curl heading upward or going downward in between the eyes seemingly replacing a nose.</p>
