 5"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 5"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 5"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 5"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 5"/>\n  <w:LsdException Locked="false" Priority="46"\n   Name="List Table 1 Light Accent 6"/>\n  <w:LsdException Locked="false" Priority="47" Name="List Table 2 Accent 6"/>\n  <w:LsdException Locked="false" Priority="48" Name="List Table 3 Accent 6"/>\n  <w:LsdException Locked="false" Priority="49" Name="List Table 4 Accent 6"/>\n  <w:LsdException Locked="false" Priority="50" Name="List Table 5 Dark Accent 6"/>\n  <w:LsdException Locked="false" Priority="51"\n   Name="List Table 6 Colorful Accent 6"/>\n  <w:LsdException Locked="false" Priority="52"\n   Name="List Table 7 Colorful Accent 6"/>\n </w:LatentStyles>\n</xml><![endif]--><!-- [if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n\t{mso-style-name:"Table Normal";\n\tmso-tstyle-rowband-size:0;\n\tmso-tstyle-colband-size:0;\n\tmso-style-noshow:yes;\n\tmso-style-priority:99;\n\tmso-style-parent:"";\n\tmso-padding-alt:0in 5.4pt 0in 5.4pt;\n\tmso-para-margin-top:0in;\n\tmso-para-margin-right:0in;\n\tmso-para-margin-bottom:8.0pt;\n\tmso-para-margin-left:0in;\n\tline-height:107%;\n\tmso-pagination:widow-orphan;\n\tfont-size:11.0pt;\n\tmso-bidi-font-size:10.0pt;\n\tfont-family:"Calibri",sans-serif;\n\tmso-ascii-font-family:Calibri;\n\tmso-ascii-theme-font:minor-latin;\n\tmso-hansi-font-family:Calibri;\n\tmso-hansi-theme-font:minor-latin;\n\tmso-bidi-font-family:Mangal;\n\tmso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->n. lit. even feet, it is the position of feet and legs of a standing image. The <em>samapāda</em> posture is mentioned as having straight legs. In this position the distance between the feet is of 1 <em>tāla</em> (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Nardi%20/titleCreatorYear/items/DV5VJ8BR/item-list" target="_blank" rel="noopener">Nardi 2006</a>: 99). One <em>tāla</em> is a span measured by the thumb and middle finger (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/NMX4HH26/library" target="_blank" rel="noopener">Monier-Williams 1964</a>: 445).</p>
b713c254-a404-49bc-9348-12d926d438ab	samabhaṅga	समभङ्ग	<p>[S.] n. lit. without bending or inflection; is a posture having equipoised body where the right and the left of the figure are disposed symmetrically, the <em>sutra</em> or plumbline passing through the navel from the crown of the head to a point midway between the heels (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/76DH5GQU/library" target="_blank" rel="noopener">Stella 2009</a>: 119); see <a href="../meaning/79c7d837-acc1-4acb-9085-0694b8fadbc5/" target="_blank" rel="noopener"><em>tribhaṅga</em></a></p>
79619269-ae40-4889-9bb9-65dce0ba51ae	Dharmacakra	धर्मचक्र	<p>[S.] n. lit. the wheel of Dharma; is a symbol widely used in Buddhism to represent the Buddha's teachings and moral order. Sometimes also translated as the Wheel of Law, Dharmacakra as a symbol is a yellow wheel with eight spokes that represent <em>Ārya Aṣṭāṅgika Mārga</em> (the Noble Eightfold Path). Its centre is more like a centre bore of a wheel and is divided into three parts, representing <em>Triratna</em> (the Triple Gem, i.e., the Buddha, the Dharma, and the <em><a href="../meaning/622b3411-6d2e-442f-8557-0b1e50336c67/" target="_blank" rel="noopener">Saṃgha</a>)</em> and also <em>Trilakṣaṇa,</em> the Three Universal Characteristics, that are, <em>anitya</em> (Impermanence), <em>dukkha</em> (Suffering) and <em>anātmā</em> (Soullessness). Dharmacakra is one of the eight auspicious emblems of <a href="../meaning/ef2e0fa1-30a6-441b-af77-fbe67c18a0cb/" target="_blank" rel="noopener"><em>aṣṭamaṅgala</em></a> in Mahāyāna tradition.</p>
d3aa7e0e-7eb2-455f-a67d-290ae62922ae	Gunpunhi	  गुन्पुन्हि	<p>var. <em>Gũpunhi</em>, <em>Guṃpunhi</em>; n. the full moon day of <a href="../meaning/17e908a4-676c-4503-82e0-b4e58b72496b/" target="_blank" rel="noopener">Guṃlā</a> (August-September) that is referred to as <em>Janai Pūrṇimā</em> by the non-Newars. The Newars consume <em>kvāti</em>, lit. a hot soup, made out of a mixture of soaked beans, pulses, peas etc. on this day. Therefore, the day is also known as <em>Kvātipunhi</em>.</p>
93f98d28-f6a3-45a0-acf0-689b58dab666	Pāhāṃcaḥrhay 	 पाहांच:ह्रय्	<p>var. <em>Pāṃcaḥrhay</em>, <em>Pāhā̃carhay</em>, <em>Pāhā̃ Carhe</em>; n. the 14th of the dark fortnight of <a href="../meaning/3a0652b7-e273-480b-a973-1172461ec0d0/" target="_blank" rel="noopener">Caitra</a> when the Newars worship Lord <a href="../meaning/b6606be2-97ff-43c0-8b17-dcf868cfda86/" target="_blank" rel="noopener">Śiva</a> in the form of <a href="../meaning/9e19027f-33e2-4cfc-9001-516e03df7344/" target="_blank" rel="noopener">Lukumahādyaḥ</a>, the hiding Śiva. On the night of <em>Pāhāṃcaḥrhay</em>, the area of Lukumahādyaḥ is cleaned and lights are offered. He is then offered red and yellow flowers, smoking incense and foods that include meat, garlic and alcoholic drink, otherwise rather disliked by Lord Śiva. Since garlic plays a major role in the offering, the day is sometimes known as <em>labhā</em> (<em>lābhā</em>) <em>nakhaḥ</em>, the festival of garlic (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/lukuma/titleCreatorYear/items/UBHEIG48/item-list" target="_blank" rel="noopener">Michaels 1992</a>: 194). People also consume a lot of garlic on this day. The day is known as <em>Lukuṃcaḥrhay </em>(var. <em>Lakhuṃcaḥrhay</em><em>)</em> in Patan; syn. <em>Pāśācaḥrhay</em> (var. <em>Pāsācaḥrhe</em>), <em>Piśāca Caturdaśī</em>, <em>Preta Caturdaśī</em>.</p>
90c1dac7-a621-4f5f-8d4d-556f69ad2095	pañcadāna/pañjrāṃ 	पञ्चदान/पञ्ज्रां	<p>var. <em>paṃcadāna, pañjadāna;</em> n. lit. offering of five items in charity; a Buddhist festival of charity observed on the 8th of the bright fortnight of <a href="../meaning/cb906d38-016b-47d0-92bc-a8fdd8c3e821/" target="_blank" rel="noopener">Śrāvaṇa</a> in Patan, and on the 14th of the dark fortnight of <a href="../meaning/4b0551a5-e3df-4783-bd00-a4b071f82c72/" target="_blank" rel="noopener">Bhādra</a> in Kathmandu and Bhaktapur. Although widely understood as the festival of donating five items like rice, wheat, etc., the actual name of the festival is <em>pañjāsti,</em> a compound of <em>pañja</em> (rice cooked in milk; <em>kṣīra</em> in Sanskrit) and <em>asti</em> (the 8th day of a lunar fortnight) (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/Bajr%C4%81c%C4%81rya%20/titleCreatorYear/items/XPAJ5BTT/item-list" target="_blank" rel="noopener">Bajrācārya 2017</a>: 80). An inscription from Kani Bāhāḥ (<a href="../../../report/f2154aee-e656-11e9-b125-0242ac130002" target="_blank" rel="noopener">LAL2240</a>) in Patan refers to the festival as <em>Pañjā-asti</em> (<a href="../../../report/e125bff6-42e5-4a00-9157-8e82ea9ce980" target="_blank" rel="noopener">LAL2240_I_001</a>). Śākyas and Vajrācāryas walk round the city, receiving alms on the respective days; locally known as <em>pañjrāṃ</em> and <em>pañjāṣṭamī.</em></p>
49ee4644-b24e-4227-9aac-149be56ebeb7	trikhājhyāḥ	त्रिखाझ्या:	<p>n. window with a row of three small openings usually found on the first floor of a monastery.</p>
565b8a73-7421-4c12-aae1-85c0f68a8b30	dyaḥpāḥlāḥ 	द्य:पा:ला:	<p>[New.] var. <em>dyaḥpāḥlāka;</em> n. lit. [someone who] gets the turn to caretake a deity, is a person who takes turn for a stipulated period of time for caretaking a shrine, temple or a monastery. A <em>dyaḥpāḥlāḥ</em> has to perform all the rituals of the deity he caretakes either by himself or have a suitable person do it. Usually, it is an unpaid responsibility, but he gets to enjoy the offerings made to the deity or religious monument all the while he remains its <em>dyaḥpāḥlāḥ</em>. Also functioning as a temple priest, he is a guardian of a deity or a temple altogether (a function entrusted to certain castes with respect to particular temples or deities).</p>
1b7dd1d9-4e97-4e81-b692-3c33fce9f139	ajidyaḥ	  अजिद्यः	<p>[fr. old New. ajideo] n. the name of a goddess (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/items/W5PIQQQK/item-details" target="_blank" rel="noopener">Malla 2000</a>: 3). A goddess who takes care of or protects children, also known as <em>devī</em>, Bhagavatī, Hāratīmātā, or Ākāśayoginī (<a href="https://www.zotero.org/groups/2247442/nhdp-bibliography/search/mali/titleCreatorYear/items/ZU555U7T/item-list" target="_blank" rel="noopener">Mālī 1130 NS</a>: 6). In the Kathmandu Valley, <em>ajidyaḥ</em> is also called <em>ajimā</em> or <em>ajimāju</em>; e.g. Hārati Ajimā, Śītalā Māju.</p>
